	(807,'_transient_feed_d117b5738fbd35bd8c0391cda1f2b5d9','a:4:{s:5:\"child\";a:1:{s:0:\"\";a:1:{s:3:\"rss\";a:1:{i:0;a:6:{s:4:\"data\";s:3:\"\n\n\n\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:7:\"version\";s:3:\"2.0\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:0:\"\";a:1:{s:7:\"channel\";a:1:{i:0;a:6:{s:4:\"data\";s:61:\"\n	\n	\n	\n	\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:1:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:16:\"WordPress Planet\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"http://planet.wordpress.org/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"language\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"en\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"WordPress Planet - http://planet.wordpress.org/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"item\";a:50:{i:0;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:94:\"WPTavern: WordPress Community Team Proposes Using a Decision Checklist to Restart Local Events\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=110022\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:233:\"https://wptavern.com/wordpress-community-team-proposes-using-a-decision-checklist-to-restart-local-events?utm_source=rss&utm_medium=rss&utm_campaign=wordpress-community-team-proposes-using-a-decision-checklist-to-restart-local-events\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4502:\"<img />photo credit: <a href=\"https://stocksnap.io/photo/checklist-goals-TBJ9OPDGMK\">Glenn Carstens-Peters</a>\n\n\n\n<p>WordPress&rsquo; Community Team has been <a href=\"https://wptavern.com/wordpress-community-team-discusses-return-to-in-person-events\">discussing the return to in-person events</a> since early December 2020, and has landed on an idea that would allow local meetup organizers to determine readiness <a href=\"https://make.wordpress.org/community/2021/01/07/proposal-decision-making-checklist-for-safe-in-person-meetups/\">using a COVID-19 risk-assessment checklist</a>. This would enable organizers to restart meetups when it is safe for their communities, instead of applying a blanket global policy.</p>\n\n\n\n<p>Countries like Australia, New Zealand, The Bahamas, Iceland, and Vietnam, are a few examples of locations that are doing a decent job containing the virus. In contrast, the United States logged more than 4,000 coronavirus deaths in a single day this week, pushing the daily average to over 2,700. While the situation remains bleak for many areas of the world, vaccines are rolling out to vulnerable populations, albeit slowly and with a few snags.</p>\n\n\n\n<p>In the previous discussion that happened in early December, WordPress lead developer Dion Hulse shared some feedback from Australian organizers who have been eager to restart their meetups.</p>\n\n\n\n<p>&ldquo;One of the problems faced in Australia (and probably NZ &amp; Taiwan too) has been the blanket worldwide restrictions companies have put in place,&rdquo; Hulse said. &ldquo;Australia/NZ have been lucky, the pandemic has been successfully contained &ndash; Australia has seen less than 30k cases this year, and NZ 2k cases. To put that in context, the USA has recorded more (detected) cases in 3 hours today than Australia did all year, and more in 30 minutes than NZ.&rdquo;</p>\n\n\n\n<p>Hulse said a few Australian meetup groups were denied the go-ahead for restarting because of the global restrictions, which has &ldquo;led to the abandonment of meetups once again (as online meetups have simply not worked here, as most people can still go out in person, so there&rsquo;s been no major push from most Australians to the online platforms like elsewhere).&rdquo;</p>\n\n\n\n<p>The Community Team&rsquo;s proposal for a checklist takes these more unique situations into consideration and allows organizers to move forward in areas where public health measures have adequately curbed the spread of the virus. A few example checklist items include the following:</p>\n\n\n\n<ol><li>Is your country&rsquo;s (or state&rsquo;s) average positivity rate over the past 28 days under 4%?</li><li>In the past 28 days, has your country or area&rsquo;s&nbsp;<a href=\"https://en.wikipedia.org/wiki/Basic_reproduction_number\">basic reproduction number</a>&nbsp;stayed under 1?</li><li>In the past 14 days, have there been under 50 new cases per 100,000 people reported?</li><li>Does your local government allow for in-person events?</li><li>If there is a cap on the number of people who can meet at a time, will you as an organizer follow this guideline?</li></ol>\n\n\n\n<p>Contributor feedback so far includes recommendations for dealing with violations of the guidelines and assessing the need for contact tracing in case meetup attendees are exposed during an event. Cami Kaos recommended that the team share a list of locations that have already been vetted using the checklist and have not met requirements.</p>\n\n\n\n<p>&ldquo;My hope is that this would reduce a lot of duplicated time and effort for areas that we already know aren&rsquo;t yet, by the standards we&rsquo;re setting, safe,&rdquo; Kaos said. &ldquo;It would save time and disappointment for organizers hoping to meet in person and also contributor time and energy for those deputies who will vet the applications to hold in-person events.&rdquo;</p>\n\n\n\n<p>Since the virus is mutating and countries are adapting in different ways, the situation can change rapidly, so organizers would need to be prepared to roll back to online events if conditions for safe meetups deteriorate. WordCamps are still out of the question for the time being, but the Community Team is seeking feedback on the <a href=\"https://make.wordpress.org/community/2021/01/07/proposal-decision-making-checklist-for-safe-in-person-meetups/\">proposal</a> by January 15, 2021, including additions to the checklist and recommendations for public health resources that could aid in guiding the process.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 09 Jan 2021 16:50:31 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"Matt: Autonomous and Beautiful Home Devices\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=53404\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"https://ma.tt/2021/01/autonomous-and-beautiful-home-devices/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1532:\"<p>Of all the smart home upgrades I&#8217;ve made, replacing all my regular smoke detectors with Nest Protects (Google&#8217;s smoke detector) has been the one that I regret the most.</p>\n\n\n\n<p>I don&#8217;t really need a smart smoke detector. It doesn&#8217;t need to talk, connect to wifi, and cost hundreds of dollars. I don&#8217;t need it integrated with my Google account which is impossible to share, so I need to be personally involved to replace one.</p>\n\n\n\n<p>But other smoke detectors are just so unsightly, and the Nest is light years ahead of the competition from a design standpoint.</p>\n\n\n\n<img />\n\n\n\n<p>There&#8217;s such an opportunity for something that looks as good as the Nest, but doesn&#8217;t require two-factor authentication to replace. I didn&#8217;t want to call it dumb but beautiful, so let&#8217;s say &#8220;autonomous and beautiful&#8221; appliances and home devices. I still want it to be smart, but if you&#8217;re going to have the risk profile of a device that connects to the internet, it needs to be worth it, like <a href=\"https://www.brilliant.tech/\">Brilliant</a>, <a href=\"https://www.sonos.com/\">Sonos</a>, smart TVs, or connected cameras.</p>\n\n\n\n<p>I&#8217;m becoming more wary of any hardware that requires an app, just because of the natural decay of non-SaaS and non-open source software. <a href=\"https://www.vanmoof.com/en-US\">Van Moof bikes</a> are beautiful, but will they still connect well when iOS 24 is out and Bluetooth has been removed from iPhones for security reasons?</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 08 Jan 2021 23:45:46 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:94:\"WPTavern: Blocked-Based Version of Twenty Twenty-One Nearing Readiness for the Theme Directory\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=110087\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:233:\"https://wptavern.com/blocked-based-version-of-twenty-twenty-one-nearing-readiness-for-the-theme-directory?utm_source=rss&utm_medium=rss&utm_campaign=blocked-based-version-of-twenty-twenty-one-nearing-readiness-for-the-theme-directory\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5300:\"<img />\n\n\n\n<p class=\"has-drop-cap\">Twenty Twenty-One Blocks, now renamed to TT1 Blocks, is inching its way toward the WordPress theme directory. Kjell Reigstad mentioned the prospect in this week&rsquo;s <a href=\"https://make.wordpress.org/themes/2021/01/06/block-based-meeting-notes-january-6/\">block-based themes meeting</a>. Contributors to the theme, which is part of the <a href=\"https://github.com/WordPress/theme-experiments\">Theme Experiments</a> project, have pushed some much-needed code updates to the repository.</p>\n\n\n\n<p><a href=\"https://github.com/WordPress/theme-experiments/tree/master/tt1-blocks\">TT1 Blocks</a> is the block-based version of the Twenty Twenty-One theme. Its goal is to provide a version of the original theme that works with Full Site Editing (FSE), currently only available through the Gutenberg plugin.</p>\n\n\n\n<p>FSE needs more testers. And, testers need themes that will enable the site editor in Gutenberg. Currently, there are only two WordPress themes, <a href=\"https://wptavern.com/q-first-fse-wordpress-theme-now-live\">Q</a> and <a href=\"https://wptavern.com/block-based-bosco-second-full-site-editing-theme-lands-in-the-wordpress-directory\">Block-Based Bosco</a>, in the directory that support the site editor. <a href=\"https://wptavern.com/armando-wordpress-theme-provides-insight-into-the-current-state-of-full-site-editing\">Armando</a> should join them shortly. If a user attempts to find one via the <a href=\"https://wordpress.org/themes/tags/full-site-editing/\">FSE filter</a>, they will get no results, as pointed out by Gary Taylor in a <a href=\"https://wptavern.com/gutenberg-9-7-improves-user-experience-updates-reusable-blocks-and-brings-page-templates-to-fse-themes#comment-359503\">recent comment</a>. This seems to be an oversight by the theme authors and should be corrected.</p>\n\n\n\n<p>With most block-based themes relegated to a few GitHub repositories, it does not bode well if no one can find themes to test the most important set of features coming to WordPress in 2021. Users should be able to easily install an FSE-ready theme today.</p>\n\n\n\n<p>&ldquo;It has been brought up that it may be easier for people to test and contribute to full site editing if Twenty Twenty-One blocks was available in the WordPress theme directory,&rdquo; wrote Themes Team representative Carolina Nymark in a <a href=\"https://github.com/WordPress/theme-experiments/issues/140\">ticket about renaming TT1 Blocks</a>.</p>\n\n\n\n<p>TT1 Blocks is something that feels more official. While third-party block-based themes are needed, the <em>officialness</em> of something from core contributors gives more users a sense of trust. Plus, it would be easy for someone with .ORG administrator privileges to stick it to the top of the theme directory&rsquo;s featured page to get more eyes on it. <em>Doing this with a third-party theme would unleash a hoard of developers who want the same treatment for their themes.</em></p>\n\n\n\n<p>The prospect of the theme coming to the directory is something the WordPress project needs.</p>\n\n\n\n<p>The volunteers who have been chipping away at this TT1 Blocks have turned a <a href=\"https://wptavern.com/twenty-twenty-one-blocks-theme-launching-as-a-separate-project\">bare-bones theme</a> into something closer to the original Twenty Twenty-One. There are still some leaps remaining to get it to where it needs to be. Much is this rests in the Gutenberg development team&rsquo;s hands. There are currently over a <a href=\"https://github.com/WordPress/theme-experiments/projects/1#column-12084948\">dozen blockers</a> identified by the Theme Experiments project that need to be resolved in the Gutenberg plugin first.</p>\n\n\n\n<img />Single post in the site editor with TT1 Blocks\n\n\n\n<p>There are multiple open tickets on the <a href=\"https://github.com/WordPress/theme-experiments/projects/1\">project board</a> for theme developers who are looking for a way to contribute. This is an opportunity to learn more about block-based themes and pay it forward.</p>\n\n\n\n<p>At the moment, I am not-so-patiently awaiting the release of TT1 Blocks to the theme directory.</p>\n\n\n\n<p>There are days when I wonder if there is a final destination, some light at the end of this never-ending tunnel that leads to block-based themes being the norm. I get overexcited about each new project. I quickly test pull requests and updates on the handful of repositories I am watching, hoping for a glimpse of something spectacular.</p>\n\n\n\n<p>Part of this excitement is because I designed and developed WordPress themes for around 15 years in some form or fashion. Today, I am no longer in the design and development game. I must live vicariously through the people who are putting untold hours into this grand experiment. I get to tell their stories, which has its own rewards.</p>\n\n\n\n<p>I also know that this sort of development is a slog. Everyone has big ideas, but the real world calls for slow, steady, and dedicated work. Often it is thankless.</p>\n\n\n\n<p>When I saw the mere mention of TT1 Blocks potentially coming to the theme directory, it added a bit of spark to an otherwise rough few days. I wanted to end this particular week with something hopeful. And, testing out the latest work those volunteers have put into TT1 Blocks has done just that.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 08 Jan 2021 23:12:39 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"WPTavern: JetBrains Denies Being Under Investigation for SolarWinds Attack\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=110028\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:193:\"https://wptavern.com/jetbrains-denies-being-under-investigation-for-solarwinds-attack?utm_source=rss&utm_medium=rss&utm_campaign=jetbrains-denies-being-under-investigation-for-solarwinds-attack\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4847:\"<p>JetBrains, makers of Phpstorm, one of the most popular IDEs for PHP developers, has published a <a href=\"https://blog.jetbrains.com/teamcity/2021/01/statement-on-the-story-from-the-new-york-times-regarding-jetbrains-and-solarwinds/\">statement</a> denying any involvement in the SolarWinds attack, which compromised multiple US federal agencies and private companies. The company stated that it has not been the subject of an official investigation:</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>JetBrains has not taken part or been involved in this attack in any way. SolarWinds is one of our customers and uses TeamCity, which is a Continuous Integration and Deployment System, used as part of building software. SolarWinds has not contacted us with any details regarding the breach and the only information we have is what has been made publicly available.</p></blockquote>\n\n\n\n<p>This statement contradicts a recent New York Times <a href=\"https://www.nytimes.com/2021/01/06/us/politics/russia-cyber-hack.html\">article</a> that claimed unspecified officials were investigating the company&rsquo;s TeamCity continuous integration software as a possible entry point for the attack: </p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>By compromising TeamCity, or exploiting gaps in how customers use the tool, cybersecurity experts say the Russian hackers could have inconspicuously planted back doors in an untold number of JetBrains&rsquo; clients. Because TeamCity is so widely deployed, experts said, it is imperative to determine whether its software contains a vulnerability, or if attackers exploited TeamCity customers via stolen passwords or gaps in unpatched, outdated software.</p></blockquote>\n\n\n\n<p>The New York Times did not specify which officials and &ldquo;cybersecurity experts&rdquo; were the source for this information but claimed that SolarWinds was also investigating the software internally. A <a href=\"https://web.archive.org/web/20210106195835/https://www.nytimes.com/2021/01/06/us/politics/russia-cyber-hack.html\">previous version</a> of the article referred to JetBrains as &ldquo;an obscure software company,&rdquo; which <a href=\"https://twitter.com/razvanbunea/status/1347254615616729090\">ruffled the feathers</a> of the company&rsquo;s most ardent customers. SolarWinds told both the Times and <a href=\"https://www.wsj.com/articles/solarwinds-hack-breached-justice-department-systems-11609958761\">The Wall Street Journal</a> that it has not confirmed a definitive link between JetBrains and the breach of its own software.</p>\n\n\n\n<p>A&nbsp;<a rel=\"noreferrer noopener\" href=\"https://www.dni.gov/index.php/newsroom/press-releases/press-releases-2021/item/2176-joint-statement-by-the-federal-bureau-of-investigation-fbi-the-cybersecurity-and-infrastructure-security-agency-cisa-the-office-of-the-director-of-national-intelligence-odni-and-the-national-security-agency-nsa\" target=\"_blank\">joint statement</a> from the FBI, the Cybersecurity and Infrastructure Security Agency (CISA), the Office of the Director of National Intelligence (ODNI) and the National Security Agency (NSA) released this week points to Russia as the origin of the attacks: </p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>This work indicates that an Advanced Persistent Threat (APT) actor, likely Russian in origin, is responsible for most or all of the recently discovered, ongoing cyber compromises of both government and non-governmental networks. At this time, we believe this was, and continues to be, an intelligence gathering effort. We are taking all necessary steps to understand the full scope of this campaign and respond accordingly.</p></blockquote>\n\n\n\n<p>Phpstorm is widely used among WordPress developers, especially since&nbsp;<a rel=\"noreferrer noopener\" href=\"https://wptavern.com/phpstorm-8-released-with-full-wordpress-support\" target=\"_blank\">version 8 added official support for WordPress</a> in 2014. JetBrains users took to Twitter with questions and concerns about claims that the company was under investigation. Today, JetBrains published another <a href=\"https://blog.jetbrains.com/blog/2021/01/07/an-update-on-solarwinds/\">update</a> that clarifies its previous statement. It states that the company&rsquo;s IDEs are standalone tools with no relation to TeamCity and that there is no evidence that any of their servers or tools have been tampered with. </p>\n\n\n\n<p>JetBrains is organizing an independent security audit of TeamCity and has promised a transparent report of any vulnerabilities found that may have led to a breach.</p>\n\n\n\n<p>&ldquo;For over 20 years, one of our pillars has been to be transparent, honest, and truthful with our customers, and nothing hurts us more than seeing unfounded allegations that damage our reputation and instill doubt on our customers,&rdquo; JetBrains CEO Maxim Shafirov said.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 07 Jan 2021 23:12:39 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:114:\"WPTavern: Gutenberg 9.7 Improves User Experience, Updates Reusable Blocks, and Brings Page Templates to FSE Themes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=110018\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:269:\"https://wptavern.com/gutenberg-9-7-improves-user-experience-updates-reusable-blocks-and-brings-page-templates-to-fse-themes?utm_source=rss&utm_medium=rss&utm_campaign=gutenberg-9-7-improves-user-experience-updates-reusable-blocks-and-brings-page-templates-to-fse-themes\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:7906:\"<p class=\"has-drop-cap\">Gutenberg 9.7 <a href=\"https://make.wordpress.org/core/2021/01/07/whats-new-in-gutenberg-6-january/\">landed yesterday</a> with several updates and improvements. Users should expect to see changes to the interface for block variations, transforms, and patterns. Reusable blocks are being worked on after what seemed to be a hiatus. Developers can also now add custom page templates to their block-based WordPress themes.</p>\n\n\n\n<p>This release had the fewest number of bug fixes I have seen in a while. The development team only pushed eight fixes into the update, which could signal that things were more stable than usual after the 9.6 release a couple of weeks ago.</p>\n\n\n\n<p>Most of the work in 9.7 dealt with new features and enhancements. As expected, Full Site Editing got its fair share of time. However, even this seemed dialed back a bit for this release. Many of the updates are to the post-editing interface.</p>\n\n\n\n<h2>User Experience Improvements</h2>\n\n\n\n<p class=\"has-drop-cap\">The team pushed out several updates to how features work in the editor. Some of them might seem minor but improve the overall editor experience.</p>\n\n\n\n<p>Block variations received a welcome enhancement. Variations are when one underlying block is used to create multiple variations of the same block. For example, the Embed block has YouTube, Twitter, and other variations. In past versions, the block inspector in the sidebar and block navigation would show the generic name, icon, and description. However, Gutenberg 9.7 will now show the <a href=\"https://github.com/WordPress/gutenberg/pull/27469\">details for the variation</a> in use.</p>\n\n\n\n<img />YouTube variation for the Embed block.\n\n\n\n<p>When transforming a block, <a href=\"https://github.com/WordPress/gutenberg/pull/27861\">users can see a preview</a> of what the block will look like. This is a small improvement. However, it might save a few headaches when before deciding to transform one block into another.</p>\n\n\n\n<img />Preview when transforming Quote block into a Pullquote.\n\n\n\n<p>Gutenberg 9.6 introduced a <a href=\"https://wptavern.com/gutenberg-9-6-introduces-drag-and-drop-blocks-and-global-inheritance-for-the-query-block\">drag-and-drop feature</a> for blocks in the inserter. The team has now <a href=\"https://github.com/WordPress/gutenberg/pull/27927\">extended that feature to block patterns</a>. This is just another rung on the ladder for those looking for more drag-and-drop capabilities.</p>\n\n\n\n<h2>Reusable Blocks Updated</h2>\n\n\n\n<p class=\"has-drop-cap\">It has been a while since I tested reusable blocks. The feature has seemingly taken a backseat to other, newer features in the past year or so. It never felt much better than an initial prototype. There is still no way to easily manage them unless you know where to look. However, it appears the Gutenberg development team is <a href=\"https://github.com/WordPress/gutenberg/pull/27887\">actively developing</a> this almost-forgotten feature.</p>\n\n\n\n<p>Users can expect more in future releases. &ldquo;Based on these changes, the UI for reusable blocks is most likely going to see some iterations on the upcoming weeks,&rdquo; wrote Riad Benguella in the announcement post.</p>\n\n\n\n<p>I ran an initial test to see what the feature looked like in Gutenberg 9.7. After clicking the &ldquo;Add to reusable blocks&rdquo; button, the editor did a quick flash. Then, a notification appeared at the bottom of the screen that the reusable block had been created. Because I did not have my block options sidebar panel open at the time, I saw no way to edit the reusable block&rsquo;s title. My immediate thought was that the team took an already half-baked feature and made it exponentially worse.</p>\n\n\n\n<p>Upon further digging, I found that users can edit the reusable block&rsquo;s title in the block options sidebar. However, the team did not stop there. They added several improvements to the feature.</p>\n\n\n\n<img />Editing the reusable block name in the sidebar panel.\n\n\n\n<p>Reusable blocks are now editable within the post editor itself. Users can drag an image out of the block, for example. The inspector sidebar is available for the inner blocks. Reusable blocks now look and feel like any other part of the editor. Any edits will reflect across all instances of the reusable blocks on the site.</p>\n\n\n\n<p>The big difference is in how they are saved.</p>\n\n\n\n<img />Saving a reusable block along with the post.\n\n\n\n<p>Reusable blocks are now a part of the &ldquo;multi-entity&rdquo; save system. When clicking the editor&rsquo;s update button, users will have an option to save the entire post and/or individual reusable blocks.</p>\n\n\n\n<h2>Custom &ldquo;Page&rdquo; Templates for FSE Themes</h2>\n\n\n\n<p class=\"has-drop-cap\">Block-based <a href=\"https://github.com/WordPress/gutenberg/pull/27778\">themes now support</a> what has been traditionally known as page templates. All post types are technically supported with the feature. However, the team seems to be sticking with the &ldquo;page&rdquo; terminology after some discussion.</p>\n\n\n\n<p>It took some digging because there is no existing documentation and the original example in the ticket did not reflect the end result of the code that passed. However, I managed to suss out how the feature works. For theme authors who want to test this feature, use the following example code of adding a &ldquo;contact&rdquo; template. Place it at the root level of your theme&rsquo;s <code>experimental-theme.json</code> file. You will also need to accompany this with a <code>block-templates/contact.html</code> template in your theme.</p>\n\n\n\n<pre class=\"wp-block-code\"><code>\"pageTemplates\": {\n        \"contact\": {\n                \"title\": \"Contact\",\n                \"postTypes\": [\n                        \"page\"\n                ]\n        }\n}</code></pre>\n\n\n\n<p>This feature does not do anything particularly groundbreaking right now. It merely adds the custom template to the drop-down select on the edit post/page screen. It is the equivalent of the current page template system available to traditional themes.</p>\n\n\n\n<img />Selecting a custom page template from FSE theme.\n\n\n\n<p>While this is a nice development, traditional page templates may not make much sense in the block theming paradigm. There is no way to change the visual output of the page in the editor based on the selected template &mdash; users must still view the page on the front end to see the result of its application. The block system is about instant visual feedback. Page templates need to be rethought for the new era.</p>\n\n\n\n<p>&ldquo;In terms of UI and integration with the template mode, we can do a lot more than the old select box,&rdquo; said Benguella, who was the developer behind the pull request. &ldquo;We can show a preview for templates and offer a modal or something like that for folks to pick from&hellip;We&rsquo;d need some design thinking and explorations there. This PR just sets the technical requirements to make it work.&rdquo;</p>\n\n\n\n<p>Much, but not all, of what page templates were needed for in the past decade can now be replaced by block patterns.</p>\n\n\n\n<p>In the long term, I would rather see page templates that behaved more like predesigned block layouts. This is how block templates for custom post types work today. However, that is on the post-type level rather than the level of the individual post.</p>\n\n\n\n<p>Traditional page templates are dated. Themes rarely offer more than a few. One to remove the sidebar. One to move the sidebar to the left or right. Another to make the page content area wider.</p>\n\n\n\n<p>What is clear is that we need more exploration on what page templates of the future will look like. Are they necessary in the block system? Are there better ways of handling what traditional themes are using them for? How will they work in an interface that needs visual feedback?</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 07 Jan 2021 22:34:08 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:123:\"WPTavern: All in One SEO Plugin Turns on Automatic Updates without Notifying Users, Removes Functionality in Latest Release\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=109933\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:289:\"https://wptavern.com/all-in-one-seo-plugin-turns-on-automatic-updates-without-notifying-users-removes-functionality-in-latest-release?utm_source=rss&utm_medium=rss&utm_campaign=all-in-one-seo-plugin-turns-on-automatic-updates-without-notifying-users-removes-functionality-in-latest-release\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4960:\"<p>Buried in the <a href=\"https://aioseo.com/changelog/\">changelog</a> of a series of minor releases that dropped before the Christmas holiday, <a href=\"https://wordpress.org/plugins/all-in-one-seo-pack/\">All in One SEO</a> plugin users were given the surprise gift of automatic updates. After a seemingly endless run of releases (12 updates during a span of six weeks at the end of 2020), the plugin&rsquo;s developers decided to change its auto update policy so that it defaults to &ldquo;on.&rdquo; The plugin is installed on more than 2 million WordPress sites.</p>\n\n\n\n<p>Version 4.0.8, released December 21, 2020, flipped on automatic updates without notifying users of the change. Despite having auto updates turned off for the plugin, many users discovered the change when they were notified by email that their sites had been updated without permission. </p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>Frustrated users took to the plugin&rsquo;s support forums to report the issue and find out how it was possible.</p>\n\n\n\n<p>&ldquo;Multiple sites have updated to 4.0.11 without my permission and while all auto updates are disabled,&rdquo; one user <a href=\"https://wordpress.org/support/topic/auto-update-29/#post-13837970\">said</a>. &ldquo;I/we do not want to hear that &lsquo;it shouldn&rsquo;t happen&rsquo; and we are looking into.</p>\n\n\n\n<p>&ldquo;Your once reliable plugin has destroyed hundreds of pages of social meta data on multiple sites, broken layout (and this after I fixed the problems and told you last week, I will be disabling all updates).&rdquo;</p>\n\n\n\n<p>Others commented on the issue, citing problems with a previous major release as the source of many bugs that followed.</p>\n\n\n\n<p>&ldquo;The rollout of version 4, and auto-updating without any chance to backup first was a blunder by AIOSEO,&rdquo; plugin user Derek Haines <a href=\"https://wordpress.org/support/topic/sudden-rush-of-5-star-reviews/\">said</a>. &ldquo;It has cost me hours, days, and now weeks to fix the problems caused.&rdquo;</p>\n\n\n\n<p>The All in One SEO plugin team <a href=\"https://wordpress.org/support/topic/auto-update-29/#post-13840599\">apologized</a> for the inconvenience users experienced but said they could not reproduce it on their end. The plugin&rsquo;s settings page has a toggle for auto updates but it is just a wrapper for WordPress&rsquo; auto updater.</p>\n\n\n\n<p>&ldquo;I just wanted to give you an update and let you know that we&rsquo;ve decided to remove our own auto-update functionality all together since this issue seems to be happening on a limited amount of websites and we aren&rsquo;t able to reproduce it on our end,&rdquo; Arnaud Broes said.</p>\n\n\n\n<p>The problem was also <a href=\"https://www.facebook.com/groups/advancedwp/permalink/3806581632737356\">discussed</a> in the Advanced WordPress Facebook group.</p>\n\n\n\n<p>&ldquo;All In One SEO Pack apparently turned auto updates on, and in a few cases I found sites where those updates failed,&rdquo; Eric Karkovack reported. &ldquo;I had no idea they were turned on and in one case a site was inaccessible.&rdquo;</p>\n\n\n\n<p>Karkovack noted that there was only a small mention in the changelog, despite the plugin liberally using the dashboard notification UI for sales.</p>\n\n\n\n<p>William Earnhardt, WordPress core contributor and developer at Bluehost, offered some insight as someone who has worked on core as well as plugins installed on a massive scale.</p>\n\n\n\n<p>&ldquo;In my experience if you are weighing the two options, auto-updates prevent significantly more issues and support requests than they create,&rdquo; Earnhardt said. &ldquo;So I&rsquo;m strongly in the camp of enabling them by default, with a mechanism for preventing or disabling for those who prefer (core makes this possible with filters and now with per-plugin UI). </p>\n\n\n\n<p>&ldquo;I think when making these decisions, we as developers have to consider what is best for the broadest number of users and be realistic about the type of users we have. If a user is already not updating plugins regularly, it is unlikely they are going to have the awareness to flip a toggle to turn auto-updates on. So opt-in makes them mostly useless.&rdquo;</p>\n\n\n\n<p>Earnhardt agreed that notifying users of the change would have been a good idea, but admin notices are already &ldquo;frequently abused and quite noisy.&rdquo;</p>\n\n\n\n<p>&ldquo;It would likely be missed if not persistent, but really should only show after the update and then go away,&rdquo; he said. &ldquo;Is that enough when combined with a note in the changelog? Probably for most, but I&rsquo;m sure some would disagree.&rdquo;</p>\n\n\n\n<p>As promised nine days ago, All in One SEO&rsquo;s developers have now removed the functionality from the plugin in its first update of 2021, version 4.0.12 released today. It is noted in the changelog: &ldquo;Fixed: Completely remove auto updates wrapper to let WordPress handle updates.&rdquo; </p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 06 Jan 2021 23:47:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:84:\"WPTavern: Liquid Web Acquires The Events Calendar WordPress Plugin From Modern Tribe\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=109909\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:213:\"https://wptavern.com/liquid-web-acquires-the-events-calendar-wordpress-plugin-from-modern-tribe?utm_source=rss&utm_medium=rss&utm_campaign=liquid-web-acquires-the-events-calendar-wordpress-plugin-from-modern-tribe\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4092:\"<p class=\"has-drop-cap\">Liquid Web <a href=\"https://ithemes.com/the-events-calendar-plugin-joining-liquid-web-family/\">announced today</a> via the iThemes blog that it acquired The Events Calendar from Modern Tribe. The acquisition gives them ownership of the plugin, its suite of event-related plugins, and the team behind it all.</p>\n\n\n\n<p>&ldquo;We&rsquo;ve acquired all the associated plugins, including Event Tickets, etc.,&rdquo; said Matt Danner, the COO at iThemes. &ldquo;They identify under the single umbrella of The Events Calendar as a team, so we&rsquo;ve continued to position the team that way.&rdquo;</p>\n\n\n\n<p>As part of the acquisition, the 50+ employees from The Events Calendar plugin team are now a part of the Liquid Web family. They will continue working on the plugin and its related products. Zach Tirrell <a href=\"https://theeventscalendar.com/blog/news/the-events-calendar-joins-the-liquid-web-family/\">announced on The Events Calendar blog</a> that he would remain at the helm and that the team structure was not changing.</p>\n\n\n\n<p>The remaining 74 employees of Modern Tribe will continue working on the agency&rsquo;s other projects, including clients like Microsoft and Harvard University. Reid Peifer, the Creative Director at Modern Tribe, teased potential future projects in his <a href=\"https://tri.be/blog/the-events-calendar-joins-the-liquid-web-family/\">announcement post</a>. &ldquo;We can&rsquo;t help but make things, so you may see a few surprises from us in the coming months as well.&rdquo;</p>\n\n\n\n<p><a href=\"https://wordpress.org/plugins/the-events-calendar/\">The Events Calendar plugin</a> on WordPress.org currently has over 800,000 active installs with an average rating of 4.4 out of 5 stars. Modern Tribe launched the plugin in 2011 and has continued to build a larger product line and customer base around it over the last decade.</p>\n\n\n\n<p>For existing customers, it should be business as usual. Nothing has changed about who is currently developing The Events Calendar. The website is still a separate entity, and billing will remain the same.</p>\n\n\n\n<p>The acquisition is mere months after iThemes, owned by Liquid Web, <a href=\"https://wptavern.com/ithemes-enters-the-wordpress-membership-plugin-market-acquires-restrict-content-pro\">purchased Restrict Content Pro</a> (RCP), a membership plugin. While RCP continues to have an independent site, users can snag it with one of the plugin bundles directly from the iThemes website.</p>\n\n\n\n<p>However, The Events Calendar will be wholly independent of iThemes. Customers hoping to see a similar bundle with The Events Calendar will be out of luck.</p>\n\n\n\n<p>&ldquo;The RCP acquisition was done under the iThemes brand,&rdquo; said Danner. &ldquo;We brought that team into our team, and the membership product is a key part of how we&rsquo;re positioning iThemes. The Event Calendar&rsquo;s acquisition was done under the larger Liquid Web brand. Their team is coming into Liquid Web alongside iThemes as part of the bigger software division. While we definitely think there are future opportunities to collaborate between our teams (which could include bundles of products from both teams), their products are not going to become part of the iThemes product line.&rdquo;</p>\n\n\n\n<p>One of the biggest remaining questions is whether the separate teams will eventually create integrations between The Events Calendar and RCP. There are multiple reasons event organizers might want to restrict content based on memberships, especially when it comes to virtual events. Danner did not give up any specific plans in his response.</p>\n\n\n\n<p>&ldquo;We&rsquo;re very excited to explore all the opportunities to integrate our products,&rdquo; he said. &ldquo;I think there are some great opportunities for RCP and TEC to work more closely together, and both customer bases have requested deeper integration between the two. This acquisition was a perfect fit from so many angles. The people, the values of the team, and the products all align with what we&rsquo;re building at Liquid Web.&rdquo;</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 06 Jan 2021 22:21:22 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"Akismet: Version 4.1.8 of the Akismet WordPress Plugin is Now Available\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"http://blog.akismet.com/?p=2109\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:99:\"https://blog.akismet.com/2021/01/06/version-4-1-8-of-the-akismet-wordpress-plugin-is-now-available/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:667:\"<p>Version 4.1.8 of <a href=\"http://wordpress.org/plugins/akismet/\">the Akismet plugin for WordPress</a> is now available. It contains the following changes:</p>\n<ul>\n<li>Removal of a deprecated jQuery function.</li>\n<li>A fix for a bug causing some data to be excluded from API calls when marking a comment as spam or not-spam.&nbsp; This should improve spam detection accuracy.</li>\n</ul>\n<p>To upgrade, visit the Updates page of your WordPress dashboard and follow the instructions. If you need to download the plugin zip file directly, links to all versions are available in <a href=\"http://wordpress.org/plugins/akismet/\">the WordPress plugins directory</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 06 Jan 2021 17:01:02 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"Christopher Finke\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:33:\"Matt: Farnam Street and Postlight\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=53384\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"https://ma.tt/2021/01/farnam-street-and-postlight/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2137:\"<p>I recorded two interviews very far apart from each other, but which have surprisingly both come out today. The first is for one of my favorite sites on the web, <a href=\"https://fs.blog/\">Farnam Street</a>. I was honored to be <a href=\"https://fs.blog/knowledge-project/\">episode 100 on their Knowledge Project podcast</a>. Knowledge Project is probably one of the podcasts I&#8217;ve listened to the most since it started. Please check out their other guests as well, they really do have the most interesting conversations with the most interesting folks.</p>\n\n\n\n<p>Shane and I cover turnarounds, how environment affects performance, pros and cons of distributed work, uncovering your lacuna, mental models, and patterns of decision making.</p>\n\n\n\n<div class=\"wp-block-embed__wrapper\">\n\n</div>\n\n\n\n<p>On a completely different vein, I did a deep geek-out on technology and content management systems with <a href=\"https://ginatrapani.org/\">Gina Trapani</a> and <a href=\"https://www.ftrain.com/\">Paul Ford</a>, two of my favorite technologists, <a href=\"https://postlight.com/podcast/wordpress-and-beyond-with-matthew-mullenweg\">on the Postlight podcast</a>. We covered a lot of tech history, my thoughts on Chromium and Mozilla&#8217;s Gecko engine, structured data, Gutenberg, and a lot more. If you&#8217;re a developer or a long-time WordPress community member you&#8217;ll enjoy this one, but it might be esoteric or technical if you&#8217;re not immersed in this world. Here&#8217;s a Spotify embed of the episode:</p>\n\n\n\n<div class=\"wp-block-embed__wrapper\">\n\n</div>\n\n\n\n<p>In both we do touch on my idea that, on a long enough timeline, the survival rate for all proprietary software drops to zero. (Hat tip to Fight Club.) Proprietary software is an evolutionary dead end. You can think of open source packages like <a href=\"https://en.wikipedia.org/wiki/Gene-centered_view_of_evolution\">genetic alleles that have a higher fitness function</a>, and eventually become the fittest organism. The longer I spend watching mega-trends in technology, the more I see that pattern everywhere, from encyclopedias to cryptocurrencies.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 05 Jan 2021 23:51:50 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:92:\"WPTavern: Block System Will Create More Commercial Opportunities for WordPress Theme Authors\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=109904\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:229:\"https://wptavern.com/block-system-will-create-more-commercial-opportunities-for-wordpress-theme-authors?utm_source=rss&utm_medium=rss&utm_campaign=block-system-will-create-more-commercial-opportunities-for-wordpress-theme-authors\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6978:\"<p class=\"has-drop-cap\">Ten years ago, a potential WordPress theme buyer might stumble upon a site like ThemeForest. The themes on the site would primarily tout the hundreds of shortcodes they included. These shortcodes would allow the user to build anything they wanted with simple BBCode-like brackets around some tag or another.</p>\n\n\n\n<p>The practice was not limited to ThemeForest. Nearly every theme development company at the time &mdash; and they were sprouting up by the dozens a decade ago &mdash; needed to compete in the same arena. Despite all their faults (never mind that no user could reasonably remember hundreds of them), shortcodes topped the list of features.</p>\n\n\n\n<p>Today, the landscape is much different. In part powered by page builders like Elementor and Beaver Builder, themes are more apt to offer pre-built design options. Gone are the days when users must painstakingly fill their pages with shortcode soup manually. At the click of a button, their theme will automate the design of their homepage for them. The user merely needs to fill in the content. At the click of another button, the user gets a contact or services page. A restaurant owner might get a fully-laid out food menu. A new online shop owner can get a full set of pre-built WooCommerce products by importing their theme&rsquo;s demo content.</p>\n\n\n\n<p><em>Customizability</em> is the name of the game. This has not really changed over the years, but the methods for getting there have.</p>\n\n\n\n<p>When perusing commercial theme shops today, the common thread is the multitude of demos. These demos showcase the various layouts the user can have if they just fork over the $50 or $60 for access. There are themes with over 500 demos.</p>\n\n\n\n<p>Some themes market hundreds of templates or dozens of pre-built, one-click website designs. At the end of the day, it is all about making the user&rsquo;s site look a certain way without the hassle of hours of work.</p>\n\n\n\n<p>The problem with traditional theming is that all of these themes are built with non-standard solutions. This is no fault of the theme authors. They had to build or use third-party systems where WordPress had failed. Elementor has standardized this to some degree &mdash; many commercial theme shops fully support it, often as the default experience. However, it still only represents a fraction of the market and is not a part of the core platform.</p>\n\n\n\n<p>WordPress is still catching up to the dream that the premium marketplace has already been capitalizing on.</p>\n\n\n\n<p>However, WordPress can do this better in the long term and level the playing field for many other theme developers. We are on the verge of true one-click solutions from the core platform. It will be a tough run for the next year, but the theme shops that adopt the block system the soonest stand the most to gain.</p>\n\n\n\n<h2>What the System Offers</h2>\n\n\n\n<p class=\"has-drop-cap\">If you have ever installed themes that offered dozens of header designs, the experience has likely been hit or miss. Most such themes require users to go through dozens of options fields in the customizer or &mdash; <em>yikes!</em> &mdash; a custom-built options page that looks nothing like the WordPress interface. While there are simpler solutions that some theme authors have created, WordPress has never had a built-in way of allowing users to do this.</p>\n\n\n\n<p>Enter template parts made out of blocks.</p>\n\n\n\n<p>Themes Team rep Carolina Nymark showcased just how simple this is with the upcoming site editor. Her <a href=\"https://wptavern.com/armando-wordpress-theme-provides-insight-into-the-current-state-of-full-site-editing\">Armando theme</a> offers three custom header templates.</p>\n\n\n\n<img />Selecting a header template with the Armando theme.\n\n\n\n<p>The system is far from ready. There are missing features that we will likely not see for a while. For example, there&rsquo;s currently no way to categorize or otherwise group all the header templates just yet. Users can just as easily replace the header with a footer template.</p>\n\n\n\n<p>However, this is an important step forward.  The theme author did not write any complicated PHP or JavaScript. There was no need to build a custom options panel or fields. No third-party system was warranted. The developer created the templates, and they became instantly available through the site-editing interface. The theme author&rsquo;s responsibility went back to simply designing. The user has access through a standardized interface.</p>\n\n\n\n<p>If theme authors want to offer hundreds of switchable templates, they can. If they want to add two or three while upselling the others, they can do that too.</p>\n\n\n\n<p>Now, expand upon this idea with other types of templates. These can be a footer, sidebar, homepage, or any template. The commercial applications are endless. Theme authors can offer commercial themes or upsells with far less work than ever before.</p>\n\n\n\n<p>The possibilities do not end with templates. Block patterns are another viable feature to commercialize. As shown with the Genesis Blocks plugin, its &ldquo;layout selector&rdquo; offers various patterns to quickly insert into the post content.</p>\n\n\n\n<img />Slate collection from the Genesis Blocks plugin.\n\n\n\n<p>Genesis Blocks even offers collections of these patterns that share a similar design aesthetic. In other words, these are essentially pattern categories.</p>\n\n\n\n<p>This is an easy path forward for theme authors who are looking to upsell. Build one or two categories of patterns. Periodically bring in new groups of patterns for users who want a fresh look without changing themes.</p>\n\n\n\n<p>Gutenberg Hub already provides hundreds of <a href=\"https://wptavern.com/gutenberg-hub-launches-collection-of-100-block-templates\">templates and patterns</a>, filling a void that is currently missing from the theme ecosystem. The site offers convenient solutions, but something is missing: they are not tied into the theme&rsquo;s design. Forward-thinking theme authors should already be building competing solutions that offer all the same templates and patterns that match their themes.</p>\n\n\n\n<img />Gutenberg Hub&rsquo;s landing page &ldquo;templates&rdquo; (patterns).\n\n\n\n<p>A year or two ago, there was some rumbling about the block editor leading to the death of WordPress theming. <em>Traditional</em> theming will trickle into nonexistence in the coming years. Of course, there will be pockets of holdouts, but the future is about one-click solutions. And, WordPress is setting the stage for all users to have this ability at their fingertips. The theme shops that recognize this the soonest will profit from it the most. Everyone else will be fighting for the scraps they leave behind.</p>\n\n\n\n<p>It is not time to abandon traditional theming or forgo page-builder support. However, it is time for themers to begin rolling out block patterns and to start outlining, testing, and building block-based themes.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 05 Jan 2021 22:34:08 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:10;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"WordPress.org blog: The Month in WordPress: December 2020\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=9508\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:72:\"https://wordpress.org/news/2021/01/the-month-in-wordpress-december-2020/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:11600:\"<p>We bid goodbye to 2020 in style with the release of WordPress 5.6 and the launch of Learn WordPress. But these werenâ€™t the only exciting updates from WordPress in December. Read on to learn more!</p>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<h2>WordPress 5.6 is here</h2>\n\n\n\n<p>The latest major WordPress release,<a href=\"https://wordpress.org/news/2020/12/simone/\"> version 5.6</a> â€œSimoneâ€, came out on December 8. The release ships with a new default theme called <a href=\"https://wordpress.org/themes/twentytwentyone/\">Twenty Twenty One</a>. It offers a host of features, including:</p>\n\n\n\n<ul><li>Greater layout flexibility</li><li>More block patterns</li><li>Video captioning support</li><li>Auto-updates</li><li>Beta-compatibility for PHP 8.0</li><li>Application password support for the REST API</li><li>Updates to jQuery</li></ul>\n\n\n\n<p>In addition, WordPress 5.6 is now available in 55 languages. You can find more information about the release in the <a href=\"https://make.wordpress.org/core/2020/11/20/wordpress-5-6-field-guide/\">field guide</a>, and you can update to the latest version directly from your WordPress dashboard or by <a href=\"https://wordpress.org/download/\">downloading</a> it directly from WordPress.org. A total of 605 people hailing from 57 different countries contributed to the development of WordPress 5.6. <a href=\"https://profiles.wordpress.org/audrasjb/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>audrasjb</a> has <a href=\"https://jeanbaptisteaudras.com/en/2020/12/wordpress-5-6-core-stats-contributions-by-country-company/\">compiled many more stats like that</a>, showing what a tremendous group effort this wasâ€”theyâ€™re well worth a read!</p>\n\n\n\n<p>Want to contribute to upcoming WordPress releases? Join the WordPress <a href=\"https://wordpress.slack.com/archives/C02RQBWTW\">#core</a> channel on the <a href=\"https://make.wordpress.org/chat/\">Make WordPress Slack</a> and follow the <a href=\"https://make.wordpress.org/core/\">Core team blog</a> to learn the <a href=\"https://make.wordpress.org/core/2020/12/21/wordpress-5-7-planning-roundup/\">latest on WordPress 5.7</a>, which is <a href=\"https://wordpress.org/about/roadmap/\">slated to be out by March 9, 2021</a>. The Core team hosts weekly chats on Wednesdays at <a href=\"https://www.timeanddate.com/worldclock/fixedtime.html?hour=5&min=00&sec=0\">5 a.m.</a> and <a href=\"https://www.timeanddate.com/worldclock/fixedtime.html?hour=20&min=00&sec=0\">8 p.m.</a> UTC.</p>\n\n\n\n<h2>Watch the State of the Word 2020 recording</h2>\n\n\n\n<p><a href=\"https://wordpress.org/news/\">State of the Word 2020</a>, the annual keynote address delivered by WordPress co-founder Matt Mullenweg, was streamed online for the first time on December 17. It was followed by a live Q&amp;A from community members all across the world. You can find the stream recording on <a href=\"https://www.youtube.com/watch?v=QI3qCoiuG3w\">YouTube</a>, <a href=\"https://www.facebook.com/WordPress/videos/1281447442248369\">Facebook</a>, and <a href=\"https://twitter.com/i/broadcasts/1dRKZNvnrmdKB\">Twitter</a>. The <a href=\"https://wordpress.tv/2020/12/17/matt-mullenweg-2020-state-of-the-word/\">State of the Word</a> video and the <a href=\"https://wordpress.tv/2020/12/17/matt-mullenweg-2020-state-of-the-word-qa/\">Q&amp;A session</a> are also available on WordPress.tv.&nbsp;</p>\n\n\n\n<h2>Learn WordPress has launched</h2>\n\n\n\n<p>Learn WordPress, a new free, on-demand WordPress learning resource, launched officially on December 15. It offers <a href=\"https://learn.wordpress.org/workshops/\">workshops</a>, <a href=\"https://learn.wordpress.org/lesson-plans/\">lesson plans</a>, quizzes, and <a href=\"https://learn.wordpress.org/courses/\">courses</a> for anyone interested in publishing with, building for, or contributing to WordPress. WordPress enthusiasts can also <a href=\"https://www.meetup.com/learn-wordpress-discussions/\">participate in discussion groups</a> focused on specific topics to learn with and from each other.</p>\n\n\n\n<p>Want to participate in Learn WordPress? <a href=\"https://learn.wordpress.org/contribute/\">Here are four ways you can do so</a>! Additionally, contributors have <a href=\"https://make.wordpress.org/training/2020/12/03/learn-wordpress-blue-sky-thinking/\">launched a discussion</a> on the future of <a href=\"https://learn.wordpress.org/\">Learn WordPress</a>â€”feel free to share your thoughts in the comments. To help promote Learn WordPress, check out the <a href=\"https://make.wordpress.org/marketing/\">Marketing Team</a>â€™s <a href=\"https://make.wordpress.org/marketing/2020/12/09/help-us-promote-learn-wordpress/\">materials</a>, which detail a <a href=\"https://make.wordpress.org/marketing/2020/12/09/help-us-promote-learn-wordpress/\">range of fun and creative ways</a> to share this new resource.</p>\n\n\n\n<h2>Give feedback on the Full Site Editing project</h2>\n\n\n\n<p>Contributor teams have kicked off the <a href=\"https://make.wordpress.org/core/2020/12/11/the-fse-outreach-program-is-officially-starting/\">Full Site Editing (FSE) outreach program</a> for anyone who is building or maintaining a WordPress site so that they can give feedback on the upcoming <a href=\"https://make.wordpress.org/design/handbook/focuses/full-site-editing/\">FSE feature</a> that will be part of Gutenberg Phase 2. Your feedback will go a long way in improving FSE user flows. To participate, <a href=\"https://make.wordpress.org/test/2020/12/23/fse-program-testing-call-1-template-editing/\">check out the initial testing call</a> on the <a href=\"https://make.wordpress.org/test/\">Make/Test blog</a> and join the <a href=\"https://make.wordpress.org/core/tag/fse-outreach-experiment/\">#fse-outreach-experiment</a> Slack channel.<br /><br />Want to follow updates on the FSE project? Check out <a href=\"https://make.wordpress.org/core/2020/05/20/ways-to-keep-up-with-full-site-editing-fse/\">this blog post</a>. You can find <a href=\"https://make.wordpress.org/core/2020/12/10/status-check-site-editing-and-customization/\">2020 updates to the FSE project</a> in the Make/Core blog.</p>\n\n\n\n<h2>BuddyPress 7.0 â€œFilippiâ€ and 7.10 are now available</h2>\n\n\n\n<p><a href=\"https://buddypress.org/2020/12/buddypress-7-0-0-filippi/\">BuddyPress version 7.0</a> went live on December 9. Its features include:&nbsp;</p>\n\n\n\n<ul><li>New administration screens to manage Member and Group Types</li><li>New BP blocks for posts and pages</li><li>A default profile image for network sites</li><li>Improved BuddyPress Noveau support for the Twenty Twenty One theme.&nbsp;</li></ul>\n\n\n\n<p>A BuddyPress maintenance release (<a href=\"https://buddypress.org/2020/12/buddypress-7-1-0-maintenance-release/\">version 7.1</a>) launched on December 21.&nbsp;</p>\n\n\n\n<p>Want to provide feedback or suggestions for BuddyPress? Share your comments on the announcement posts for <a href=\"https://buddypress.org/2020/12/buddypress-7-0-0-filippi/\">7.0</a> or <a href=\"https://buddypress.org/2020/12/buddypress-7-1-0-maintenance-release/\">7.1</a>. If you find a bug, please report it in the <a href=\"https://buddypress.org/support/\">support forums</a>.&nbsp;</p>\n\n\n\n<h2>Gutenberg 9.5 and 9.6 released</h2>\n\n\n\n<p>The Core team launched <a href=\"https://make.wordpress.org/core/2020/12/02/whats-new-in-gutenberg-2-december/\">version 9.5</a> and <a href=\"https://make.wordpress.org/core/2020/12/23/whats-new-in-gutenberg-23-december/\">9.6</a> of Gutenberg last month. Both versions include several improvements to FSE flows, bug fixes, and feature upgrades. Version 9.5 introduces features like full height alignment and support for font sizes in the code block. Version 9.6 includes features like the ability to drag blocks from the inserter and a vertical layout for buttons.&nbsp;</p>\n\n\n\n<p>Want to get involved in building Gutenberg? Follow <a href=\"https://make.wordpress.org/core/\">the Core team blog</a>, contribute to <a href=\"https://github.com/WordPress/gutenberg/\">Gutenberg on GitHub</a>, and join the <a href=\"https://wordpress.slack.com/archives/C02QB2JS7\">#core-editor</a> channel in <a href=\"https://make.wordpress.org/chat/\">the Making WordPress Slack group</a>.</p>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<h2>Further Reading</h2>\n\n\n\n<ul><li>The Community team <a href=\"https://make.wordpress.org/community/2020/12/01/discussion-how-can-the-wordpress-community-return-to-hosting-safe-in-person-events/\">kicked off a discussion</a> about what the WordPress Community can do to host safe, in-person events again, in light of the continuing pandemic.Â </li><li>The Polyglots team published its <a href=\"https://make.wordpress.org/polyglots/2020/12/30/polyglots-team-end-of-year-post-2020/\">end-of-year post</a>, along with the <a href=\"https://make.wordpress.org/polyglots/author/evarlese/\">results of its 2020 translator survey</a>.</li><li><a href=\"https://sevilla.wordcamp.org/2020/\">WordCamp Sevilla 2020</a> was held online from December 26-29. You can catch the recorded livestream playback on <a href=\"https://www.youtube.com/c/wordpresssevilla/live\">YouTube</a>. Videos of the event will <a href=\"https://wordpress.tv/event/wordcamp-sevilla-2020/\">soon be available on WordPress.tv</a>.</li><li>WordPress project executive director <a href=\"https://profiles.wordpress.org/chanthaboune/\">Josepha Haden</a> and project co-founder <a href=\"https://profiles.wordpress.org/matt/\">Matt Mullenweg</a> will be jointly hosting <a href=\"https://make.wordpress.org/core/2020/12/15/regular-office-and-listening-hours/\">quarterly office and listening hours</a> in 2021. Sign-ups for the <a href=\"https://make.wordpress.org/core/2020/12/15/regular-office-and-listening-hours/\">first ones in January 2021</a> are almost filled up.</li><li>The Core team <a href=\"https://make.wordpress.org/core/2020/12/02/wp-notify-project-review/\">published updates</a> on the <a href=\"https://make.wordpress.org/core/tag/feature-notifications/\">WP Notify project</a>, which seeks to <a href=\"https://make.wordpress.org/core/2019/08/05/feature-project-proposal-wp-notify/\">improve the notifications system</a> in WordPress Core.</li><li>The Support team <a href=\"https://make.wordpress.org/support/2020/12/handling-potential-jquery-issues-in-wordpress-5-6/\">published a post</a> detailing jQuery issues in WordPress 5.6.</li><li><a href=\"https://india.wordcamp.org/2021/\">WordCamp India Online 2021</a> will be held over three weekends between January 30 and February 14. There will be workshops, a contributor event, and sessions (in that order). The calls for <a href=\"https://india.wordcamp.org/2021/call-for-sponsors/\">sponsors</a>, <a href=\"https://india.wordcamp.org/2021/call-for-workshops/\">workshop presenters</a>, <a href=\"https://india.wordcamp.org/2021/call-for-contributor-team-leads/\">contributor team leads</a>, and <a href=\"https://india.wordcamp.org/2021/call-for-volunteers/\">volunteers</a> are now open. Donâ€™t forget to grab your <a href=\"https://india.wordcamp.org/2021/tickets/\">free tickets</a>!</li><li>The Documentation team <a href=\"https://make.wordpress.org/docs/2020/12/01/external-linking-policy-1st-review-of-plugin-developer-handbook/\">shared a first review</a> of its <a href=\"https://make.wordpress.org/docs/tag/external-linking-policy/\">external linking policy</a>. It is using the <a href=\"https://developer.wordpress.org/plugins/\">plugin developer handbook</a> as a test.</li></ul>\n\n\n\n<p><br /><em>Have a story that we should include in the next â€œMonth in WordPressâ€ post? Please </em><a href=\"https://make.wordpress.org/community/month-in-wordpress-submissions/\"><em>submit it using this form</em></a><em>.</em></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 05 Jan 2021 10:55:56 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Hari Shanker R\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:11;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:93:\"WPTavern: WordPress.com Rattles Freelancer Community with New Website Building Service Launch\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=109818\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:231:\"https://wptavern.com/wordpress-com-rattles-freelancer-community-with-new-website-building-service-launch?utm_source=rss&utm_medium=rss&utm_campaign=wordpress-com-rattles-freelancer-community-with-new-website-building-service-launch\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:7137:\"<p>WordPress.com launched a new <a href=\"https://wordpress.com/built-by-wordpress-com/?utm_source=enblog&utm_medium=automattic_referred&utm_campaign=january_2021_launch&flags=a8c-analytics.on,ad-tracking,google-analytics&ga_optimize=on\">website building service</a> today with prices starting at $4,900. Automattic has been beta testing the service since the last quarter of 2020. The product <a href=\"https://wordpress.com/blog/2021/01/04/let-our-experts-build-your-dream-website/\">announcement</a> invites customers to let WordPress.com&rsquo;s&nbsp;professional team &ldquo;translate your vision into a compelling and modern website&rdquo; but does not specify pricing for more customized websites:</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>Whether you need a fast and performant eCommerce store for your products and/or services, a polished website for your professional services firm, or an educational website for your online courses, our experts can build it for you on WordPress.com, the most powerful platform for businesses and enterprises large and small.</p></blockquote>\n\n\n\n<p>Initial reactions from the WordPress developer and freelance community were mixed. Some see the competition as good and others perceived it as a threat to WordPress consultants and small agencies, because a product from WordPress.com carries the full weight of the official WordPress brand. </p>\n\n\n\n<p>&ldquo;Whether this succeeds or not there are a lot of folks with a sick stomach today because of it,&rdquo; WordPress developer Chris Wiegman <a href=\"https://twitter.com/ChrisWiegman/status/1346151976296443904\">said</a>.</p>\n\n\n\n<p>Automattic stepping into the $5k website market came as a surprise to many, after years of keeping to the enterprise space with its <a href=\"https://wpvip.com/\">WordPress.com VIP</a> service. (Sometime in 2019 the service started going by &ldquo;WordPress VIP&rdquo; without the &ldquo;.com&rdquo; appended to it.) Freelancers haven&rsquo;t had to worry too much about competing against a large company like Automattic when trying to attract clients. It&rsquo;s also an interesting move because the company <a href=\"https://wptavern.com/automattic-has-discontinued-active-development-on-edit-flow-plugin\">seemed stretched thin</a> when it came to maintaining plugins used by VIP clients in 2019, despite seeing &ldquo;demand for WordPress in the enterprise market like never before,&rdquo; <a href=\"https://wptavern.com/automattic-has-discontinued-active-development-on-edit-flow-plugin#comment-307821\">according to Nick Gernert</a>, head of VIP. </p>\n\n\n\n<p>&ldquo;Can&rsquo;t say I&rsquo;m surprised by this announcement, but it doesn&rsquo;t bode well for the community, to be honest,&rdquo; WordPress consultant Joshua Nelson <a href=\"https://twitter.com/onemorejosh/status/1346147871465353216\">said</a>. &ldquo;Freelancers will be hurt the most. A for instance: My custom built sites start at $3k. Once you factor in a designer that $4.9k rate looks very competitive.&rdquo;</p>\n\n\n\n<p>In response to community concerns on Twitter, Automattic CEO Matt Mullenweg said the product is targeted at people who have a difficult time getting started with WordPress.</p>\n\n\n\n<p>&ldquo;I would be extremely surprised if this impacts anyone&rsquo;s consulting business, if you do have a current or potential client leave for it please let me know &mdash; it should be all new-to-WP users who wouldn&rsquo;t have been successful getting started,&rdquo; Mullenweg <a href=\"https://twitter.com/photomatt/status/1346212091200491520\">said</a>. He also confirmed that the new service was set up for &ldquo;referring business out&rdquo; and referenced a previous experiment in 2018 where WordPress.com <a href=\"https://wordpress.com/support/upwork/\">partnered with Upwork</a> to refer clients for custom development.</p>\n\n\n\n<div class=\"wp-block-embed__wrapper\">\nhttps://twitter.com/photomatt/status/1346212543732170752\n</div>\n\n\n\n<p>The product launch lacked this information and some <a href=\"https://twitter.com/mattmedeiros/status/1346221279246999552\">noted</a> the copy was confusing with phrases like &ldquo;Built by us&rdquo; and &ldquo;Our experts can build it for you.&rdquo;</p>\n\n\n\n<p>WordPress professionals took to <a href=\"https://poststatus.com/\">Post Status</a>&lsquo; Slack to discuss the implications of Automattic&rsquo;s new offering. Mullenweg responded to them, saying he is &ldquo;100% certain this will drive more up-market consulting in the future&rdquo; to consultants who handle larger projects and potentially bring more business to plugin and theme developers. He also noted that <a href=\"https://www.web.com/websites/website-design-services\">Bluehost&rsquo;s full service</a> product is a similar solution and that services like <a href=\"http://web.com/\">Web.com</a> have been competing in this space for awhile.</p>\n\n\n\n<p>&ldquo;Typically these are called DIFM (do it for me) vs DIY (do it yourself),&rdquo; he said.</p>\n\n\n\n<p>Automattic must be witnessing a strong demand for DIFM, as participants in the discussion at Post Status referenced Mullenweg&rsquo;s comments on the topic during his most recent <a href=\"https://wptavern.com/state-of-the-word-2020-wordpress-moves-toward-full-site-editing\">State of the Word</a> address delivered in December 2020:</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>Lots of people lost their jobs. Lots of people were looking to supplement their income. This drove an incredible amount of entrepreneurship, so people who were looking for people who knew WordPress. And on the other side of that, normal folks who knew or learned WordPress found that they had a lot to demand for their work, so they were able to supplement or replace their income, essentially for folks who have a do it for me mentality, so someone who is looking for someone else to build a website. It&rsquo;s never been a better time to learn and invest in improving your WordPress skills.</p></blockquote>\n\n\n\n<p>The idea behind this product is to help those who get stuck with WordPress  before they turn to competitors that market website creation to beginners. It indicates that WordPress still has a long road ahead before it is truly an approachable tool for beginners embarking on their first site building experience.</p>\n\n\n\n<p>Automattic has not published a pricing structure for the features included in a basic $4900 website. Based on images on the <a href=\"https://wordpress.com/built-by-wordpress-com/\">landing page</a>, the sites do not seem extensively customized beyond what existing themes offer. It seems like more of a website setup service and does not explicitly promise custom development.</p>\n\n\n\n<p>When asked how agencies can apply to be put into the pipeline for referrals from WordPress.com&rsquo;s new service, Mullenweg indicated that the product is still in the experimental stage.</p>\n\n\n\n<p>&ldquo;It&rsquo;s unclear if anyone wants this yet, so for this experiment don&rsquo;t have that yet,&rdquo; Mullenweg <a href=\"https://twitter.com/photomatt/status/1346258917135769600\">said</a>. &ldquo;If it works then definitely we will try to open it up.&rdquo;</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 05 Jan 2021 04:40:32 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:12;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"WPTavern: 2021: Reshaping the Tavern Experience\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=109489\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:137:\"https://wptavern.com/2021-reshaping-the-tavern-experience?utm_source=rss&utm_medium=rss&utm_campaign=2021-reshaping-the-tavern-experience\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4025:\"<img />\n\n\n\n<p class=\"has-drop-cap\">Resolutions. Goals. Guidelines for the year ahead. Call them what you want. Not everyone takes part, but I am a firm believer in having a vision for the coming months. That vision can be malleable, flowing with the changes of time, yielding to new ideas as they are birthed. However, some large, beaming guideposts help when setting foot into the wild of a new year.</p>\n\n\n\n<p>Our team at WP Tavern has gotten a bit of a breather over the holidays. We have an exciting project we are just getting off the ground. We set some things in motion months ago. Now, it is time to push forward.</p>\n\n\n\n<p>Without going into all of the details, which are currently in flux, the following are the big goals for the site in 2021.</p>\n\n\n\n<h2>New Design</h2>\n\n\n\n<p class=\"has-drop-cap\">The biggest goal of 2021 is to add a fresh coat of paint to the website. Going hand in hand with that goal is to launch this new design 100% on blocks. To effectively write about WordPress&rsquo;s upcoming changes, we need to be ahead of the game. That means living a bit on the bleeding edge, running a block-based theme, and testing the site editor. It means sharing what we love and airing our frustrations.</p>\n\n\n\n<p>Changing designs is not simply about slapping on some fresh colors. Design is about functionality. At the center of such a change is providing more tools for engagement.</p>\n\n\n\n<p>We are thinking over multiple ideas about what this might look like, and we have a generous third-party team standing by to help us implement much of this. Some of those ideas are things like showing the top comments and trending forum topics. Feedback from our readers is more than welcome in this regard. Ultimately, this is the part of the Tavern experience that belongs to you.</p>\n\n\n\n<p>The keen-eyed among you may have noticed I slipped in something about forum topics in the preceding paragraph. That was no accident. The return of the Tavern forums is a distinct possibility in 2021. There are many considerations we must make before going down this road around how it is moderated. The goal would be to provide an inviting atmosphere where people could freely talk about our beloved content management system. Again, this would be a feature of the site that is primarily about you.</p>\n\n\n\n<h2>Podcast</h2>\n\n\n\n<p class=\"has-drop-cap\">While many of you are avid readers of our content, we know some of you have asked us to bring back a podcast in some form. Some of you want to listen to WordPress-related news on your drive to work or while you unwind at the end of a busy day.</p>\n\n\n\n<p>We heard you loud and clear.</p>\n\n\n\n<p>Our team is actively pursuing adding a podcast. This is a project that we have been working on for a while now. It is something we genuinely want to happen.</p>\n\n\n\n<p>Before exploring this project, I had no idea of the amount of work necessary for producing a professional podcast. If you had put me behind the mic a few months ago, I would just be shooting from the hip, hoping to hit a target, any target. I have a newfound respect for anyone who produces a podcast today.</p>\n\n\n\n<p>If we get a new podcast off the ground in 2021, it will be a professionally-produced show. The goal is to have planned topics and guests representative of the diversity of the WordPress community. I am excited about the possibility.</p>\n\n\n\n<h2>Welcome to 2021</h2>\n\n\n\n<p class=\"has-drop-cap\">A new design and potential podcast are big-ticket items. They are not features we can launch overnight. When we do them, we want to do them right.</p>\n\n\n\n<p>There are other items on the checklist we will likely get to throughout the year too. But, this is a point in the year where we should sit back and listen. Are there things you want to see changed about the Tavern experience? Are there topics we missed last year that you want to see us cover more?</p>\n\n\n\n<p>As always, our team looks forward to bringing you our regular news, reviews, and opinions throughout the year. Stay tuned in for more.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 04 Jan 2021 21:36:33 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:13;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"Matt: Whatâ€™s In My Bag, 2020\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=53341\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"https://ma.tt/2021/01/whats-in-my-bag-2020/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:15521:\"<p>Instead of <a href=\"https://ma.tt/category/in-my-bag/\">sharing what&#8217;s in my backpack</a> this year, I want to share the apps and pandemic purchases that were meaningful to me, along with a few words on each. Something I haven&#8217;t shared with you yet on this blog is&#8230; I went down a #vanlife rabbit hole and ended up camping and working remotely a decent chunk of the year. I learned a ton and feel much more resilient. So this is a phoneful and truckful update of my year.</p>\n\n\n\n<p>First I&#8217;ll start with apps, these all link to Apple&#8217;s app store but almost all have Android equivalents that I also use:</p>\n\n\n\n<ul><li><a href=\"https://apps.apple.com/us/app/calm/id571800810\">Calm</a> and <a href=\"https://apps.apple.com/us/app/waking-up-guided-meditation/id1307736395\">Waking Up</a> â€”&nbsp;Very different but both incredibly valuable meditation apps. I had an 82-day streak with Calm this year! I wouldn&#8217;t have survived without these.</li><li><a href=\"https://apps.apple.com/us/app/fitbod-workout-fitness-plans/id1041517543\">Fitbod</a> â€”&nbsp;You tell the app what equipment you have, how much time you have, and it gives you a workout like a trainer would, rotating muscle groups.</li><li><a href=\"https://apps.apple.com/us/app/streaks/id963034692\">Streaks</a> â€” An app for starting and tracking habits. This is a funny one because I actually stopped using it because it worked. The things I was tracking on Streaks became daily habits and I stopped using the app every day. The same thing happened for me with <a href=\"https://www.zerofasting.com/\">Zero</a>, my daily fast became part of my routine so I&#8217;d only use Zero if I was doing a longer one.</li><li><a href=\"https://apps.apple.com/us/app/tumblr/id305343404\">Tumblr</a> â€”&nbsp;It was so nice to have a social network centered around creativity and humor.</li><li><a href=\"https://apps.apple.com/us/app/asana-your-work-manager/id489969512\">Asana</a> â€”&nbsp;Getting organized helped lessen anxiety.</li><li><a href=\"https://itunes.apple.com/au/app/pocket-casts/id414834813\">Pocket Casts</a> â€”&nbsp;I switched to this because it syncs between devices, and I used my Android device a lot especially while driving.</li><li><a href=\"https://apps.apple.com/us/app/alltrails-hike-bike-run/id405075943\">AllTrails</a> â€” I spent more time in nature this year than almost any previous, and AllTrails was an amazing way to find great hikes.</li><li><a href=\"https://apps.apple.com/us/app/the-economist/id1239397626\">The Economist</a> â€”&nbsp;The most insightful news, and the weekly cadence helped me avoid the wild variance of the daily news cycle. My favorite news app.</li><li><a href=\"https://apps.apple.com/us/app/youtube-watch-listen-stream/id544007664\">YouTube</a> â€”&nbsp;Wow, there&#8217;s a lot of stuff on here. This was the year I started to &#8220;get&#8221; why people spend so much time on YouTube. Some favorite finds were <a href=\"https://www.youtube.com/channel/UCtmY49Zn4l0RMJnTWfV7Wsg\">Jacob Collier</a> and <a href=\"https://www.youtube.com/channel/UCY1kMZp36IQSyNx_9h4mpCg\">Mark Rober</a>.</li><li><a href=\"https://apps.apple.com/us/app/walmart-shopping-grocery/id338137227\">Walmart</a> â€”&nbsp;Surprisingly good on road trips for curbside pickup orders scheduled a few hours ahead. Yes, I have now <a href=\"https://www.cnbc.com/2017/04/12/nearly-every-american-spent-money-at-wal-mart-last-year.html\">joined 95% of the US population</a>.</li><li><a href=\"https://apps.apple.com/us/app/blueground/id1183301329\">Blueground</a> and <a href=\"https://apps.apple.com/us/app/avantstay/id1455404746\">Avantstay</a> â€”&nbsp;Good for longer stays in places. I found both through <a href=\"https://www.airbnb.com/\">Airbnb</a>, which is still the king.</li><li>Food apps in order of usage: <a href=\"https://apps.apple.com/us/app/doordash-food-delivery/id719972451\">DoorDash</a>, <a href=\"https://apps.apple.com/us/app/uber-eats-food-delivery/id1058959277\">Uber Eats</a>, <a href=\"https://apps.apple.com/us/app/tock-restaurant-reservations/id1369347408\">Tock</a>, <a href=\"https://apps.apple.com/us/app/toast-takeout-delivery/id1362180579\">Toast TakeOut</a>.</li><li>Camping apps in order of usage: <a href=\"https://apps.apple.com/us/app/alltrails-hike-bike-run/id405075943\">AllTrails</a>, <a href=\"https://apps.apple.com/us/app/chimani-national-park-guides/id436381327\">Chimani</a>, <a href=\"https://apps.apple.com/us/app/recreation-gov/id1440487780\">Recreation.gov</a>, <a href=\"https://apps.apple.com/us/app/ioverlander/id894352689\">iOverlander</a>,  <a href=\"https://apps.apple.com/us/app/boondocking/id561352659\">Boondocking</a>, <a href=\"https://apps.apple.com/us/app/freeroam-boondocking-more/id1434359242\">FreeRoam</a>, <a href=\"https://apps.apple.com/us/app/harvest-hosts/id1321631420\">Harvest Hosts</a>.</li><li>App I deleted and re-added the most: <a href=\"https://apps.apple.com/us/app/twitter/id333903271\">Twitter</a>. I love the things I learn from using it, but hate feeling like I&#8217;m wasting time.</li></ul>\n\n\n\n<p>When on road trips I found Android Auto running off the Pixel 5 much more reliable than CarPlay, which would frequently freeze up on me. Things have improved with iOS 14, but I still always use the Pixel when I&#8217;m on a longer drive.</p>\n\n\n\n<p>I also have been living with my Mom since July, including her two cats and <a href=\"https://matt.blog/2021/01/02/introducing-lily-belle/\">new Coton du Tulear puppy</a>. Pets are humbling! It&#8217;s been great to learn how to support them best, as I last lived with animals when I was in high school and wasn&#8217;t that conscious of the responsibility then.</p>\n\n\n\n<p>Amazon says I made over 850 orders this year, more than double from any previous year. Here are the non-tech purchases that ended up having a big impact on me:</p>\n\n\n\n<ul><li><a href=\"https://www.amazon.com/gp/product/B07GZ2DY7K/?tag=photomatt08-20\">SmartMouth mouthwash</a> â€”&nbsp;Available in <a href=\"https://www.amazon.com/gp/product/B01IADXVUY/?tag=photomatt08-20\">travel packs as well</a>, this is magical for having great breath, which you&#8217;ll notice more now that you&#8217;re wearing a mask all the time.</li><li><a href=\"https://www.amazon.com/gp/product/B06XHMNGF9/?tag=photomatt08-20\">Marvis Royal Toothpaste</a> â€”&nbsp;Delicious! SLS-free! I switch between this and the <a href=\"https://www.amazon.com/gp/product/B000MUH344/?tag=photomatt08-20\">SmartMouth toothpaste</a> which works better but isn&#8217;t as luxuriously tasty.</li><li><a href=\"https://www.amazon.com/Theragun-Elite-Generation-Percussive-Treatment/dp/B08G3Q44YJ/?tag=photomatt08-20\">Theragun</a> â€” Because you can&#8217;t get a massage.</li><li><a href=\"https://www.amazon.com/gp/product/B07N41D7QY/?tag=photomatt08-20\">Hurtle vibration platform</a> â€”&nbsp;Really weird but seems to shake the stress out of you, especially if you stretch on it for 5-10 minutes.</li><li><a href=\"https://www.amazon.com/Bowflex-SelectTech-Adjustable-Dumbbells-Pair/dp/B001ARYU58/?tag=photomatt08-20\">Bowflex Adjustable Dumbbells</a> â€”&nbsp;I was lucky enough to get these before they sold out and became crazy expensive. </li><li><a href=\"https://www.amazon.com/gp/product/B01JQU3BPK/?tag=photomatt08-20\">Buckwheat meditation cushion</a> â€” So much more comfortable to have a cushion, especially for longer meditation sessions. <a href=\"https://www.amazon.com/gp/product/B01GDF47Q8/?tag=photomatt08-20\">Here&#8217;s a smaller version</a> I use on the road.</li><li><a href=\"https://www.philips-hue.com/en-us\">Tons of Philips Hue lights</a> â€”&nbsp;Got a ton of joy from playing with the colors on these.</li><li><a href=\"https://www.amazon.com/gp/product/B07S7DWWJZ/?tag=photomatt08-20\">Cloth napkins</a> â€”&nbsp;Felt so luxurious, easy to wash and re-use.</li><li><a href=\"https://www.amazon.com/gp/product/B07HML9YLD/?tag=photomatt08-20\">Heated cat bed</a> â€”&nbsp;My Mom&#8217;s cats are obsessed with this now. </li><li><a href=\"https://www.amazon.com/SHARONDS-Scissors-Thinning-Professional-Stainless/dp/B08BWXWHWH/?tag=photomatt08-20\">Sharonds hair cutting scissors</a> â€”&nbsp;10x better than the scissors I had lying around the house.</li><li><a href=\"https://www.amazon.com/dp/B07L67KL81/?tag=photomatt08-20\">Babyliss clippers</a> â€”&nbsp;They&#8217;re gold and have a &#8220;Lamborghini&#8221; motor which is ostentatious but works great.</li><li><a href=\"https://www.amazon.com/gp/product/B07GB4TDST/?tag=photomatt08-20\">Hair Apron Cape</a> â€” You feel like a dog with <a href=\"https://neothesamoyed.tumblr.com/post/173710808330/ice-cream-cone-boy\">one of those cones</a>, but mostly works.</li><li><a href=\"https://www.amazon.com/gp/product/B07QN7FWC9/?tag=photomatt08-20\">Yeti Lowlands picnic blanket</a> â€” Expensive but sturdy.</li><li><a href=\"https://www.amazon.com/gp/product/B07V6MR1R5/?tag=photomatt08-20\">Cliq camping chair</a> â€”&nbsp;Super small and great design, but ended up using these less than I thought because we mostly just stayed on the ground on the Yeti blanket.</li><li><a href=\"https://www.amazon.com/gp/product/B07RX1TBKM/?tag=photomatt08-20\">Isdin foot care cream</a> â€”&nbsp;Really softens your feet.</li><li><a href=\"https://www.amazon.com/gp/product/B018GXZ016/?tag=photomatt08-20\">Silicone tip cooking chopsticks</a> or the <a href=\"https://www.amazon.com/gp/product/B07LC6253B/?tag=photomatt08-20\">ones with the spoon on the end</a>.</li><li><a href=\"https://www.amazon.com/Surpahs-Multipurpose-Roll-Up-Drying-Inches/dp/B08196DX71/?tag=photomatt08-20\">Roll-up drying rack</a> â€”&nbsp;Goes great over the sink.</li><li>Joseph Joseph <a href=\"https://www.amazon.com/gp/product/B07TD663Y1/?tag=photomatt08-20\">nesting kitchen tools</a>, <a href=\"https://www.amazon.com/dp/B006BSBRWK/?tag=photomatt08-20\">nesting bowls</a> â€”&nbsp;They&#8217;re so pretty as well.</li><li><a href=\"https://www.amazon.com/gp/product/B07CPSJRT4/\">Hanging solar mason jar lights</a> â€”&nbsp;Like fireflies in a jar.</li><li><a href=\"https://www.amazon.com/dp/B0828BNW82/?tag=photomatt08-20\">Matador Freerain32 waterproof packable backpack</a> â€” My new favorite for hiking.</li><li><a href=\"https://www.amazon.com/gp/product/B07PFJZ1LV/?tag=photomatt08-20\">Matador Transit30 packable duffle bag</a> â€”&nbsp;I ended up using this way more than I expected.</li><li><a href=\"https://www.amazon.com/gp/product/B08CXPBZLD/?tag=photomatt08-20\">This bamboo table</a> â€”&nbsp;Just the right size for eating or working on the ground.</li><li><a href=\"https://www.amazon.com/Ikea-Large-Shopping-Bags-SET/dp/B00KVJJGN2/?tag=photomatt08-20\">Ikea Frakta bag</a> â€”&nbsp;Just a few dollars each and can hold so much, and available on Amazon.</li></ul>\n\n\n\n<p>Clothing and wearables, like much of the world I trended toward comfort and away from normal shoes and socks:</p>\n\n\n\n<ul><li><a href=\"https://www.amazon.com/gp/product/B01IKRF2PW/?tag=photomatt08-20\">Bumpers flip flops</a> â€” Weird but you get used to them.</li><li><a href=\"https://www.oofos.com/products/mens-ooahh-sport-slide-sandal-black-matte\">Oofos slide sandals</a> â€”&nbsp;Ridiculously comfortable, and this model looks like it has the <a href=\"https://automattic.com/\">Automattic</a> logo on it.</li><li><a href=\"https://www.amazon.com/gp/product/B077LJSDQL/?tag=photomatt08-20\">Glerups wool slippers</a> â€”&nbsp;Like wool clogs, I wear the rubber-soled ones out if just stepping out for a bit.</li><li><a href=\"https://www.patagonia.com/shop/capilene-air-baselayers\">Patagonia Capilene Air baselayers</a> â€” So warm! Addictive.</li><li><a href=\"https://fahertybrand.com/\">Faherty Brand</a> â€” I just love their whole look and feel, and have met the brothers before.</li><li><a href=\"https://www.aloyoga.com/\">Alo Yoga</a> â€”&nbsp;Pricey but looks great and fun to workout in. I&#8217;ve had some quality issues with their items though.</li><li><a href=\"https://shop.lululemon.com/\">Lululemon</a> â€”&nbsp;Especially their new tech canvas pants.</li><li><a href=\"https://unboundmerino.com/\">Unbound Merino</a> â€”&nbsp;My go-to shirt, also decent socks.</li><li><a href=\"https://www.uniqlo.com/us/en/home/\">Uniqlo</a> â€”&nbsp;Great value, and no logos!</li></ul>\n\n\n\n<p>Electronics:</p>\n\n\n\n<ul><li><a href=\"https://ma.tt/2020/05/ceo-video-streaming/\">Everything in the streaming post</a> â€” I ended up doing a ton of press and talks this year as the world became more <a href=\"https://distributed.blog/\">distributed</a>. I also personally helped many others get similar setups.</li><li><a href=\"https://store.ui.com/\">Everything Unifi</a> â€”Â It&#8217;s a year I really appreciated solid internet. </li><li><a href=\"https://www.amazon.com/gp/product/B01LVZ3UI6/?tag=photomatt08-20\">Retractable 50&#8242; ethernet cord</a> â€”Â I actually daisy-chained two of these to do an internal company town hall presentation.</li><li><a href=\"https://www.amazon.com/gp/product/B07RVF386D/?tag=photomatt08-20\">25&#8242; retractable power extension cord</a> â€” I also carry two of these.</li><li><a href=\"https://www.apple.com/macbook-pro-13/\">Macbook 13&#8243; M1</a> â€” It really is the fastest computer you&#8217;ve ever used. This replaced a maxed out 16&#8243;.</li><li><a href=\"https://www.amazon.com/gp/product/B088666T68/?tag=photomatt08-20\">Hyppr 100w USB-C charger</a> â€”Â Smaller and better than Apple&#8217;s charger.</li><li><a href=\"https://www.apple.com/airpods-max/\">Airpods Max</a> â€” I didn&#8217;t want to like them but they&#8217;re slick.</li><li><a href=\"https://www.amazon.com/gp/product/B089N2RJ4X/?tag=photomatt08-20\">Airpods Pro Dekoni Tips</a> â€”Â Great upgrade for normal Airpods.</li><li><a href=\"https://www.apple.com/iphone-12-pro/\">iPhone 12 Pro Max</a> â€” It&#8217;s like a mini iPad. Camera with RAW support is fantastic.</li><li><a href=\"https://www.apple.com/pro-display-xdr/\">Apple Pro Display XDR</a> â€” Wow.</li><li><a href=\"https://store.google.com/us/product/pixel_5\">Pixel 5</a> â€” Pretty great that they got the fingerprint reader back in as FaceID with a mask is terrible, so this has become my primary device if I&#8217;m out for a walk.</li><li><a href=\"https://store.google.com/product/pixelbook_go\">Pixelbook Go</a> â€” For my Mom.</li><li><a href=\"https://store.google.com/product/chromecast_google_tv\">Chromecast with Google TV</a> â€” Bad name but great product. Truly. Really well designed.</li><li><a href=\"https://www.amazon.com/gp/product/B07FJ91TLB/\">Kindle Oasis with the new warm light</a> â€” Even though I read less this year, this made what I did read a pleasure.</li><li>Sinjimou charging stand for <a href=\"https://www.amazon.com/Sinjimoru-Including-iPhone-Convenient-Silicone/dp/B07GQNY5RD/?tag=photomatt08-20\">iPhone</a> and <a href=\"https://www.amazon.com/gp/product/B07GQV2NXN/?tag=photomatt08-20\">USB-C</a> â€”Â Works great, really cheap.</li><li><a href=\"https://www.amazon.com/gp/product/B07DD9TQSG/?tag=photomatt08-20\">Megaboom 3</a> â€”Â Two of these paired together in stereo is the best sound, weight, and battery life combo I&#8217;ve found on the road and in parks.</li><li><a href=\"https://www.amazon.com/dp/B07QTVMWVL/?tag=photomatt08-20\">Garmin 945 watch</a> â€”Â I&#8217;ve talked about this watch previously, but this year I discovered the GPS maps feature when in hiking mode, which can literally be a lifesaver. Amazing for going off-trail.</li></ul>\n\n\n\n<p>There you have it. As always, if you&#8217;ve tried something here and found an alternative that&#8217;s better, let me know in the comments!</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 03 Jan 2021 04:37:14 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:14;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:39:\"WPTavern: 2020: Step Away From the Fire\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=109487\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:121:\"https://wptavern.com/2020-step-away-from-the-fire?utm_source=rss&utm_medium=rss&utm_campaign=2020-step-away-from-the-fire\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:11328:\"<img />\n\n\n\n<p class=\"has-drop-cap\">If there was a common theme that held humanity together in 2020, it was that most of us agreed that the year was nothing short of a dumpster fire.  That and <a href=\"https://wptavern.com/you-deserve-to-wear-sweatpants-dont-let-anyone-tell-you-any-different\">sweatpants.</a></p>\n\n\n\n<p>As people <a href=\"https://wptavern.com/finding-balance-in-these-uncertain-times-remote-work-and-sharing-our-struggles\">learned to cope</a> with a new reality in the Covid-19 era, the WordPress community has been a <a href=\"https://wptavern.com/need-to-smile-today-stay-wordpress-strong\">beacon of hope</a>. When other industries needed to learn how to work remotely, we were already <a href=\"https://wptavern.com/leave-at-door-new-free-woocommerce-plugin-enables-contact-free-delivery\">ahead of the pack</a> and <a href=\"https://wptavern.com/big-orange-heart-opens-2020-remote-work-wellbeing-and-mental-health-survey\">willing to help</a>. As people dealt with the stress of not having meetups in person, the WordPress community thrived with online events.</p>\n\n\n\n<p>The early year was tough. From toilet paper shortages to being unable to work from a favorite coffee shop, the pandemic took its toll.</p>\n\n\n\n<p>However, we have learned to cope throughout the year. We used new ways to communicate from a distance. Created new circles of friends. Found extra time for long-forgotten hobbies online and off.</p>\n\n\n\n<p>We continued to create art, which is the thing that makes our species so undeniably unique.</p>\n\n\n\n<p>Maybe it is all the lessons we have learned through the past several months. Perhaps it is that a new year is upon us. The winds of change feel like they are gently nudging us forward.</p>\n\n\n\n<p>Over the past couple of months, I have noticed a new calmness. A new hopefulness. A feeling that we will continue to rise above any challenges that come our way. While death and illness are still a part of our daily reality, we must continue to lean on the people within communities like WordPress for support. We will continue marching ahead together.</p>\n\n\n\n<p>I always like to take stock of the past year. This helps keep me grounded and remain optimistic about the future. The following is a look back at 2020 for WP Tavern and WordPress.</p>\n\n\n\n<h2>WP Tavern Stats</h2>\n\n\n\n<p class=\"has-drop-cap\">We have had a solid year of publishing here at the Tavern. Our team, including guest authors, wrote 401 posts. In 2019, we knocked out 382. Next year, I expect that figure to increase.</p>\n\n\n\n<p>Our word count average soared. This year, we averaged 790 words per post. In 2019, that number was 589. While word count is not a testament to quality writing, we did have opportunities to dive deeper into topics than before. In total, we wrote over 315,000 words. That is about 80,000 words shy of Brandon Sanderson&rsquo;s <em>The Way of Kings</em>. You could say that we wrote enough to fill an epic fantasy novel.</p>\n\n\n\n<p>&ldquo;Likes&rdquo; were up this year too. We went from an average of 7.0 likes per post in 2019 to 8.7 in 2020.</p>\n\n\n\n<p>For comments, it is hard to gauge. The WordPress.com Stats feature does not seem to be accurately tracking our comment counts. The figure is nowhere close to correct. By my rough estimate (counting in hundreds), we have at least twice as many published comments as the data shows.</p>\n\n\n\n<p>There were a few days scattered throughout the year in which we came within a hair&rsquo;s breadth of surpassing the site&rsquo;s all-time daily view count. But, alas, we fell just shy of the mark. <em>Maybe next year.</em></p>\n\n\n\n<h2>Most Viewed Posts of the Year</h2>\n\n\n\n<p class=\"has-drop-cap\">The following is a list of the 10 most-viewed posts published this year. They are not necessarily representative of our best work. However, they do represent what folks were reading. Everything beyond this was pretty close in terms of stats.</p>\n\n\n\n<ol><li><a href=\"https://wptavern.com/preparing-for-wordpress-5-4-changes-theme-and-plugin-developers-should-know-about\">Preparing for WordPress 5.4: Changes Theme and Plugin Developers Should Know About</a></li><li><a href=\"https://wptavern.com/matt-mullenweg-unveils-gutenberg-roadmap-at-wceu-wordpress-agencies-and-product-developers-sprint-to-prepare\">Matt Mullenweg Unveils Gutenberg Roadmap at WCEU, WordPress Agencies and Product Developers Sprint to Prepare</a></li><li><a href=\"https://wptavern.com/w3c-drops-wordpress-from-consideration-for-redesign-narrows-cms-shortlist-to-statamic-and-craft\">W3C Drops WordPress from Consideration for Redesign, Narrows CMS Shortlist to Statamic and Craft</a></li><li><a href=\"https://wptavern.com/major-jquery-changes-on-the-way-for-wordpress-5-5-and-beyond\">Major jQuery Changes on the Way for WordPress 5.5 and Beyond</a></li><li><a href=\"https://wptavern.com/what-is-full-site-editing-and-what-does-it-mean-for-the-future-of-wordpress\">What Is Full Site Editing and What Does It Mean for the Future of WordPress?</a></li><li><a href=\"https://wptavern.com/biden-harris-transition-website-launches-on-wordpress\">Biden-Harris Transition Website Launches on WordPress</a></li><li><a href=\"https://wptavern.com/wordpress-5-6-will-ship-with-another-major-jquery-change\">WordPress 5.6 Will Ship With Another Major jQuery Change</a></li><li><a href=\"https://wptavern.com/godaddys-go-wordpress-theme-offers-a-page-building-experience-via-the-block-editor\">GoDaddy&rsquo;s &lsquo;Go&rsquo; WordPress Theme Offers a Page-Building Experience via the Block Editor</a></li><li><a href=\"https://wptavern.com/font-awesome-releases-new-covid-19-awareness-icons\">Font Awesome Releases New COVID-19 Awareness Icons</a></li><li><a href=\"https://wptavern.com/automatic-theme-and-plugin-updates-slated-for-wordpress-5-5\">Automatic Theme and Plugin Updates Slated for WordPress 5.5</a></li></ol>\n\n\n\n<p>For some reason, Sarah&rsquo;s piece on <a href=\"https://wptavern.com/how-to-add-subscript-and-superscript-characters-in-wordpress\">adding subscript and superscript characters</a> from 2014 always sneaks its way into the most-viewed posts of the year. It was technically #6 on the list, but it wasn&rsquo;t published in 2020.</p>\n\n\n\n<h2>The Year in WordPress</h2>\n\n\n\n<p class=\"has-drop-cap\">It was the year that saw the rise of online-only WordCamps. What started with WordCamp Asia <a href=\"https://wptavern.com/wordcamp-asia-2020-canceled-over-covid-19-concerns\">canceling its inaugural event</a> in February ended with Matt Mullenweg giving the annual <a href=\"https://wptavern.com/state-of-the-word-2020-wordpress-moves-toward-full-site-editing\">State of the Word</a> virtually, a first. WordCamp Europe <a href=\"https://wptavern.com/wordcamp-europe-2020-online-registration-now-open-tickets-are-free\">took its massive event online</a> for 2020 while WordCamp U.S. canceled its planned virtual get-together after months of <a href=\"https://wptavern.com/wordcamp-us-2020-canceled-due-to-pandemic-stress-and-online-event-fatigue\">pandemic stress and online event fatigue</a>.</p>\n\n\n\n<p>We saw the community rise up and tackle problems from the beginning. Companies like Wordfence, Yoast, and GoDaddy <a href=\"https://wptavern.com/the-international-wordpress-community-and-wordcamps-amid-covid-19\">provided help</a> for those who were not refunded travel expenses after cancellations. At the end of the day, that is what the WordPress community is all about: people helping other people.</p>\n\n\n\n<p>WordPress kept chugging along, despite the stressful year. The big highlights were three major releases of the software:</p>\n\n\n\n<ul><li><a href=\"https://wptavern.com/wordpress-5-4-adderley-released-includes-improved-editor-new-blocks-and-developer-apis\">WordPress 5.4 &ldquo;Adderley&rdquo;</a></li><li><a href=\"https://wptavern.com/wordpress-5-5-eckstine-introduces-block-directory-block-patterns-and-automatic-updates-for-themes-and-plugins\">WordPress 5.5 &ldquo;Eckstine&rdquo;</a></li><li><a href=\"https://wptavern.com/wordpress-5-6-simone-includes-new-twenty-twenty-one-theme-and-improved-editor\">WordPress 5.6 &ldquo;Simone&rdquo;</a></li></ul>\n\n\n\n<p>WordPress also <a href=\"https://wptavern.com/happy-17th-wordpress\">turned 17</a> this year.  Its step into adulthood next year should be an adventure.</p>\n\n\n\n<h2>Posts From Contributing Writers</h2>\n\n\n\n<p class=\"has-drop-cap\">Rather than focusing too much on the work that Sarah and I have put into the Tavern this year, I want to say thank you to our contributing writers. They managed to fill some gaps when we were unable to throughout the past 12 months. They have added viewpoints outside of our own, enriching the content that our site offers. If anything, I want to see further contributions from a wider range of the WordPress community in the future.</p>\n\n\n\n<p>I do not typically like to play favorites with our guest writers, but Francesca Marano&rsquo;s piece titled <a href=\"https://wptavern.com/a-non-technical-release-leads-journey-to-becoming-a-mentor-for-wordpress-core-development\">A Non-Technical Release Lead&rsquo;s Journey to Becoming a Mentor for WordPress Core Development</a> was one of my favorite reads of the year. Her backstory is a good intro to the article. Her depth of knowledge and insight into <em>the room where it happens</em> makes it a must-read for anyone unfamiliar with how WordPress gets made.</p>\n\n\n\n<p>Chris Maiorana&rsquo;s <a href=\"https://wptavern.com/wordpress-university-was-always-online\">WordPress University Was Always Online</a> is a reminder that the education we need to excel in the online business market is but at our fingertips. It also touches on how the pandemic has allowed more people to realize that the traditional college experience is not the only path forward. It is a great piece that forces us to explore alternatives. And, these alternatives have always been available in the WordPress ecosystem.</p>\n\n\n\n<p>Maiorana&rsquo;s piece on the <a href=\"https://wptavern.com/state-of-the-meetup-under-lockdown\">State of the Meetup Under Lockdown</a> explores how the virtual realm has changed meetups. <a href=\"https://wptavern.com/bringing-back-blogs-in-the-age-of-social-media-censorship\">Bringing Back Blogs in the Age of Social Media Censorship</a> is a look into how blogs are the answer in the age of censorship, even when we disagree with a person&rsquo;s position on a subject.</p>\n\n\n\n<p>On the technical end of things, Jonathan Bossenger wrote an in-depth piece for <a href=\"https://wptavern.com/getting-your-wordpress-plugins-and-themes-ready-for-php-8\">Getting Your WordPress Plugins and Themes Ready for PHP 8</a>. He goes through everything that developers need to know to get their projects updated. The article also provides tools and resources to make things easier.</p>\n\n\n\n<h2>Goodbye, 2020</h2>\n\n\n\n<p class=\"has-drop-cap\">While the year might not have been ideal in many ways, there were some great moments. As I reflect upon the events of the last 12 months, I do not see a complete dumpster fire. There was a lot of good that came out of it. The world has changed in some large ways. Our societies have undergone some subtle reshaping. I do not know what 2021 holds, but I remain optimistic.</p>\n\n\n\n<p>I look forward to another year covering the events surrounding WordPress. I hope you continue down this journey with the WP Tavern team.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 31 Dec 2020 22:44:20 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:15;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"Matt: Jack Dorsey and Running Two Companies\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=53328\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:44:\"https://ma.tt/2020/12/running-two-companies/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1808:\"<p>I had the <a href=\"https://distributed.blog/2020/12/16/episode-26-jack-dorsey-and-remote-collaboration/\">pleasure of interviewing Jack Dorsey for the Distributed podcast</a>, a conversation that ended up going a bit deeper and longer than previous episodes.</p>\n\n\n\n<p>In preparation for the interview I kept coming across people critical about the fact that Jack is the CEO of two companies simultaneously, <a href=\"https://twitter.com/\">Twitter</a> and <a href=\"https://squareup.com\">Square</a>, each having over 5,000 employees.</p>\n\n\n\n<p>I think what people miss is that at that scale, running a company is not that different from running a large division of a company. No one asks Jeff Bezos how he&#8217;s CEO of both a retail company and a cloud computing one (AWS), or Tim Cook how he&#8217;s CEO of a hardware business and a services business, and of course with both of those examples the breadth of what the companies cover is much wider. Also as an added benefit, shareholders can choose to invest in Square and Twitter together or not.</p>\n\n\n\n<p>All of that said, I think having a CEO-level seat at two of the most influential technology companies today does allow for accelerated learning, as organizational experiments will naturally happen at each company and then the best practice can be shared to the other. Jack wasn&#8217;t aware how much peer executives at each company meet with each other to share learnings, but that seems like an obvious win. </p>\n\n\n\n<p>Readers of this blog will especially appreciate how much we talked about open source and cryptocurrencies, and his view on the three things he&#8217;s responsible for as CEO. <a href=\"https://distributed.blog/2020/12/16/episode-26-jack-dorsey-and-remote-collaboration/\">Give it a listen and let me know what you think</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 31 Dec 2020 03:18:19 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:16;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"WPTavern: Understanding the Query Block and Its Importance in Site Editing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=109593\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:193:\"https://wptavern.com/understanding-the-query-block-and-its-importance-in-site-editing?utm_source=rss&utm_medium=rss&utm_campaign=understanding-the-query-block-and-its-importance-in-site-editing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5285:\"<blockquote class=\"wp-block-quote\"><p>I really don&rsquo;t understand this Query block even though it&rsquo;s been mentioned in several Tavern posts. My eyes seem to gloss over when reading about it &ndash; ha!</p><p>Is it important that regular WordPress users understand this block, or is it really a block for developers?</p><p><a href=\"https://wptavern.com/gutenberg-9-6-introduces-drag-and-drop-blocks-and-global-inheritance-for-the-query-block#comment-357249\">Marcus</a></p></blockquote>\n\n\n\n<p class=\"has-drop-cap\">I have given the Query block a lot of attention as of late. On occasion, I may have even called it one of the largest hurdles the Gutenberg development team has needed to jump before block-based themes become a reality. However, the &ldquo;query&rdquo; WordPress term is not something all users or Tavern readers are familiar with. It is a concept as old as WordPress and generally something that only developers needed to familiarize themselves with. When Full Site Editing lands in WordPress, the new block will expose the Query to far more users as part of the site editor interface.</p>\n\n\n\n<p>It is a block that is currently a part of the Gutenberg plugin but not WordPress core. However, at some point in 2021, more and more end-users and developers will be working with it.</p>\n\n\n\n<p>In WordPress terminology, we are really talking about two things, the Query and the Loop. The Query is defined by a set of arguments or options that determine what posts to display. The Loop is the part of the machine that &ldquo;loops&rdquo; through the queried posts and displays them, one after another. The Query asks for posts; the Loop cycles through them.</p>\n\n\n\n<p>Traditionally, theme authors were responsible for adding the Loop code to their templates, which used the global Query that WordPress supplied. Themes could also create custom queries, such as adding a posts list widget, categorized homepage post sections, or anything. And, &ldquo;posts&rdquo; can be anything from normal blog posts to WooCommerce products to the latest topics from the bbPress plugin.</p>\n\n\n\n<p>The Query may be one of the single most important aspects of WordPress. In essence, it is the engine behind displaying the content of every page on the site. Without it, all WordPress sites would simply be a header and a footer.</p>\n\n\n\n<p>The Gutenberg plugin provides two blocks for the Query:</p>\n\n\n\n<ul><li><strong>Query:</strong> The outer block for setting the options for which posts will show.</li><li><strong>Query Loop:</strong> The inner block, which is automatically added when using Query.</li></ul>\n\n\n\n<p>Currently, users can select between four fairly standard variations when first adding the Query block. They are combinations of the post featured image, title, date, and excerpt.</p>\n\n\n\n<img />Query block variations.\n\n\n\n<p>These can be further customized via the block options panel in the sidebar. Users can also find &ldquo;view&rdquo; options in the toolbar for selecting between List and Grid views. The List view is the traditional list of posts flowing vertically down the page. The Grid view displays posts in two to six columns.</p>\n\n\n\n<img />Grid view of posts while using the Query block.\n\n\n\n<p>The Query block has a basic set of options for which post types to display and how to order them. It has filters for categories, tags, authors, and keywords. The block is not as robust as what is possible with code yet. It is missing some basic options like a post number limit and nearly all of the more advanced parameters. However, it is a promising starting point.</p>\n\n\n\n<p>The more exciting aspects of this feature for end-users may not be the Query block at all. It is customizing the blocks that go inside, which display things like the featured image, post title, and more.</p>\n\n\n\n<p>As a former theme author, I cannot count the number of times users have asked me about customizing some aspect of the posts layout. Having them dive into code to make minor changes, such as removing the post author name or displaying the category in a different place, was not an ideal experience. The site editor will put this power directly into each user&rsquo;s hands.</p>\n\n\n\n<img />Adding post-related blocks to the Query block in Grid view.\n\n\n\n<p>The comment by Marcus was on the Tavern&rsquo;s post covering <a href=\"https://wptavern.com/gutenberg-9-6-introduces-drag-and-drop-blocks-and-global-inheritance-for-the-query-block\">Gutenberg 9.6</a>. The latest version of the plugin introduced global query inheritance for the Query block. This means that theme authors can now replicate the content layer in block-based themes. Previously, pages like archives and search results would simply display the latest posts when a theme used the Query block. Now, each of those pages can display the correct posts.</p>\n\n\n\n<p>However, the Query block is so much more than that. In the hands of users, it can be a powerful tool for creating custom output on a homepage &mdash; think newspaper-style categorized sections. Users can also create post lists in a sidebar, such as the latest forum replies or products. Theme authors can offer templates or block patterns with unique designs or as starting points for end-users to modify. There is no shortage of possibilities.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 30 Dec 2020 23:05:39 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:17;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:158:\"WPTavern: GitHubâ€™s 2020 State of the Octoverse Report Highlights: Developers are Working More Hours but Turning to Open Source Projects for Creative Outlets\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=109613\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:353:\"https://wptavern.com/githubs-2020-state-of-the-octoverse-report-highlights-developers-are-working-more-hours-but-turning-to-open-source-projects-for-creative-outlets?utm_source=rss&utm_medium=rss&utm_campaign=githubs-2020-state-of-the-octoverse-report-highlights-developers-are-working-more-hours-but-turning-to-open-source-projects-for-creative-outlets\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3644:\"<p>GitHub has published its annual <a href=\"https://octoverse.github.com/\">Octoverse report</a> for 2020. The code hosting platform currently serves more than 56 million developers who created 60+ million new repositories this past year. The volume of work pumping through GitHub&rsquo;s pipes and its preeminence as the world&rsquo;s largest developer platform gives the company access to a trove of data on how people have been working during the pandemic. </p>\n\n\n\n<p>The Productivity report shows that developers have been putting in longer hours as compared to the previous year. It includes data on what time of day people seem to be more productive, as well as minute changes in the volume of work across various time zones and countries with different COVID-19 responses. The graph below tracks the US Pacific Time Zone, showing a spike in the push window and work volume beginning in mid-March with lockdowns. The volume of work remained consistently higher than the previous year.</p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>GitHub recorded 35% more repositories created than last year and 7.5 hours faster pull request merge times in teams&rsquo; most productive and collaborative weeks.</p>\n\n\n\n<p>Developers seem to be getting more done and GitHub attributes this to people using automation to accelerate their work, improved development practices, and the flexibility of blurring the lines between work and life. The report also cautions that this high volume of work may not be sustainable long-term should be tempered with regular breaks and conscious energy management practices.</p>\n\n\n\n<p>This collection of reports also highlights a few trends in the wider open source community. Alongside a general jump in work volume, GitHub tracked an increase in open source activity on weekends and holidays, at the same time that Enterprise developer activity dropped. Open source project creation is also up by 25% year over year since April 2020.</p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>The data suggests that even when developers conclude their regular work, they are turning to open source projects for creative outlets. These projects often provide meaningful connections and community while the world is stuck at home.</p>\n\n\n\n<p>Based on these findings, GitHub recommends that organizations recognize the importance open source projects hold for employee wellbeing and enrichment when they are contributing outside of work.</p>\n\n\n\n<p>The State of the Octoverse also includes reports on Community and Security. GitHub found that 17% of the vulnerabilities hosted on its platform were explicitly malicious but triggered just 0.2% of alerts. The remaining 83% of vulnerabilities were the result of mistakes. The company found that vulnerabilities are fixed 1.4x faster when repositories are set up to automatically generate a pull request when a patch is available.</p>\n\n\n\n<p>In 2020, the average time for vulnerabilities to go undetected before being identified is four years for GitHub-hosted repositories. On average, it takes 4.4 weeks for the community to code and release a fix, and 10 weeks to alert the community on the availability of a security update. Once notified, users generally apply the update within one week.</p>\n\n\n\n<p>GitHub reports that its community is becoming more diverse as those who identify as developers have decreased from 60% in 2016 to 54% in 2020. Profiles related to education are growing (up from 17% in 2016 to 23% in 2020), followed by users working in data. The platform is becoming more approachable for collaborators who do not come from a development background. </p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 30 Dec 2020 07:08:51 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:18;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:94:\"WPTavern: Armando WordPress Theme Provides Insight Into the Current State of Full Site Editing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=109503\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:233:\"https://wptavern.com/armando-wordpress-theme-provides-insight-into-the-current-state-of-full-site-editing?utm_source=rss&utm_medium=rss&utm_campaign=armando-wordpress-theme-provides-insight-into-the-current-state-of-full-site-editing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5271:\"<p class=\"has-drop-cap\">As we inch closer to a year in which <a href=\"https://wptavern.com/what-is-full-site-editing-and-what-does-it-mean-for-the-future-of-wordpress\">WordPress&rsquo;s primary focus</a> will be on Full Site Editing, it is fortunate timing that Themes Team representative Carolina Nymark publicly <a href=\"https://twitter.com/carolinapoena/status/1343541924028968963\">announced her latest theme</a>, Armando. It is a blogging theme that makes use of the latest features from the Gutenberg plugin.</p>\n\n\n\n<p>The theme is currently <a href=\"https://themes.trac.wordpress.org/ticket/93476\">awaiting review</a> for the WordPress theme directory. It is also <a href=\"https://github.com/carolinan/fullsiteediting/tree/course/armando\">available via GitHub</a>.</p>\n\n\n\n<p>The news of Armando came moments after Nymark <a href=\"https://twitter.com/carolinapoena/status/1343538279346544643\">announced a redesign</a> of her <a href=\"https://fullsiteediting.com/\">Full Site Editing</a> website. The site is a resource for WordPress users and developers to learn more about upcoming features. It is built entirely out of blocks. It is also one of the few sites in the wild running a block-based theme in production.</p>\n\n\n\n<p>Armando is one of the better themes for testing Full Site Editing. This should come as no surprise. Nymark is a veteran of the Themes Team. She tends to cover all the bases and has done so with this theme. There are even notes in the code where she intends to change things as site editing improves.</p>\n\n\n\n<p>The theme is a solid starting point for theme authors who have yet to dip their toes into block-based theme development. It is also usable enough for end-users who want to experience the current state of Full Site Editing.</p>\n\n\n\n<img />Editing a single post template in the site editor.\n\n\n\n<p>The theme does not have a particular artistic flair. It is simple. It is a basic blogging theme that showcases each element the Gutenberg team has covered thus far in its journey toward the new block-based design system.</p>\n\n\n\n<p>Armando also uncovers some of the current problems with the system. As Nymark noted in her stylesheet, &ldquo;Date and categories are all block elements, we need to adjust them to align them better next to each other.&rdquo; On the front end, the theme&rsquo;s CSS adjusts these block-level elements to correctly line up with each other. However, as seen in the site editor view, they are separated as blocks. Post metadata like the author, date, and category often need to be inline. This choice for aligning basic elements of theme design also needs to exist in the site editor. That is if we ever want theme authors to adopt it. <em>And, we haven&rsquo;t even gotten to the complicated stuff yet.</em></p>\n\n\n\n<p>Armando is one of the first block-based themes I have seen to include a 404 template. This is important because it is one reason the site editor needs to exist in WordPress. Throughout all of the platform&rsquo;s history, there was no standard way for users to edit their 404 page, which is the page visitors see when they travel to an invalid URL on a site.</p>\n\n\n\n<img />Editing the 404 template \n\n\n\n<p>Landing on a 404 page on most WordPress sites is one of the worst user experiences a site visitor can have on the web. Traditionally, themes might have added some unhelpful text, a search box, and maybe a list of recent posts. But, most users had no control over it unless they directly edited their theme&rsquo;s code. They could not add a bit of pizzazz, personalized messages, or more meaningful directions for the visitor who stumbled upon the page through no fault of their own. Some themes have provided workarounds for this over the years. Such solutions have included allowing users to assign a private page or adding customizer options. However, changing themes meant losing that 404-page customization because it was a non-standard solution.</p>\n\n\n\n<p>Full Site Editing changes that. Users will have direct access to creating a custom 404 page that best suits their site. It is nice that the Armando theme already includes a template to start from.</p>\n\n\n\n<p>The Armando theme also includes three different header templates for users to switch between. This could offer some insight into how theme authors may tackle design choices in the future. Traditional themes often have numerous checkboxes, input fields, and dropdowns for changing such design elements. Selectable template parts could be the alternative.</p>\n\n\n\n<img />Switching the header template part.\n\n\n\n<p>I lean more toward seeing theme authors using block patterns rather than templates for this. However, WordPress needs to add a method for designating patterns on specific editing screens (e.g., post editor vs. site editor). In the long run, the patterns UI feels like it will be a better place. That is assuming it ever receives an <a href=\"https://wptavern.com/proposal-to-create-an-expanded-view-or-overlay-for-the-block-patterns-inserter\">expanded view or overlay option</a>.  There may be solutions where patterns and template parts merge as well.</p>\n\n\n\n<p>Either way, this type of experimentation is what we need to see in the WordPress theme development world at the moment. I welcome more of it.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 29 Dec 2020 22:37:56 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:19;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"WPTavern: AMP Under Fire in New Antitrust Lawsuit Against Google\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=109265\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:173:\"https://wptavern.com/amp-under-fire-in-new-antitrust-lawsuit-against-google?utm_source=rss&utm_medium=rss&utm_campaign=amp-under-fire-in-new-antitrust-lawsuit-against-google\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6515:\"<p><a href=\"https://amp.dev/\">AMP</a> (Accelerated Mobile Pages), an open source initiative that originated with Google, is coming under greater scrutiny at the tail end of 2020, as the company is facing a rash of antitrust lawsuits beginning in October. The second suit is the one most pertinent to the AMP project. (A third suit brought by 38 state attorneys general alleges that Google is operating an illegal monopoly for online search and search advertising.)</p>\n\n\n\n<p>The second suit is led by Texas Attorney General Ken Paxton and nine other state attorneys general. It alleges that AMP was created for the purpose of pushing publishers away from &ldquo;header bidding,&rdquo; an advertising mechanism that allows sites to route their ad inventory through several ad exchanges and sell the space to the highest bidder. Header bidding requires JavaScript and therefore doesn&rsquo;t play well with AMP.</p>\n\n\n\n<p>The <a href=\"https://www.texasattorneygeneral.gov/sites/default/files/images/admin/2020/Press/20201216%20COMPLAINT_REDACTED.pdf\">complaint</a> claims that &ldquo;Google&rsquo;s program secretly let its own<br />exchange win, even when another exchange submitted a higher bid.&rdquo; It also alleges that &ldquo;Google ad server employees met with AMP employees to strategize about using AMP to impede header bidding, and how much pressure publishers and advertisers would tolerate:&rdquo; </p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>First, Google restricted the code to prohibit publishers from routing their bids to or sharing their user data with more than a few exchanges a time, which limited AMP compatibility with header bidding. At the same time, Google made AMP fully compatible with routing to exchanges through Google. Google also designed AMP to force publishers to route rival exchange bids through Google&rsquo;s ad server so that Google could continue to peek at rivals&rsquo; bids and trade on inside information. Third, Google designed AMP so that users loading AMP pages would make direct communication with Google servers, rather than publishers&rsquo; servers. This enabled Google&rsquo;s access to publishers&rsquo; inside and non-public user data. AMP pages also limit the number of ads on a page, the types of ads publishers can sell, as well as enriched content that publishers can have on their pages.</p></blockquote>\n\n\n\n<p>There are many more claims about collusion with Facebook and other anti-competitive practices, but the section regarding AMP may be of particular interest to publishers who are considering implementing it:</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>Google falsely told publishers that adopting AMP would enhance load times, but Google employees knew that AMP only improves the [redacted] and AMP pages can actually [redacted] [redacted] [redacted]. In other words, the ostensible benefits of faster load times for cached AMP version of webpages were not true for publishers that designed their web pages for speed. Some publishers did not adopt AMP because they knew their pages actually loaded faster than AMP pages.</p><p>Google also [redacted]&nbsp;<em>of non-AMP ads by giving them artificial one second delays</em>&nbsp;in order to give Google AMP a [redacted] [redacted] slows down header bidding, which Google uses to turn around and denigrate header bidding for being too slow.</p></blockquote>\n\n\n\n<p>The complaint references internal documents that demonstrate how AMP is an inferior product when compared to the options previously available to publishers:</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>Google gave publishers a Faustian bargain: (1) publishers could lose more money by using header bidding because Google Search would suppress their search rankings and send traffic to competing AMP-compatible publishers; or (2) publishers could lose less money by using AMP pages and forgoing exchange competition in header bidding. Either option was far inferior to the options available to publishers before AMP was introduced. Just how inferior? [redacted] [redacted] [redacted] according to internal Google documents.</p></blockquote>\n\n\n\n<p>Just 48 hours after this lawsuit was filed, AMP Advisory Committee member Terence Eden <a href=\"https://shkspr.mobi/blog/2020/12/i-have-resigned-from-the-google-amp-advisory-committee/\">resigned</a> from his position as a non-corporate representative. </p>\n\n\n\n<p>The <a href=\"https://github.com/ampproject/meta-ac/blob/master/WORKING_MODE.md#goal-of-the-ac\">goal of the AMP AC</a> is to &ldquo;Make AMP a great web citizen,&rdquo; but Eden declined to nominate a replacement candidate, because he is concerned that &ldquo;Google has limited interest in that goal.&rdquo;</p>\n\n\n\n<p>&ldquo;Google&rsquo;s thesis is that the mobile-web is dying and people prefer to use apps &ndash; therefore making the web faster and more app-like will retain users,&rdquo; Eden wrote.&nbsp;&ldquo;<a href=\"https://github.com/ampproject/meta-ac/issues/32\">Google doesn&rsquo;t publish data about this</a>, so I can&rsquo;t directly criticize their motives. But I do not think AMP, in its current implementation, helps make the web better.</p>\n\n\n\n<p>&ldquo;I remain convinced that AMP is poorly implemented, hostile to the interests of both users and publishers, and a proprietary and unnecessary incursion into the open web.&rdquo;</p>\n\n\n\n<p>In a follow-up email to&nbsp;<em><a href=\"https://www.theregister.com/2020/12/19/google_amp_resignation\">The Register</a></em>, Eden&nbsp;said, &ldquo;I don&rsquo;t know what Google&rsquo;s motives are. But AMP has not been responsive to the needs of users, publishers, or the web community. We need an open, standards based approach to the web.&rdquo;</p>\n\n\n\n<p>Where will AMP go in 2021? Publishers have already invested a lot of resources in order to comply with its proprietary subset of HTML. Smaller sites often lack the resources to support AMP, which may be one reason why Google began investing heavily in developing <a href=\"https://profiles.wordpress.org/google/#content-plugins\">WordPress plugins</a> that make its products easier to use. More than 500,000 WordPress site are now using the official <a href=\"https://wordpress.org/plugins/amp/\">AMP plugin</a>.</p>\n\n\n\n<p>Google has spent years clawing for greater AMP adoption, despite widespread criticism that the project is a threat to the open web. Every last bit of that effort is now in jeopardy if the complaints in the antitrust lawsuits and their supporting documents are found to be true.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 29 Dec 2020 05:43:57 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:20;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:84:\"WPTavern: Navigate the Content Canvas With the Block Editor Outline WordPress Plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=109480\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:213:\"https://wptavern.com/navigate-the-content-canvas-with-the-block-editor-outline-wordpress-plugin?utm_source=rss&utm_medium=rss&utm_campaign=navigate-the-content-canvas-with-the-block-editor-outline-wordpress-plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4173:\"<p class=\"has-drop-cap\">Last week, Kalimah Apps released its <a href=\"https://wordpress.org/plugins/editor-block-outline/\">Editor Block Outline</a> plugin to the WordPress plugin repository. The idea is simple. The plugin adds a bordered outline to each block in the document along with their associated labels. For some users, this will help them navigate more complex layouts.</p>\n\n\n\n<p>There is little information available about Kalimah Apps through the usual WordPress-related channels. However, this is its second plugin in the directory. Its first plugin, which has not been updated in four years, was a massive library of over 40 shortcodes, 1,000s of icons, and dozens of animations. Editor Block Outline is much more scaled back and lean.</p>\n\n\n\n<p>The plugin adds a new sidebar panel to the editor. Its icon, located in the upper right of the screen, looks like a picture frame. It has several options to allow users to personalize the experience, such as what contexts to show the outline and whether to show the block name. The latter option is sometimes best disabled when inserting blocks with many inner blocks. Otherwise, the interface may look a bit cluttered.</p>\n\n\n\n<p>Users can also select an outline color, border style, and opacity. I recommend knocking opacity down below 50% for more of a <em>guideline</em> look, something that is visible but does not feel like it is a part of the content.</p>\n\n\n\n<img />Selecting outline options for Editor Block Outline.\n\n\n\n<p>All of the settings are stored as user metadata. Using this data storage method means that each user can decide how they want to use this plugin. Or, they can even disable it altogether. Because it is stored this way, settings will carry over from one post to the next.</p>\n\n\n\n<p>&ldquo;Do you want to know the feeling of driving while drunk, or to move around with blinders on? Then use Gutenberg without this plugin!!!&rdquo; That is how one user <a href=\"https://wordpress.org/support/topic/works-perfectly-2168/\">reviewed this plugin</a>. While I may not describe the default editor quite so &mdash; ahem &mdash; <em>eloquently</em>, this plugin does solve some problems, particularly when you need to more easily click around the interface.</p>\n\n\n\n<p>As Brian Gardner <a href=\"https://twitter.com/bgardner/status/1329543944401801227\">joked on Twitter</a>, selecting some blocks like Columns is tedious work or a fun game of whack-a-mole:</p>\n\n\n\n<div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Live footage of me trying to select the main Columns block in WordPress to increase the number. <a href=\"https://t.co/Fud3DLQ4VH\">pic.twitter.com/Fud3DLQ4VH</a></p>&mdash; Brian Gardner (@bgardner) <a href=\"https://twitter.com/bgardner/status/1329543944401801227?ref_src=twsrc%5Etfw\">November 19, 2020</a></blockquote>\n</div>\n\n\n\n<p>Of course, there are ways around that, such as using the navigation tree, breadcrumbs, or keyboard commands. However, the block editor is meant to be a visual interface that allows end-users to simply point and click on the elements they wish to edit. Selecting specific blocks has generally improved over time, but users still run into issues. Editor Block Outline makes it a much simpler affair.</p>\n\n\n\n<img />Selecting the Columns block.\n\n\n\n<p>In Full Site Editing (FSE) mode with the Gutenberg plugin enabled, the plugin did not hold up quite as well. Depending on the theme in use, the blocks&rsquo; text labels were sometimes huge or did not match across the canvas. The plugin&rsquo;s icon was also not available on the site editor screen.</p>\n\n\n\n<p>FSE is still in beta. The plugin cannot be expected to work with it yet. However, this is where I imagine the plugin will make the most sense for many users. In the post editor, it would get in the way of writing long-form posts. However, the plugin could become an invaluable tool for navigating complex layouts in both the post and site editors.</p>\n\n\n\n<p>More than anything, the reason I like Editor Block Outline is its dedication to a singular purpose. It adds a simple feature that enhances the editor without taking on too large of a role.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 28 Dec 2020 21:05:56 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:21;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:46:\"BuddyPress: BuddyPress in 2020, itâ€™s a wrap!\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://buddypress.org/?p=316282\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"https://buddypress.org/2020/12/buddypress-in-2020-its-a-wrap/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:9203:\"<p>Hello dear members of the BuddyPress community,</p>\n\n\n\n<p>For this last day of 2020, we are inaugurating our very first End of Year wrap-up post. We believe it&#8217;s a good way to congratulate ourselves (<em>the whole BuddyPress community</em>) about the free &amp; priceless hard work we&#8217;ve all put together into our open source project.</p>\n\n\n\n<p>There are many ways we are <a href=\"https://codex.buddypress.org/participate-and-contribute/\">getting involved</a> into BuddyPress and we all know the best way to maintain BuddyPress in the long term is to give some of our spare time to carry on bringing that little piece to the project. Every contribution makes a difference.</p>\n\n\n\n<p>Let&#8217;s thank us all, the users, the support forum moderators, the documentation writers, the translators, the theme designers, the plugin developers &amp; the BuddyPress Core committers team. We have built great community features all along the 2020 year.</p>\n\n\n\n<p class=\"has-text-align-center has-huge-font-size\"><img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f44f.png\" alt=\"?\" class=\"wp-smiley\" /></p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2>Here are our results:</h2>\n\n\n\n<h3>2020 releases</h3>\n\n\n\n<ul><li>9 releases (3 more than in 2019)</li><li><strong>2 major releases</strong> (1 more than in 2019)</li><li>7 minor releases (2 more than in 2019)</li></ul>\n\n\n\n<h3>2020 Tickets</h3>\n\n\n\n<ul><li>We&#8217;ve fixed 186 tickets, it&#8217;s <strong>62% more than in 2019</strong>.</li><li>The 6.0.0 release (May 2020) was the one which fixed the most tickets for 2 years (89).</li><li>Comparing to 2019, we&#8217;ve increased the fixed tickets per release average from 14 to 23.</li></ul>\n\n\n\n<h3>2020 Code contributors</h3>\n\n\n\n<ul><li>7.0.0 gathered the highest number of contributors for 2 years. We were <strong>55</strong> involved into the making of this release. It&#8217;s almost twice the number of contributors the 5.0.0 release got in 2019.</li><li>For each release we are an average of 14 contributors per release. In 2019 we were 9 contributors. <strong>Contributions to the BuddyPress project grew by 40% in 2020</strong>.</li></ul>\n\n\n\n<h3>2020 Downloads</h3>\n\n\n\n<ul><li>Most important spike for 2 years happened in 2020 for the 7.0.0 releases: <strong>34.236 downloads</strong> on December 11.</li><li>BuddyPress was downloaded more than 1.257.556 times in 2020 (the year is not finished yet <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f60c.png\" alt=\"?\" class=\"wp-smiley\" />).</li><li><strong>The growth ratio is 23% compared to 2019</strong>.</li></ul>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2>Here are our achievements:</h2>\n\n\n\n<h3>Acknowledging <a href=\"https://translate.wordpress.org/projects/wp-plugins/buddypress/contributors/\">Polyglots contributions</a></h3>\n\n\n\n<p>Making BuddyPress available in as many languages as possible is very important to ensure the best user experience of the plugin features. We are always trying to improve how we credits translators and ease their tasks. During the 6.0.0 release, we&#8217;ve reviewed all the strings needing translators comments to explain the meaning of the placeholders we use (e.g.: <code>%s</code>, <code>%d</code>, <code>%1$s</code>, etc.).</p>\n\n\n\n<p>We&#8217;ve also decided to include, from now on, into major release credits the translation contributor names that have given their times to make sure the development (Trunk) translation is 100% ready once our major releases final string freeze step is over. <strong>This work is strategic to BuddyPress users</strong> as they will be able to get the new strings translation as soon as they upgrade or install the plugin.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h3>Easing &amp; welcoming code contributions</h3>\n\n\n\n<p>At the end of 2019, we&#8217;ve made available a <a href=\"https://wordpress.org/plugins/bp-beta-tester/\">new plugin to ease beta-testing</a>, this year we&#8217;ve added the <code><a href=\"https://developer.wordpress.org/block-editor/packages/packages-env/\">@wordpress/env</a></code> package to our development version (Trunk) and <a href=\"https://codex.buddypress.org/participate-and-contribute/contribute-with-code/\">wrote a tutorial</a> about how you can easily set up a development environment to play with BuddyPress code thanks to it. We believe it&#8217;s an important step towards making contributing to BuddyPress easier and we hope it will increase the number of people getting involved into BuddyPress source code improvements.</p>\n\n\n\n<p>Before starting the 7.0.0 development cycle and just like the WordPress Core team does before each major milestone, we&#8217;ve published <a href=\"https://bpdevel.wordpress.com/2020/05/27/buddypress-7-0-0-call-for-tickets/\">our first &#8220;Call for tickets&#8221;</a>. We&#8217;ll do it before each major release so that you can share with the BuddyPress Core committers the tickets you think should be fixed for the next development cycle. <strong>The priorities of the BuddyPress community matter</strong>, we encourage you to use this call for tickets to make your voice heard.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h3>Informing BuddyPress Theme &amp; Plugin authors about important changes</h3>\n\n\n\n<p>During the 6.0.0 development cycle we (<em>re</em>)started to take the time to write developer notes as soon as possible. We also organized these notes into categories according to the version number of the release being built.</p>\n\n\n\n<ul><li>To prepare 6.0.0, we&#8217;ve published <a href=\"https://bpdevel.wordpress.com/category/development-notes/6-0/\">4 notes</a>,</li><li>To prepare 7.0.0, we&#8217;ve published <a href=\"https://bpdevel.wordpress.com/category/development-notes/7-0/\">9 notes</a>.</li></ul>\n\n\n\n<p>Our goals doing so is to limit the risk of &#8220;breaking&#8221; your active theme or plugins keeping their authors aware of changes they should check before a major release is published. It can also help developers to start working early on extending BuddyPress new features. Please do read these notes and share them with your networks to increase their audience and contribute to cover this risk.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h3>Checking how you use BuddyPress and what are your needs:</h3>\n\n\n\n<p>BuddyPress surveys are back! <strong>BuddyPress is about users</strong>: we are very happy we could organize the <a href=\"https://buddypress.org/2020/12/buddypress-2020-survey-results/\">2020 survey</a> to get you inputs about your BuddyPress usage and about the specific directions for the plugin we are thinking of for its future.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h3>Introducing new community features to the BuddyPress plugin:</h3>\n\n\n\n<ul><li>The BP REST API welcomed 6 new endpoints to help you build great interactions from your applications about: Blogs, Blog avatar, Friends, Group Cover Image, Member Cover Image, and User Signups.</li><li>5 BuddyPress blocks have landed into the BuddyPress blocks category of your WordPress Block Editor.</li><li>New Administration screens to manage BuddyPress Types (Member &amp; Group ones) are now available within your WordPress Dashboard. </li><li>Just like Members &amp; Groups, the Blogs component can now enjoy a new default avatar for Sites.</li><li>A great 2.0 version of BP WP CLI to help you manage your BuddyPress site right from the command lines.</li><li>And many fixes and improvements about the existing features (See <a href=\"https://codex.buddypress.org/releases/version-6-0-0/\">6.0.0</a> &amp; <a href=\"https://codex.buddypress.org/releases/version-7-0-0/\">7.0.0</a> release notes)</li></ul>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h3>Starting side projects:</h3>\n\n\n\n<ul><li>A new design for the BuddyPress.org network</li><li><a href=\"https://github.com/buddypress/bp-blocks/pull/7\">Block based Activity Post Form</a>.</li><li>Migrating the <a href=\"https://bpdevel.wordpress.com/\">Developer Updates blog</a> from WordPress.com to BuddyPress.org (See <a href=\"https://buddypress.trac.wordpress.org/ticket/5525#comment:11\">#5525</a>).</li></ul>\n\n\n\n<p>If one of these projects is interesting you, don&#8217;t hesitate to contribute to it.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2>2021 Goals</h2>\n\n\n\n<p>Based on the discussions the Core Team had during our development meetings (every other Wednesday at 19:00 UTC in <a href=\"https://wordpress.slack.com/messages/buddypress\">#BuddyPress</a>), here&#8217;s a list of directions we mostly agree on about: </p>\n\n\n\n<ul><li>A fantastic standalone BuddyPress theme.</li><li>BuddyPress code reference.</li><li>A BuddyPress Attachments component.</li><li>Improve ways to get help about &amp; for BuddyPress.</li></ul>\n\n\n\n<p><strong>Let&#8217;s try to make them concrete in 2021!</strong></p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<p><em>Thanks for reading this post and for your involvement in contributing to BuddyPress in 2020. Let&#8217;s wish us all a great new year&#8217;s eve <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f389.png\" alt=\"?\" class=\"wp-smiley\" />. Bye 2020 and Happy 2021, full of great contributions, to the BuddyPress community.</em></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 28 Dec 2020 19:29:45 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Mathieu Viet\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:22;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"Matt: State of the Word 2020\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:22:\"https://ma.tt/?p=53321\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://ma.tt/2020/12/sotw-2020/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1319:\"<p>This tumultuous year, two things really helped me get through it: my colleagues at <a href=\"https://automattic.com/\">Automattic</a> and the community of <a href=\"https://wordpress.org/\">WordPress</a>. </p>\n\n\n\n<p>At the end of the year I usually deliver a speech to the WP community we call the State of the Word, that celebrates what we accomplished the previous year and shines a light on what we could focus on in the coming year. There&#8217;s always a great energy in the room and I love mixing with the audience before and after the talk. This year we did it online, which meant we could produce the talk a little more, and we made extra time for the Q&amp;A afterward with answers not just from me but folks across the community. </p>\n\n\n\n<p>One thing I&#8217;ll call out <a href=\"https://wordpress.org/news/2020/12/simone/\">WordPress 5.6</a> had an all women and non-binary release squad of over 50 people, a first for WordPress and probably any large open source project. Also the <a href=\"https://w3techs.com/technologies/history_overview/content_management/all/y\">market share of WordPress</a> grew more in 2020 than it has in any year since it started being tracked!</p>\n\n\n\n<p>If you&#8217;re curious about what&#8217;s next for WordPress, check it out:</p>\n\n\n\n<div class=\"wp-block-embed__wrapper\">\n\n</div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 27 Dec 2020 22:55:19 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"Matt\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:23;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:115:\"WPTavern: Google to Migrate Structured Data Testing Tool to New Domain after Backlash from Deprecation Announcement\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=109332\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:275:\"https://wptavern.com/google-to-migrate-structured-data-testing-tool-to-new-domain-after-backlash-from-deprecation-announcement?utm_source=rss&utm_medium=rss&utm_campaign=google-to-migrate-structured-data-testing-tool-to-new-domain-after-backlash-from-deprecation-announcement\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2781:\"<p>Google&rsquo;s <a href=\"https://search.google.com/test/rich-results\">Rich Results Test</a> came <a href=\"https://developers.google.com/search/blog/2020/07/rich-results-test-out-of-beta\">out of beta</a> in July with support for all Google Search rich result features like carousels, images, or other non-textual elements. At that time, Google announced it would be deprecating the <a href=\"https://search.google.com/structured-data/testing-tool/u/0/\">Structured Data Testing Tool</a>, which SEOs, developers, and site owners have relied on for testing structured markup and troubleshooting schema issues.</p>\n\n\n\n<p>The SEO community reacted strongly to this change, because the Rich Results Test only validates structured data that is supported by Google. It also does not provide much useful feedback on errors. </p>\n\n\n\n<p>&ldquo;This is awful,&rdquo; SEO consultant Barry Adams said in response to the change. &ldquo;The SDTT is a tool that validates ALL schemas and helps make the web a semantically richer place. The RR test only supports a tiny narrow subset of Google-approved schemas. You&rsquo;re downgrading the web with this move.&rdquo;</p>\n\n\n\n<p>When Google <a href=\"https://twitter.com/googlesearchc/status/1280507131318460418\">announced</a> the Structured Data Testing Tool&rsquo;s deprecation on Twitter, comments from various web professions indicated widespread disappointment in the decision.</p>\n\n\n\n<p>&ldquo;The new tool is painfully slow,&rdquo; digital marketing consultant Ian Lurie said. &ldquo;The old tool showed a structured data result for the URL tested above. It provided useful feedback and supported industry-wide standardization. The truth is, you&rsquo;re replacing a great structured data tool for an inferior Google-specific one.&rdquo;</p>\n\n\n\n<p>After taking note of all the negative feedback, Google <a href=\"https://developers.google.com/search/blog/2020/12/structured-data-testing-tool-update\">announced</a> last week that it will no longer be deprecating the tool. Instead, the company plans to migrate it to a new domain:  </p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>To better support open standards and development experience, we&rsquo;re refocusing the Structured Data Testing Tool and migrating it to a new domain serving the schema.org community by April 2021. The main purpose of the tool will be to check syntax and compliance of markup with schema.org standards.&nbsp;</p></blockquote>\n\n\n\n<p>Google is making some changes to the tool to differentiate it from the Rich Results Test. The Structured Data Testing tool will not be able to check for Google Search rich result types. It will be refocused to validate only schema.org properties, and is recommended for validating types that Google Search doesn&rsquo;t yet consume.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 23 Dec 2020 23:56:28 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:24;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"WPTavern: Learn WordPress Launches Trac Introductory Workshop\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=109334\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:167:\"https://wptavern.com/learn-wordpress-launches-trac-introductory-workshop?utm_source=rss&utm_medium=rss&utm_campaign=learn-wordpress-launches-trac-introductory-workshop\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2230:\"<p>Jonathan Desrosiers, a WordPress core committer and software engineer at Bluehost, has published a new workshop titled &ldquo;<a href=\"https://learn.wordpress.org/workshop/how-to-use-trac/\">How to Use Trac</a>&rdquo; on the <a href=\"https://learn.wordpress.org/\">Learn WordPress</a> platform. The 20-minute video offers a crash course on  the ticket tracking software that WordPress relies on to manage core development. Trac is also used for contributing to <a href=\"https://meta.trac.wordpress.org/\">WordPress&rsquo; meta</a> component, which includes WordPress.org sites and API, directories, support areas, and other projects.</p>\n\n\n\n<p>Trac&rsquo;s antiquated UI can be intimidating for newcomers, posing another barrier to contribution. Even experienced WordPress contributors are eager to move core development to GitHub or some other platform. It can get confusing since bugs related to the editor need to be reported on GitHub instead of Trac. Until WordPress adopts another platform, the ability to navigate Trac remains an important skill.</p>\n\n\n\n<p>Desrosiers&rsquo; workshop covers topics like searching for pre-existing tickets before reporting a new issue, how to write a good bug report or feature request, how to identify component maintainers, attaching patches, and how proper classification of the ticket can help other teams get involved. He also helps workshop students understand ticket resolutions so they can frame their expectations accordingly. This video includes a full walkthrough of creating a new ticket where Desrosiers explains each field on the form. </p>\n\n\n\n<p>Once you get up to speed on learning Trac and start contributing, you may also want to follow the <a href=\"https://twitter.com/wordpresstrac\">WordPress Trac on Twitter</a>. New contributors may also want to explore <a href=\"https://wptavern.com/wptracsearch-an-elasticsearch-powered-search-interface-for-wordpress-trac-tickets\">WPTracSearch</a>, an unofficial project that provides an alternative Elasticsearch-powered interface for searching WordPress Trac tickets. WPTracSearch delivers more accurate results, even for basic queries, that can be filtered based on milestone, component, focuses, usernames, and more criteria.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 23 Dec 2020 21:38:43 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:25;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:98:\"WPTavern: Gutenberg 9.6 Introduces Drag-and-Drop Blocks and Global Inheritance for the Query Block\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=109323\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:241:\"https://wptavern.com/gutenberg-9-6-introduces-drag-and-drop-blocks-and-global-inheritance-for-the-query-block?utm_source=rss&utm_medium=rss&utm_campaign=gutenberg-9-6-introduces-drag-and-drop-blocks-and-global-inheritance-for-the-query-block\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5098:\"<p class=\"has-drop-cap\">For some people, Christmas arrived a couple of days early. <a href=\"https://make.wordpress.org/core/2020/12/23/whats-new-in-gutenberg-23-december/\">Gutenberg 9.6 launched</a> with its first iteration of drag-and-drop blocks from the inserter. There are some other enhancements like <a href=\"https://github.com/WordPress/gutenberg/pull/27297\">vertical buttons</a>, heaps of bug fixes, new APIs, and other improvements. But, let&rsquo;s be real. The ability to drag blocks from the inserter into the content canvas is the highlight of this release.</p>\n\n\n\n<p>Another key feature is that the Query block, which is only available when Full Site Editing is enabled, now <a href=\"https://github.com/WordPress/gutenberg/pull/27128\">inherits from the global query arguments</a>. As has been usual as of late, much of the work in the Gutenberg plugin has focused on improving the site editor.</p>\n\n\n\n<h2>Drag Blocks Into the Content Canvas</h2>\n\n\n\n<img />Dragging a block from the inserter and dropping it between paragraphs.\n\n\n\n<p class=\"has-drop-cap\">Perhaps the Gutenberg development team has <a href=\"https://wptavern.com/wordpress-5-7-development-kicks-off-with-focus-on-full-site-editing#comment-357130\">seen</a> <a href=\"https://wptavern.com/proposal-to-create-an-expanded-view-or-overlay-for-the-block-patterns-inserter#comment-353059\">your</a> <a href=\"https://wptavern.com/google-search-to-add-page-experience-to-ranking-signals-in-may-2021#comment-351977\">comments</a> and <a href=\"https://wptavern.com/gutenberg-9-0-brings-major-improvements-to-navigation-screen-and-query-block#comment-344463\">your</a> <a href=\"https://wptavern.com/wordpress-5-6-wish-list-homepage-post-type-selection-and-block-management#comment-336374\">other</a> <a href=\"https://wptavern.com/gutenberg-8-5-adds-single-gallery-image-editing-allows-image-uploads-from-external-sources-and-improves-drag-and-drop#comment-334299\">comments</a>. If there is one common thread among the comments on our Gutenberg-related posts, it is that a segment of the WordPress user base wants more drag-and-drop capabilities.</p>\n\n\n\n<p>The new feature only works with blocks right now. Users cannot yet drag and drop patterns from the inserter.</p>\n\n\n\n<p>After several tests since Gutenberg 9.6 Release Candidate 1 landed last week, I have had no issues with it. For the most part, the experience felt smooth and easy to use.</p>\n\n\n\n<p>I have never seen the allure of drag-and-drop features in a content editor. If I am not typing in Markdown, I am in the WordPress editor and using keyboard shortcuts. Throughout my career, I have either been writing code or writing words daily. Picking up my fingers from the keyboard only serves to waste time.</p>\n\n\n\n<p>Sometimes I forget that the block editor already has some drag-and-drop capabilities available, which allow end-users to move blocks from one position to another in the canvas. I tend to work with the top toolbar enabled, so I rarely see the feature.</p>\n\n\n\n<p>Nevertheless, I do see how dragging and dropping blocks could be useful to some users. I use them in other types of editors, such as Gimp or Photoshop, at times. The one thing I like about those is the toolset is always available in the sidebar. This is not the case with the block inserter. While it will stay open for users to drag multiple elements into their content, it disappears once users begin working elsewhere. That could become irritating if the user is in more of a visual-design workflow instead of a content-editing mode.</p>\n\n\n\n<p>Dragging blocks from the inserter would make more sense for my workflow in the upcoming site editor rather than the post editor. The feature works great in that context too.</p>\n\n\n\n<h2>Query Block Supports Inheriting the Global Query Arguments</h2>\n\n\n\n<img />Inheriting the Query block&rsquo;s options from the URL.\n\n\n\n<p class=\"has-drop-cap\">The low-key star of this release is an update to the Query block, which is only available when using a block-based theme. The update is one of the most important breakthroughs for Full Site Editing, a pivotal moment in the history of the Gutenberg project.</p>\n\n\n\n<p>In previous iterations, the Query block required that themes via their block templates or end-users via the site editor define which posts to display. While that is a necessary function of the block, the missing piece was the global query support.</p>\n\n\n\n<p>In the simplest terms, whatever URL a visitor lands upon tells WordPress which posts to load. The data for loading these posts is all stored in a global set of query arguments. Themes can then loop through these posts to display them.</p>\n\n\n\n<p>In Gutenberg 9.6, the Query block can now inherit these query arguments. This means that things like the blog posts page, category archives, search results, and more will display the correct posts when someone visits one of those specific URLs.</p>\n\n\n\n<p>On the surface, this change merely adds a single option to the interface. However, under the hood, it is a achievement that clears a gaping path for developing block-based themes.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 23 Dec 2020 20:16:53 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:26;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"WPTavern: Exploring Photo Blocks, an Experimental FSE-Ready Photoblogging Theme\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=109274\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:201:\"https://wptavern.com/exploring-photo-blocks-an-experimental-fse-ready-photoblogging-theme?utm_source=rss&utm_medium=rss&utm_campaign=exploring-photo-blocks-an-experimental-fse-ready-photoblogging-theme\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4979:\"<p class=\"has-drop-cap\">Kjell Reigstad announced the <a href=\"https://github.com/WordPress/theme-experiments/tree/master/photo-blocks\">Photo Blocks</a> theme on December 9. It is a part of an ongoing set of experimental work from the WordPress <a href=\"https://github.com/WordPress/theme-experiments\">Theme Experiments</a> repository on GitHub. It is essentially a testbed of ideas that are helping to propel the upcoming block-based theming era.</p>\n\n\n\n<p>In the past few months, I have covered the repository&rsquo;s <a href=\"https://wptavern.com/carrd-like-theme-experiment-provides-a-glimpse-into-the-future-of-theming\">Carrd-like landing page theme</a>, <a href=\"https://wptavern.com/twenty-twenty-one-blocks-theme-launching-as-a-separate-project\">Twenty Twenty-One Blocks</a>, and the Full Site Editing (FSE) <a href=\"https://wptavern.com/jump-start-block-based-theme-development-with-the-fse-theme-generator\">Theme Generator</a>. There is a lot of movement happening in the repository that theme developers would be remiss to overlook.</p>\n\n\n\n<p>&ldquo;I built a new block-based photoblog theme in the experiments repo,&rdquo; Reigstad <a href=\"https://twitter.com/kjellr/status/1336697938538618882\">tweeted</a> just a couple of weeks ago. &ldquo;It&rsquo;s refreshing to see how well this works just with existing FSE tools.&rdquo;</p>\n\n\n\n<p>Like most FSE-capable themes currently making the rounds, it is simple. There are miles left before block-based themes and the upcoming site editor reach maturity. Photo Blocks showcases yet another step in the evolution of the system.</p>\n\n\n\n<img />Posts page view of Photo Blocks in the site editor.\n\n\n\n<p>The theme uses the Query block&rsquo;s new grid view, which was added in <a href=\"https://wptavern.com/gutenberg-9-5-improves-site-editor-and-adds-new-options-for-cover-and-code-blocks\">Gutenberg 9.5</a>. The Query block is one of the most important pieces of the Full Site Editing system. Like in traditional themes, the query and &ldquo;the loop&rdquo; output posts on the front end.</p>\n\n\n\n<p>The addition of the grid view allows themes to output their posts in columns. This is a nice addition for Photo Blocks and other photoblogging or portfolio themes. Currently, the Query block supports only a second type of view, the default list of posts. It all seems to limit design possibilities right now, but the grid option does provide some hope that more robust tools are coming.</p>\n\n\n\n<p>The Query block is undoubtedly one of the most complex features the Gutenberg team is building, and it is a crucial block for the upcoming site editor.</p>\n\n\n\n<p>There is also no posts pagination or navigation at the moment. That is because the Gutenberg team is still <a href=\"https://github.com/WordPress/gutenberg/issues/26557\">ironing out the details</a> of such a block. This is another Herculean task given the near-limitless variations on designing posts navigation. The block will need to provide theme authors the flexibility they are accustomed to when writing code.</p>\n\n\n\n<h2>Why Testing and Building Experimental Themes Matters</h2>\n\n\n\n<p class=\"has-drop-cap\">The development of Photo Blocks exposed some missing features in Gutenberg. Without community feedback from building and testing block-based themes, it is tough for the development team to identify such issues.</p>\n\n\n\n<p>Currently, the only way to have same-height images in the Photo Blocks theme&rsquo;s post grid is to manually crop and upload images with the same aspect ratio. Reigstad opened a ticket to <a href=\"https://github.com/WordPress/gutenberg/issues/27620\">set a consistent crop</a> for the Post Featured Image block. <em>I would also recommend an image-size option similar to how it is handled in the Image block.</em></p>\n\n\n\n<p>Traditionally, themes that output a grid of featured images would fall back to a default image or use the first image from the post content if one was not set. There is currently no way to do this with the Post Featured Image block &mdash; another missing key feature. Reigstad opened a new ticket that proposed <a href=\"https://github.com/WordPress/gutenberg/issues/27617\">taking the idea further</a>.</p>\n\n\n\n<p>&ldquo;In the past, the featured image was a single image, added and managed separately from the rest of the post content,&rdquo; he wrote. &ldquo;For block-based sites however, that restriction is largely unnecessary. Rather than just an image, we should consider making it possible to set a video or audio embed as the &lsquo;Featured&rsquo; block. Also, since posts are made up of structured data, it&rsquo;s theoretically possible to signify any block from within post content as a &lsquo;Featured&rsquo; block.&rdquo;</p>\n\n\n\n<p>The idea of featured media is not new. Many themes have had featured audio and video in the past. However, the concept of marking any type of block as featured is worth exploring. Even if not every block lends itself well to this, surely some do beyond images.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 23 Dec 2020 00:35:44 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:27;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:57:\"WPTavern: Shutterstock Launches Official WordPress Plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=108844\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:159:\"https://wptavern.com/shutterstock-launches-official-wordpress-plugin?utm_source=rss&utm_medium=rss&utm_campaign=shutterstock-launches-official-wordpress-plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:2130:\"<p>Shutterstock has released an <a href=\"https://wordpress.org/plugins/shutterstock\">official plugin for WordPress</a>. The 17-year old company is as old as WordPress itself but this is the first time it has provided convenient access to its library inside the admin.  </p>\n\n\n\n<p>Seven years ago, Shutterstock released a <a href=\"https://wordpress.org/plugins/shutterstock-affiliate-plugin/\">plugin for affiliates</a> using a third-party development company, but it failed to gain much traction and is no longer updated. The new block-based plugin applies more broadly to WordPress site owners looking for commercial stock photography. It provides a block that allows users to search Shutterstock&rsquo;s library of 340 million images and get suggestions based on the text content. Users can place preview images on pages and posts, license with one click, download, and publish images and editorial content.</p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>Shutterstock&rsquo;s plugin respects WordPress&rsquo; user roles and permissions system, so organizations can restrict image licensing to editors and administrators while still allowing authors to insert image previews. The plugin also has access to the user&rsquo;s license history so they can download any content that has been previously licensed on Shutterstock.</p>\n\n\n\n<p>A couple weeks after launching, the plugin is active on fewer than 10 WordPress sites. It&rsquo;s not clear if that is due to its customers not knowing about it or the endless variety of free images that WordPress users have access to through other services. Since the plugin only offers access to a limited library by default, it is primarily aimed at Shutterstock customers who have an existing subscription to connect for the full collection.  </p>\n\n\n\n<p>Along with the official plugin release, Shutterstock also announced a new partnership with WordPress.com VIP. It is now one of the service&rsquo;s &ldquo;<a href=\"https://wpvip.com/partner/shutterstock/\">Featured Technology Partners</a>,&rdquo; streamlining the publishing workflow for Automattic&rsquo;s enterprise customers. </p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 22 Dec 2020 23:32:46 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:28;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"WPTavern: What Is Full Site Editing and What Does It Mean for the Future of WordPress?\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=109217\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:215:\"https://wptavern.com/what-is-full-site-editing-and-what-does-it-mean-for-the-future-of-wordpress?utm_source=rss&utm_medium=rss&utm_campaign=what-is-full-site-editing-and-what-does-it-mean-for-the-future-of-wordpress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:10892:\"<img />Block-based Twenty Twenty-One theme in the site editor.\n\n\n\n<p class=\"has-drop-cap\">As I said last week, <em>2021 will be the year of the site editor</em>.  Matt Mullenweg&rsquo;s <a href=\"https://wptavern.com/state-of-the-word-2020-wordpress-moves-toward-full-site-editing\">State of the Word</a> confirms it.  WordPress 5.7&rsquo;s <a href=\"https://wptavern.com/wordpress-5-7-development-kicks-off-with-focus-on-full-site-editing\">release planning</a> is focused on it.  It has been a long journey getting to this point, and it will be a much longer adventure afterward. The ultimate promise of the work that <a href=\"https://wptavern.com/wordpress-core-editor-team-publishes-ui-prototype-for-gutenberg-an-experimental-block-based-editor\">began nearly four years ago</a> is nigh.</p>\n\n\n\n<p>The Gutenberg project was never <em>just</em> about editing content. WordPress was aging software by late 2016. It needed to cater to modern audiences who may be less tech-savvy than the platform&rsquo;s existing user base. It needed to capture a younger generation of developers who were looking at the greener grass of JavaScript-heavy software. It needed to offer an experience on par with modern web applications. WordPress had a lot of boxes it needed to check or face irrelevance.</p>\n\n\n\n<p>The one thing that has truly kept the platform afloat is its large and diverse ecosystem of third-party developers.</p>\n\n\n\n<p><em>One of the most popular types of plugins?</em> Page builders. Those such as Elementor, which launched in early 2016, were filling in the experience gaps that WordPress was missing. While it was a testament to the platform&rsquo;s extendibility for such third-party projects to arise, it was also a failure that the core platform could not offer a better experience to both users and developers out of the box. Far too many theme authors were forced into supporting third-party builders to remain relevant. They were focusing more and more on compatibility with plugins than simply designing.</p>\n\n\n\n<p>The shortcomings of the widgets, shortcodes, meta boxes, and settings systems meant that developers had to either rely on non-core frameworks or reinvent the wheel. Every new API brought with it a new method for adding basic form fields. At best, it was inelegant, a platter of spaghetti that had been thrown at the wall, some of it managing to stick.</p>\n\n\n\n<p>WordPress was beginning to show its wrinkles. It needed to revolutionize itself. It needed to feel fresh again. For better or worse, the developers behind the Gutenberg project have been putting in the work to do just that.</p>\n\n\n\n<p>It is slow work. But, it is promising work.</p>\n\n\n\n<p>While the term &ldquo;Gutenberg&rdquo; is often used interchangeably with &ldquo;block editor,&rdquo; the two are not one and the same. Gutenberg is a project. A plugin. An idea. A new way of thinking about publishing on the web. As the opening lines of the description of the plugin read:</p>\n\n\n\n<blockquote><p>&ldquo;Gutenberg&rdquo; is a codename for a whole new paradigm in WordPress site building and publishing, that aims to revolutionize the entire publishing experience as much as Gutenberg did the printed word.</p></blockquote>\n\n\n\n<p>The project has four phases:</p>\n\n\n\n<ol><li>Easier Editing</li><li>Customization</li><li>Collaboration</li><li>Multilingual</li></ol>\n\n\n\n<p>WordPress users who have not been testing the Gutenberg plugin have only experienced Phase 1 of the project. The launch of the block editor in <a href=\"https://wptavern.com/wordpress-5-0-bebo-released-lays-a-foundation-for-the-platforms-future\">WordPress 5.0</a> and its continued work set the stage for the phases to follow. The underlying block system is what will fuel the next decade or longer of WordPress.</p>\n\n\n\n<p>Today, we are firmly in the midst of Phase 2. And, this is where things will get interesting.</p>\n\n\n\n<h2>Full Site Editing</h2>\n\n\n\n<img />Selecting a template in the site editor, using the Block-Based Bosco theme.\n\n\n\n<p class=\"has-drop-cap\">Phase 2 of Gutenberg, which began in late 2018, promised to bring blocks outside of the post content. In an introduction to this next step, Mel Choyce-Dwan <a href=\"https://make.wordpress.org/core/2018/12/08/gutenberg-phase-2/\">outlined the three main focuses:</a></p>\n\n\n\n<ul><li>Be outside of <code>post_content</code>.</li><li>Focus on customization.</li><li>Upgrading themes, widgets, and menus.</li></ul>\n\n\n\n<p>Since then, those core concepts have remained the same. However, the full picture, the shape of what those concepts would look like, has changed in the last two years. If there is one thing anyone on the development team has learned, it is probably that it is hard to launch such drastic changes.</p>\n\n\n\n<p>Full Site Editing is a mix of concepts. It is one part transition from tradition and one part full overhaul of how users and developers design the front end of WordPress sites.</p>\n\n\n\n<p>Nav menus and widgets, which are a part of the old paradigm, have been set to relaunch under the block system for the past two major WordPress releases. They were not ready. Users should expect to see them in WordPress 5.7. However, these feature upgrades are merely stepping stones to true the true Full Site Editing feature. They offer a way for end-users who are still using classic WordPress themes to get a taste of blocks outside of the post-editing screen.</p>\n\n\n\n<p>For the users who take the next step, widgets and nav menus &mdash; at least the traditional admin screens &mdash; will disappear. The customizer, which was once touted as the future of theme development, is also getting the ax. Site customization via a system where everything is a block will reign supreme.</p>\n\n\n\n<p>Once the switch flips, the world will be looking at a whole new WordPress.</p>\n\n\n\n<p>WordPress 5.7 and beyond will be about the site editor and block-based themes. The site editor is the visual representation of block templates that theme developers offer to users. Templates are infinitely customizable by the user from the WordPress admin. While themers will create custom configurations and set defaults, the power to decide what the front end of the site will look like will ultimately reside in the user&rsquo;s hands.</p>\n\n\n\n<p>Since the launch of Phase 1, the block editor has been a love/hate affair. Expect the site editor to be no less controversial.</p>\n\n\n\n<p>Underneath it all, a theme&rsquo;s code and the site editor will be talking in the same language. This essentially means that users could transition to theme authors if they have a knack for design or simply want to give it a go.  They  should be able to do this without leaving the comfort of the trusty site editor, which already allows exporting templates.</p>\n\n\n\n<p>Because the post editor and the site editor both work on the same, underlying block-based foundation, there is no reason for users to not be able to seamlessly switch between the two. There is <a href=\"https://github.com/WordPress/gutenberg/pull/26355\">currently a ticket</a> for adding such a toggle on the post-editing screen. It will allow users to switch to a template-editing mode while never leaving the post editor.</p>\n\n\n\n<img />Template-editing mode likely to land in Gutenberg 9.6.\n\n\n\n<p>This is not a newly-introduced concept. Josepha Haden, who led the WordPress 5.6 release, <a href=\"https://wptavern.com/wordpress-5-6-release-team-pulls-the-plug-on-block-based-widgets\">touched on this earlier this year</a>. &ldquo;I think one of the problems that we&rsquo;re trying to solve with Gutenberg has always been a more consistent experience for editing elements across the WordPress interface,&rdquo; she said. &ldquo;No user should have to learn five different workflows to make sure their page looks the way they imagined it when it&rsquo;s published.&rdquo;</p>\n\n\n\n<p>One of the larger goals is reducing the number of workflows into a single interface. We are likely years away from seeing the whole of WordPress site management reduced that far. However, the site editor is the next step toward that potential user experience.</p>\n\n\n\n<h2>What Does All This Mean for the Future?</h2>\n\n\n\n<p class=\"has-drop-cap\">While the last few years may have felt like a whirlwind of changes to our beloved platform, <em>you ain&rsquo;t seen nothing yet</em>. We were just getting our bearings in Phase 1. The development team was building the foundation while also launching the user-facing block editor. With that foundation in place, the team can focus more on features. This will especially be true as the <a href=\"https://wptavern.com/g2-components-a-from-scratch-reimagining-of-wordpress-components\">G2 Components project </a>overhauls and standardizes how core and third-party developers build upon the block system.</p>\n\n\n\n<p>The big Phase 2 changes this year means that theme authors will need to get up to speed. Traditional WordPress themes will still be necessary for a while. However, any theme author who is not already tinkering with block-based themes is already months behind. This is the time to be exploring and helping to shape the system. It is time to be filing bug reports and feature requests.</p>\n\n\n\n<p>If possible, theme authors should be attending the twice-monthly <a href=\"https://make.wordpress.org/themes/handbook/about/#meetings\">block-based themes meetings</a>. If time does not allow for attendance, you should at least be reading and participating on the <a href=\"https://make.wordpress.org/themes/\">Make Themes blog</a>.</p>\n\n\n\n<p>It is also important to check out projects like the <a href=\"https://wptavern.com/q-first-fse-wordpress-theme-now-live\">Q theme</a> or follow the <a href=\"https://github.com/WordPress/theme-experiments\">Theme Experiments</a> repository.</p>\n\n\n\n<img /><a href=\"https://wptavern.com/carrd-like-theme-experiment-provides-a-glimpse-into-the-future-of-theming\">Carrd-like theme experiment</a> from the site editor.\n\n\n\n<p>For end-users, this entire project is about you. Your feedback is crucial. If you are not already testing your site with the Gutenberg plugin, you should be. It is sometimes weeks or months ahead of what you are getting with WordPress alone.  Try out an FSE theme like <a href=\"https://wptavern.com/block-based-bosco-second-full-site-editing-theme-lands-in-the-wordpress-directory\">Block-Based Bosco</a>.  Consider joining the <a href=\"https://wptavern.com/help-steer-the-future-of-wordpress-via-the-fse-outreach-program\">FSE Outreach Program</a>. You can test and provide feedback directly on upcoming features.</p>\n\n\n\n<p>FSE brings with it the promise of major changes in 2021. Many of these changes will uproot old methods of managing your WordPress websites. Those methods will be replaced with one of the largest overhauls to the platform in its history. It is time to get prepared.</p>\n\n\n\n<p>It is going to be an interesting new year.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 22 Dec 2020 00:56:53 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:29;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"WPTavern: WordPress 5.7 Development Kicks Off with Focus on Full Site Editing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=109212\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:199:\"https://wptavern.com/wordpress-5-7-development-kicks-off-with-focus-on-full-site-editing?utm_source=rss&utm_medium=rss&utm_campaign=wordpress-5-7-development-kicks-off-with-focus-on-full-site-editing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3662:\"<p>If the 2020 <a href=\"https://wptavern.com/state-of-the-word-2020-wordpress-moves-toward-full-site-editing\">State of the Word</a> address was any indication, WordPress is moving full steam ahead to land full site editing in 2021. The 5.7 release cycle <a href=\"https://make.wordpress.org/core/2020/12/21/wordpress-5-7-planning-roundup/\">kicked off</a> this week with the proposed scope centered around full site editing via&nbsp;Gutenberg. Matt Mullenweg will be leading the release and the rest of the team leadership is still being rounded up. Bug scrubs for<em>&nbsp;</em><a rel=\"noreferrer noopener\" href=\"https://core.trac.wordpress.org/tickets/early\" target=\"_blank\">early tickets</a> that require more time or early testing are already underway. </p>\n\n\n\n<p>WordPress 5.7 contributors anticipate working on the following features in the next release:</p>\n\n\n\n<ul><li>Update WordPress&nbsp;Core&nbsp;to include current releases of the Gutenberg&nbsp;plugin</li><li>Gutenberg: ship additional blocks, refine the&nbsp;UI, add tools for themes and design, and continue working on the&nbsp;widget&nbsp;screen</li><li>Continue work on&nbsp;<a href=\"https://make.wordpress.org/core/2020/11/10/wp5-6-auto-update-implementation-change/\">auto-updates</a>&nbsp;and<a href=\"https://make.wordpress.org/core/2020/06/29/updating-jquery-version-shipped-with-wordpress/\">&nbsp;jQuery</a></li></ul>\n\n\n\n<p>&ldquo;We might add more items in the upcoming weeks, and we will reconfirm the above-proposed list after the end-of-Gregorian year holidays,&rdquo; Francesca Marano said in a planning roundup post. She said core development is not &ldquo;closing up shop&rdquo; for the holidays, and volunteers plan to run&nbsp;<a href=\"https://make.wordpress.org/core/2020/12/11/call-for-volunteers-early-bug-scrubs-for-wordpress-5-7/\">bug scrubs</a>&nbsp;and&nbsp;<a href=\"https://make.wordpress.org/core/2020/12/11/dev-chat-schedule-for-the-end-of-the-year/\">dev chats</a>. Those who cannot attend a meeting but want to advocate for a ticket can always comment on the dev chat agenda post to have it included in the discussion.</p>\n\n\n\n<p>Matias Ventura created a GitHub issue in August for contributors to track the progress of <a href=\"https://github.com/WordPress/gutenberg/issues/24551\">full-site editing milestones</a>. Some of the infrastructure and UI is already in place, as well as the ability to navigate through pages, templates, parts, and know which is area is active. Styling, theme blocks, the Query block, and the Navigation block are still in progress.</p>\n\n\n\n<p>There are a lot of moving pieces to make full-site editing features cohesive and ready for prime time. In Ventura&rsquo;s most recent <a href=\"https://make.wordpress.org/core/2020/12/10/status-check-site-editing-and-customization/\">status update</a> on the project he reported that all of the features outlined are &ldquo;in advanced stages&rdquo; and can be used in the Gutenberg plugin already.</p>\n\n\n\n<p>&ldquo;The main hurdle to include the work in major WordPress releases are the various dependencies between each project when it comes to ensuring a great user experience,&rdquo; Ventura said. &ldquo;The immediate focus is then on completing the milestones, stabilizing the work, and doing as much testing with different kinds of users as possible.&rdquo; </p>\n\n\n\n<p>WordPress contributors are planning <a href=\"https://wordpress.org/about/roadmap/\">four releases in 2021</a>, allowing for multiple opportunities to introduce new features.</p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>Beta 1 for 5.7 is planned for early February and the general release is expected March 9, 2021. </p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 21 Dec 2020 23:18:47 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:30;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:48:\"BuddyPress: BuddyPress 7.1.0 Maintenance Release\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://buddypress.org/?p=316287\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:68:\"https://buddypress.org/2020/12/buddypress-7-1-0-maintenance-release/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1204:\"<p>Immediately available is&nbsp;<a href=\"https://downloads.wordpress.org/plugin/buddypress.7.1.0.zip\">BuddyPress 7.1.0</a>. This maintenance release fixes two bugs related to issues introduced in the 7.0.0 release.</p>\n\n\n\n<ul><li>It makes sure the BP Blogs tools to repare Site icons / Site profile photos synchronization is only available to WordPress multisite configs, </li><li>It fixes the unavailability of the Groups Admin screen for site networks using the BuddyPress multiblog mode.</li></ul>\n\n\n\n<p>For details on the changes, please read the&nbsp;<a href=\"https://codex.buddypress.org/releases/version-7-1-0/\">7.1.0 release notes</a>.</p>\n\n\n\n<p>Update to BuddyPress 7.1.0 today in your WordPress Dashboard, or by&nbsp;<a href=\"https://wordpress.org/plugins/buddypress/\">downloading from the WordPress.org plugin repository</a>.</p>\n\n\n\n<h2>Many thanks to 7.1.0 contributors&nbsp;<span class=\"dashicons dashicons-heart\"></span></h2>\n\n\n\n<p><a href=\"https://profiles.wordpress.org/hareesh-pillai/\"></a><a href=\"https://profiles.wordpress.org/shawfactor\">shawfactor</a>, <a href=\"https://profiles.wordpress.org/slaffik\">slaFFik</a> &amp; <a href=\"https://profiles.wordpress.org/imath/\">imath</a></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 21 Dec 2020 21:08:26 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Mathieu Viet\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:31;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"WPTavern: Ask the Bartender: Integrate With Third-Party App or Use Native WordPress Plugin?\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=109173\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:223:\"https://wptavern.com/ask-the-bartender-integrate-with-third-party-app-or-use-native-wordpress-plugin?utm_source=rss&utm_medium=rss&utm_campaign=ask-the-bartender-integrate-with-third-party-app-or-use-native-wordpress-plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5054:\"<blockquote class=\"wp-block-quote\"><p>My question to you is how you see the future (or even the present) of integrating software with WordPress and when you should make the distinction of going the integration vs. native approach.</p><p>In other words, with the vast ecosystem of WordPress plugins out there, how can a website owner discern which responsibilities WordPress the software should handle and whether that functionality is actually better to plug another software or service into instead?</p><p>Alex</p></blockquote>\n\n\n\n<p class=\"has-drop-cap\">There was a time when I would have said build <em>all the things</em> in WordPress. I was younger then, a bit more naive. I was optimistic about using WordPress as a framework to build anything. There is a part of me that still leans in this direction. Mostly, this is because I want to see what developers in the WordPress ecosystem can achieve. I applaud anyone who pushes the platform beyond its current limits.</p>\n\n\n\n<p>Few people would have guessed that WordPress would become an eCommerce powerhouse. However, WooCommerce has proven it can be done. I still remember when nearly every WordPress theme and plugin author was selling their commercial products via E-junkie. Now, Easy Digital Downloads is the go-to solution, and AffiliateWP handles the affiliate side of things.</p>\n\n\n\n<p>Some of the best products from the WordPress plugin market arose from issues with third-party app integration. Their creators bucked the system and brought useful tools directly into WordPress. Many of these are now multi-million dollar products and companies that employ dozens, hundreds, or even thousands of people. They have their own ecosystems that allow even more third-party developers to make a living. And this is all done on top of WordPress.</p>\n\n\n\n<p>I will always root for the home team, for the developers in our community to build native solutions.</p>\n\n\n\n<p>However, the reality is that WordPress is not the best solution for everything. Depending on the application, the development team has likely put years of work into it, creating a specialized system that caters to that application&rsquo;s users. The experience can often be far better than something available for WordPress.</p>\n\n\n\n<p>I cannot imagine using WordPress as the backbone of a social video site like YouTube, even if it was a small site. The hosting costs would be astronomical. It is far easier and cheaper to rely on integration with YouTube rather than trying to rebuild it.</p>\n\n\n\n<p>In Alex&rsquo;s original correspondence, he also brought up a specific case about integrating with a third-party forum. This is a far more realistic quandary than an average user trying to build the next YouTube. It is also a question that does not have a single answer.</p>\n\n\n\n<p>For users who are creating forums on their site for the first time, my advice would be to go with bbPress. It is a plugin that brings native forums to WordPress. While it is not nearly as powerful as some third-party forum applications, its best feature is that it works directly with the built-in user, role, and capability systems in WordPress. These are some of the more complex APIs in WordPress, and trying to sync user accounts between applications can often be a headache. It is also a complex technical topic that goes beyond the scope of this post. If starting from scratch, I would recommend bbPress or another WordPress forum plugin.</p>\n\n\n\n<p>On the other hand, if a user already has an existing forum with a large amount of content, I would lean toward integrating it and WordPress, particularly if the site owner plans to keep user registrations strictly within the forum software. Much of that will come down to what the end-user feels comfortable with. If they have a strong history with their existing application, making a change may simply not be the best route. There are other items to consider, such as whether sharing a single theme across both platforms is necessary. bbPress can also import content from many existing forum applications.</p>\n\n\n\n<p>The answer to the question is that it depends. Each use case is different.</p>\n\n\n\n<p><em>Should a popular seller on Etsy move everything to WooCommerce?</em> Probably not. That user might want to install the <a href=\"https://wordpress.org/plugins/etsy-shop/\">Etsy Shop</a> integration plugin. Eventually, they might expand their brand enough to no longer rely on the Etsy platform. At that point, WooCommerce could be the answer.</p>\n\n\n\n<p>It comes down to time, cost, research, and testing. Even when a plugin brings a native solution to WordPress that is ideal for most people, it might not be the best answer for an individual. Specifics matter, and I am always happy to talk those over.</p>\n\n\n\n<p class=\"has-white-color has-blue-700-background-color has-text-color has-background text-white bg-blue-700\">This is the second post in the Ask the Bartender series.  Have a question of your own? <a href=\"https://wptavern.com/contact-me/ask-the-bartender\">Shoot it over</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 18 Dec 2020 20:50:28 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:32;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"WPTavern: State of the Word 2020: WordPress Moves Toward Full Site Editing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=109009\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:191:\"https://wptavern.com/state-of-the-word-2020-wordpress-moves-toward-full-site-editing?utm_source=rss&utm_medium=rss&utm_campaign=state-of-the-word-2020-wordpress-moves-toward-full-site-editing\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:6819:\"<p>WordPress enthusiasts around the world tuned into Matt Mullenweg&rsquo;s annual State of the Word address this week, delivered virtually for the first time. Mullenweg recognized the community&rsquo;s efforts in working together during a global pandemic, without the benefit of periodic in-person events that have traditionally re-energized collaboration on the project.</p>\n\n\n\n<p>During a most unusual year that has warped the passage of time and slowed it to the speed of molasses, WordPress&rsquo; release schedule kept a steady, reassuring pace in contrast. The first part of the State of the Word highlighted the three major releases shipped in 2020, which introduced improvements to the block editor, a new default theme, application passwords for the REST API, and new, game-changing features like block patterns, to name just a few. </p>\n\n\n\n<p>WordPress continues to grow its dominant market share and is currently sitting at 39.3% of the&nbsp;<a href=\"https://www.alexa.com/\">Alexa</a>&nbsp;top 10 million sites. Mullenweg attributed&nbsp;that growth to three major contributing factors: the lockdown, e-commerce, and economic uncertainty. The lockdowns put in place to mitigate the virus&rsquo; spread had the effect of giving people the space and time to connect online. It also drove an uptick in entrepreneurship and e-commerce. Mullenweg reported that WooCommerce facilitated more than $20 billion in sales. </p>\n\n\n\n<h3>Site Editor Beta Demo Shows Progress on Full Site Editing Project</h3>\n\n\n\n<p>Gutenberg design contributor Joen Asmussen joined by video to unveil a sneak peek of the progress on the Full Site Editing (FSE) project with a <a href=\"https://youtu.be/QI3qCoiuG3w?t=1293\">demo of the Site Editor beta</a>. The Site Editor allows users to edit a theme&rsquo;s template outside of the post&rsquo;s content. It introduces new blocks for things like the query loop, navigation, site title, tagline, and other aspects of editing templates.</p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>The block list view shows all the different areas of the page, such as the header, footer, columns, and site title, so the user can jump to the section for quick access. Block patterns can also be used within template designs to speed up page layout or match a demo design. Given the current complexity of creating a template design from a blank canvas, block patterns have the potential to become even more indispensable when WordPress users finally get the reins for editing theme templates.</p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>&ldquo;This is the culmination of several ongoing projects to expand upon and improve the customization possibilities in WordPress,&rdquo; Asmussen said. The demo offers a quick overview of how the FSE project is coming together. The reality of &ldquo;everything becoming a block&rdquo; is finally materializing. Gutenberg will soon be capable of providing a consistent editing experience across all aspects of site customization. </p>\n\n\n\n<p>&ldquo;By creating this common framework that every theme and plugin can build on, we&rsquo;re reducing the balkanization within WordPress from people who are solving these problems lots of different ways, and providing what I believe is the basis for the next decade of WordPress&rsquo; growth,&rdquo; Mullenweg said.</p>\n\n\n\n<h3>WordPress&rsquo; Global Community Reiterates the Demand for Multilingual Capabilities</h3>\n\n\n\n<p>The number of questions during the Q&amp;A related to multilingual capabilities underscores the fact that WordPress is undeniably a global community. More than 50% of WordPress sites are not using English. Better multilingual support could be key to the next era of WordPress&rsquo; growth. Nevertheless, multilingual features are at the tail end of the four-phase roadmap for the project&rsquo;s immediate future. </p>\n\n\n\n<p>Mullenweg said WordPress is about &ldquo;two years into a 10-year project,&rdquo; with good chunks of phase 1 and phase 2 done. Phase 1 includes editing inside the post/page content, creating the fundamental building blocks and also bringing them to the mobile apps. Phase 2 is centered around editing outside the content, using blocks to create the site&rsquo;s templates.</p>\n\n\n\n<p>Phase 3 will introduce new collaboration features and workflow for real-time co-editing. Phase 4, which Mullenweg said is &ldquo;just in the imagination stage right now,&rdquo; covers multilingual features. He said he expects this phase to likely &ldquo;be taken underway pretty vigorously in 2022.&rdquo;</p>\n\n\n\n<p>Mat&iacute;as Ventura answered a question about a phase 4 roadmap, confirming that there is no specific plan for its multilingual implementation right now. He said there have been some initial conversations regarding the implications of localization, specifically around patterns and block themes, and how those can be built. Nothing substantial has emerged yet but the team will be creating a more detailed overview of what is needed. Fallback languages is one feature that several community members brought up in the Q&amp;A time.</p>\n\n\n\n<p>When asked whether some existing multilingual solutions could be reused for core, Mullenweg was hesitant to prescribe a specific approach at this time. He said he is anxious to get better multilingual support in Gutenberg and offered what I believe is the most candid explanation thus far for why multilingual capabilities fall further down the the list of priorities:</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>Whether we do it as part of core or as part of an official plugin is to be decided. Part of the reason we made it phase 4 is that we can only do so many things well at a time. It is supremely important that we execute super well on these first phases of Gutenberg blocks. If we don&rsquo;t get phase 1 and phase 2 to be the best experiences in the world for editing bar none, of any open source or proprietary competitors or builders, phase 3 and 4 just won&rsquo;t matter because&nbsp;WordPress won&rsquo;t be relevant a decade from now. I do believe that is the most important problem we&rsquo;re facing. I don&rsquo;t want to dilute the core contributors&rsquo; focus away from the initial phases of Gutenberg because that&rsquo;s how important I think they are.</p></blockquote>\n\n\n\n<p>Mullenweg said there is nothing stopping the community from investing more in multilingual plugins and exploring different approaches to see what will get core most of the way there. The next official step would be figuring out a framework that will work well with plugins and themes.</p>\n\n\n\n<p>Depending on your interest and involvement in the community, there is a lot more to explore in the Q&amp;A. Check out the whole presentation in the video below.</p>\n\n\n\n<div class=\"wp-block-embed__wrapper\">\n\n</div>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 18 Dec 2020 09:21:01 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:33;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:100:\"WPTavern: Contact Form 7 Version 5.3.2 Patches Critical Vulnerability, Immediate  Update Recommended\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=109081\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:241:\"https://wptavern.com/contact-form-7-version-5-3-2-patches-critical-vulnerability-immediate-update-recommended?utm_source=rss&utm_medium=rss&utm_campaign=contact-form-7-version-5-3-2-patches-critical-vulnerability-immediate-update-recommended\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:1899:\"<p><a href=\"https://wordpress.org/plugins/contact-form-7/\">Contact Form 7</a> has <a href=\"https://contactform7.com/2020/12/17/contact-form-7-532/\">patched</a> a critical file upload vulnerability in version 5.3.2, released today by plugin author Takayuki Miyoshi. The plugin is installed on more than five million WordPress sites. </p>\n\n\n\n<p>&ldquo;An unrestricted file upload vulnerability has been found in Contact Form 7 5.3.1 and older versions,&rdquo; Miyoshi said. &ldquo;Utilizing this vulnerability, a form submitter can bypass Contact Form 7&rsquo;s filename sanitization, and upload a file which can be executed as a script file on the host server.&rdquo;</p>\n\n\n\n<p>The vulnerability was discovered by&nbsp;<a href=\"https://www.jinsonvarghese.com/\">Jinson Varghese Behanan</a>&nbsp;from&nbsp;<a href=\"https://www.getastra.com/\">Astra Security</a> on December 16, 2020, and Miyoshi released a fix less than 24 hours later. Behanan highlighted a few ways this vulnerability might be exploited:</p>\n\n\n\n<ol><li>Possible to upload a web shell and inject malicious scripts</li><li>Complete takeover of the website and server if there is no containerization between websites on the same server</li><li>Defacing the website</li></ol>\n\n\n\n<p>Astra Security plans to publish more details on the vulnerability in two weeks after the plugin&rsquo;s user base has had more time to update to the patched version.</p>\n\n\n\n<p>Version 5.3.2 removes control, separator, and other types of special characters from the filename to fix the unrestricted file upload vulnerability. At the time of publishing, more than a million Contact Form 7 updates have been downloaded today. Approximately 20% of the plugin&rsquo;s user base is protected from the vulnerability. Now that it has been patched and published, Contact Form 7 users who do not update will be more at risk of having the vulnerability exploited.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 17 Dec 2020 22:32:42 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:34;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"WPTavern: Help Steer the Future of WordPress via the FSE Outreach Program\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=109083\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:191:\"https://wptavern.com/help-steer-the-future-of-wordpress-via-the-fse-outreach-program?utm_source=rss&utm_medium=rss&utm_campaign=help-steer-the-future-of-wordpress-via-the-fse-outreach-program\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4280:\"<p>All hands on deck. 2021 will be the year of the Site Editor.</p>\n\n\n\n<p>Anne McCarthy announced the official <a href=\"https://make.wordpress.org/core/2020/12/11/the-fse-outreach-program-is-officially-starting/\">start of the Full-Site Editing (FSE) Outreach Program</a> last Friday on the Make Core blog. The program is primarily geared toward end-users. With few channels for average users to communicate with the development team, this offers an opportunity for them to provide direct feedback.</p>\n\n\n\n<p>This announcement comes on the heels of Matias Ventura&rsquo;s full <a href=\"https://make.wordpress.org/core/2020/12/10/status-check-site-editing-and-customization/\">overview of the FSE project</a>. In the post, he laid out where specific FSE features currently stand and what needs to happen to bring the project to fruition.</p>\n\n\n\n<p>The FSE Outreach Program was <a href=\"https://make.wordpress.org/core/2020/05/01/an-experimental-outreach-project-for-full-site-editing/\">expected to begin earlier</a> in the year. Josepha Haden announced it on May 1. However, there was no movement for most of 2020. An early version of FSE was also expected to land in WordPress 5.6, but that was too lofty of a goal for a feature that will essentially change everything about front-end development on the platform.</p>\n\n\n\n<p>The official launch of the program should coincide with the release of Gutenberg 9.6, which is expected to ship within the next week. The program will focus on specific features and flows related to full-site editing. According to the <a href=\"https://make.wordpress.org/test/handbook/full-site-editing-outreach-experiment/faq-for-fse-outreach-experiment/\">program FAQs</a>, participants could be asked to volunteer for up to three hours per week. However, it will also be flexible enough for anyone to participate, regardless of their available hours.</p>\n\n\n\n<p>The program is also starting small, limiting feedback to more common user experiences. It is still experimental at this stage. Easing participants into such a testing program seems like a smart approach.</p>\n\n\n\n<p>Right now, the Site Editor can sometimes be a painful user experience. While it is already possible to put together some interesting layouts, at least as a labor of love, there are many missing pieces. Workflows are odd. Expected features for a design tool are nowhere to be found.  Someone might look at it today and think there is no way it could be a viable core feature next year, but the development team continues to polish the experience with each Gutenberg update. The Site Editor is not production-ready yet, but it is time to get serious about testing and feedback.</p>\n\n\n\n<p>Those interested in volunteering for the program should have a WordPress Slack account and join the <a href=\"https://wordpress.slack.com/archives/C015GUFFC00\">#fse-outreach-experiment</a> channel. McCarthy said she will also post an update on the <a href=\"https://make.wordpress.org/test/\">Make Test</a> blog with further details for participants once Gutenberg 9.6 is released.</p>\n\n\n\n<h2>The First Focus Area</h2>\n\n\n\n<p class=\"has-drop-cap\">The first feature up for discussion is a new <a href=\"https://github.com/WordPress/gutenberg/pull/26355\">template editing mode inside the post editor</a>. It adds a new &ldquo;Template&rdquo; option in the post-editing sidebar that will allow users to jump between editing their post and editing the template that outputs that post. It is a marriage of the post and site editors. Underneath, both are run by the block system, so there is little difference in the experiences.</p>\n\n\n\n<img />Potential template editing option in the post editor.\n\n\n\n<p>Long-term, it makes sense that users should be able to switch seamlessly between both editors. I worry that we may be jumping the gun a bit on this feature since the Site Editor is still at a rough beta stage. However, it does not hurt to get some early feedback on what the workflow should look like.</p>\n\n\n\n<p>&ldquo;Please keep in mind that this is the program&rsquo;s first iteration,&rdquo; wrote McCarthy in the post. &ldquo;We&rsquo;re starting with this first item and expecting the outcome to be a comprehensive list of issues that the Gutenberg team can work on as capacity allows.&rdquo;</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 17 Dec 2020 22:09:34 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:35;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:81:\"BuddyPress: How BuddyX made its way to the official WordPress.org theme directory\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://buddypress.org/?p=316229\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:101:\"https://buddypress.org/2020/12/how-buddyx-made-its-way-to-the-official-wordpress-org-theme-directory/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:14561:\"<p>We use to feature BuddyPress usage case studies. These are great ways to share with you how BuddyPress can help you achieve your community site projects reading how other buddies did it. The case study you are about to read now is a bit different. Itâ€™s about the steps the lovely <a href=\"https://wordpress.org/themes/buddyx/\">BuddyX</a> BuddyPress theme had to take to be widely and freely available from the official WordPress.org theme directory. Iâ€™m very happy <a href=\"https://profiles.wordpress.org/vapvarun/\">Varun Dubey</a> took the time to write this guest post to share his experience with all of us. My secret hope is that it will inspire as many BuddyPress Theme authors as possible to do the same <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f607.png\" alt=\"?\" class=\"wp-smiley\" />.</p>\n\n\n\n<p>Varun Dubey is a full-stack WordPress &amp; BuddyPress developer. Heâ€™s the co-founder of <a rel=\"noreferrer noopener\" href=\"https://wbcomdesigns.com/about-us/\" target=\"_blank\">Wbcom Designs</a>, a WordPress themes and plugins development agency in India. Heâ€™s also a regular BuddyPress contributor, we often talk with him about the BuddyPress project during our development meetings (every other Wednesday at 19:00 UTC on Slack), he contributes to our development tasks (testing, reporting issues, patching, documenting, etc..) and he still manage to find time to help you regularly <a href=\"https://buddypress.org/members/vapvarun/forums/replies/\">replying to your support topics</a> (661 replies so far!). So, once again, many thanks to him for <a href=\"https://codex.buddypress.org/participate-and-contribute/\">getting involved with BuddyPress</a> <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f60d.png\" alt=\"?\" class=\"wp-smiley\" />.</p>\n\n\n\n<p><em>So letâ€™s learn more from his experience, hereâ€™s what he wanted to share with you about it!</em></p>\n\n\n\n<span id=\"more-316229\"></span>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>I submitted my first theme at WordPress.org, and now itâ€™s live.</p><cite><a class=\"bp-suggestions-mention\" href=\"https://buddypress.org/members/vapvarun/\" rel=\"nofollow\">@vapvarun</a></cite></blockquote>\n\n\n\n<div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\"><a href=\"https://wordpress.org/themes/buddyx/\">Buddyx</a></blockquote>\n</div>\n\n\n\n<p>We, at Wbcom Designs, are excited about our achievement to present a full-fledged community theme powered by BuddyPress and WordPress. It took almost a year to work on BuddyX and make it stable enough to submit at WordPress.org.&nbsp;</p>\n\n\n\n<p>The approval process was surprisingly short, approx 6-7 weeks to get it approved after initial submission. We usually had heard that it might take 6-9 months to get the theme live.</p>\n\n\n\n<p>Submitting the theme at WordPress.org will increase your reach to all sites which are using WordPress. The WordPress theme directory is used by millions of WordPress users all over the world. The directory themes are available for download from WordPress.org, and WordPress users can also install them directly from their administration screens.</p>\n\n\n\n<p>By hosting your theme on WordPress.org, youâ€™ll get:</p>\n\n\n\n<ul><li>Stats on how many times your theme has been downloaded</li><li>User feedback in the forums</li><li>Ratings, to see what users think of your theme.</li></ul>\n\n\n\n<p>We have learned a lot about code reviews, code quality, and theme lifecycle during the approval process. I will give a quick glimpse of how it was for BuddyX; it might help others get the theme approved quickly.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2>How to start with a theme skeleton?</h2>\n\n\n\n<p>Lots of developers begin the development of a theme from scratch. There are articles and tutorials available on how to start theme development from scratch, and the <a href=\"https://developer.wordpress.org/themes/\">WordPress Themes development handbook</a> also has a detailed step guide on this topic.&nbsp;</p>\n\n\n\n<p>After comparing <a href=\"https://underscores.me/\" target=\"_blank\" rel=\"noreferrer noopener\">_s</a>, <a href=\"https://roots.io/\" target=\"_blank\" rel=\"noreferrer noopener\">roots</a>, and other starter themes, we decided to start with <a href=\"https://wprig.io/\" target=\"_blank\" rel=\"noreferrer noopener\">the WP rig</a>. WP rig helped get a basic skeleton of the BuddyX using the latest tools, best practices, and coding standards. It helped integrate lazy-loading, async/defer JavaScript enqueueing, component-level pre-loaded CSS, optimized Web Font loading, modular extensions, and a full-featured list of optional template hierarchy files at day one.&nbsp;</p>\n\n\n\n<p>Along with WordPress Code Quality Testing, <a href=\"https://make.wordpress.org/core/handbook/best-practices/coding-standards/\">WordPress Coding Standards</a> integration was also part of it. After getting initial help for the WP rig, we only have to focus on design improvement for BuddyPress Community features.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2>Early prep of the Theme submission</h2>\n\n\n\n<p>After the design part gets ready, we have released our theme on our website and make it available for free download to get initial feedback as a soft launch. It received a good response from the community, and we have got some feature requests and feedback on initial versions. It helped us to gain the confidence to submit BuddyX at WordPress.org.</p>\n\n\n\n<p>You can follow these steps to check your theme against WordPress requirements before submitting it for review.&nbsp;</p>\n\n\n\n<p>1- Code Quality Check- To make sure your theme code is secure ( using proper escaping functions ), it meets <a href=\"https://github.com/WordPress/WordPress-Coding-Standards\">WordPress Coding Standards</a>.&nbsp;</p>\n\n\n\n<p>2- Theme Check by plugin- The WordPress Theme review team checks your theme using the <a href=\"https://wordpress.org/plugins/theme-check/\">Theme Check</a> plugin. It will be useful to double-check your theme against it first before uploading it.</p>\n\n\n\n<div class=\"wp-block-image\"><a href=\"https://buddypress.org/wp-content/uploads/1/2020/12/buddyx-theme-check.jpg\"><img width=\"1999\" height=\"1738\" src=\"https://buddypress.org/wp-content/uploads/1/2020/12/buddyx-theme-check.jpg\" alt=\"Illustration of the screen generated by the Theme Check plugin\" class=\"wp-image-316230\" /></a></div>\n\n\n\n<p>3- Theme Requirement Checklist- WordPress Theme review team has published <a href=\"https://make.wordpress.org/themes/handbook/review/required/\">Theme Requirements</a>. You also have to make sure you have gone through all items one by one.</p>\n\n\n\n<p>Essential points you have to double-check with Theme requirements are</p>\n\n\n\n<ul><li>Debug log should be clean; it should not have any PHP or JavaScript errors.</li><li>All strings should be ready for translation.&nbsp;</li><li>Add unminified source files along with minified JavaScript and CSS files.&nbsp;</li><li>All functions and Classes should have a theme-specific unique prefix.</li><li>All js or CSS should enqueue properly inside theme functions instead of hard-coded in the header or footer.&nbsp;</li></ul>\n\n\n\n<p>5- Theme Unit Test XML &#8211; You will also have to check with <a href=\"https://github.com/WPTT/theme-unit-test\">Unit Testing XML</a> data. It will help get proper labels and layout testing on various templates like 404, comments on pages, comments on the post, post format testing, layout, and alignment testing.&nbsp;</p>\n\n\n\n<p>6- Screenshot- It should not contain any branded logo or visible human face.</p>\n\n\n\n<p>7- Keyboard Navigation- Keyboard-dependent navigators are also mandatory features now. You can find details at the <a href=\"https://make.wordpress.org/themes/handbook/review/accessibility/required/#keyboard-navigation\">Keyboard Navigation section of the theme development handbook</a>.</p>\n\n\n\n<p>Consider the following non-coding points before submission:</p>\n\n\n\n<ol><li>Your website terms and conditions page must indicate that your <strong>company has all products under GPL</strong>.</li><li>All images inside the theme must have GPL.</li><li>Make sure you have not disabled any default WordPress features.&nbsp;</li><li>The readme file must have all credit info for used images, libraries, and references.</li><li>Theme does not represent anything illegal, dishonest, or morally offensive behavior.</li></ol>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2>Upload at WordPress.org&nbsp;</h2>\n\n\n\n<p>You can upload the theme using <a href=\"https://wordpress.org/themes/upload/\">https://wordpress.org/themes/upload/</a>, any new revision, and the theme updates.&nbsp;</p>\n\n\n\n<p>After uploading the theme files, it will create a ticket, and you will have to wait for a couple of days before any developer requests to review your theme. All reviewers are volunteers. You can also get an idea of the current theme review <a href=\"https://make.wordpress.org/themes/handbook/about/members/\">team member </a>from the codex page.</p>\n\n\n\n<p>You can also check current themes waiting in the queue at <a href=\"https://themes.trac.wordpress.org/query?status=reopened&status=reviewing&col=id&col=summary&col=owner&col=priority&col=resolution&col=time&col=changetime&col=reporter&report=8&desc=1&order=changetime\">https://themes.trac.wordpress.org</a>. It will also be useful to join the <a href=\"https://wordpress.slack.com/messages/themereview/\">Slack theme review channel</a> to discuss review issues in the open channel.</p>\n\n\n\n<div class=\"wp-block-image\"><a href=\"https://buddypress.org/wp-content/uploads/1/2020/12/buddyx-ticket.jpg\"><img width=\"1660\" height=\"1354\" src=\"https://buddypress.org/wp-content/uploads/1/2020/12/buddyx-ticket.jpg\" alt=\"Screen capture of the Themes Trac environment\" class=\"wp-image-316233\" /></a><a href=\"https://themes.trac.wordpress.org/ticket/89135\">View the full ticket</a></div>\n\n\n\n<p>Try to be proactive for any comments and points made related to your theme and submit fixes actively to keep your ticket reviewer.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2><strong>About BuddyX features</strong></h2>\n\n\n\n<div class=\"wp-block-image\"><a href=\"https://buddypress.org/wp-content/uploads/1/2020/12/buddyx-screenshot-v.png\"><img width=\"1024\" height=\"768\" src=\"https://buddypress.org/wp-content/uploads/1/2020/12/buddyx-screenshot-v-1024x768.png\" alt=\"\" class=\"wp-image-316234\" /></a></div>\n\n\n\n<p>BuddyX is a community membership theme with BuddyPress support. It is a lightweight, fully responsive, SEO optimized, RTL &amp; Translation ready theme. It is a multipurpose theme perfect for all niches, be it membership, social community, corporate, e-commerce, LMS, etc.</p>\n\n\n\n<p>The theme also provides support for WooCommerce, WC Vendor, LearnDash, LearnPress, and GamiPress plugins. It is highly customizable and works perfectly with page builders such as Elementor and Gutenberg. BuddyX is perfect for creating social learning, marketplace, and blogging websites using BuddyPress integrations.</p>\n\n\n\n<p>BuddyX has the latest best practices for progressive web content and optimization. We have tested it with the latest BuddyPress version and popular BuddyPress addons. BuddyX is developed, maintained, and supported by Wbcom Designs.</p>\n\n\n\n<p>We have worked on the following features</p>\n\n\n\n<ul><li>User menu for logged in members</li><li>Improved UI for Activity, members, groups directory pages</li><li>Improved UI for Member and Group single unique layout</li><li>Both sidebar options for BuddyPress pages</li><li>Improve sidebar widgets style</li><li>rtMedia supports to display of single and multiple photos in the activity.</li><li>Better widgets layout</li><li>Color scheme options</li><li>Extensible with plugins</li></ul>\n\n\n\n<p>Within the theme, we have overridden several template files to make the above changes.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h3><strong>Activity Compotent &#8211;&nbsp;</strong></h3>\n\n\n\n<pre class=\"wp-block-verse\">buddypress/activity/entry.php\nbuddypress/activity/single/home.php</pre>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h3><strong>Members Component &#8211;</strong></h3>\n\n\n\n<pre class=\"wp-block-verse\">buddypress/members/members-loop.php\nbuddypress/members/single/cover-image-header.php\nbuddypress/members/single/home.php\nbuddypress/members/single/friends/requests-loop.php\nbuddypress/members/single/groups/invites.php</pre>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h3><strong>Groups Component &#8211;&nbsp;</strong></h3>\n\n\n\n<pre class=\"wp-block-verse\">buddypress/groups/groups-loop.php\nbuddypress/groups/single/cover-image-header.php\nbuddypress/groups/single/home.php\nbuddypress/groups/single/members-loop.php</pre>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h3><strong>rtMedia plugin &#8211;</strong></h3>\n\n\n\n<pre class=\"wp-block-verse\">rtmedia/main.php&nbsp;</pre>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<p>We have picked the Nouveau template for BuddyX for various reasons as following.</p>\n\n\n\n<ul><li>Nouveau delivers modern markup with fresh JavaScript-powered templates.</li><li>Nouveau provides vertical and horizontal layout options for BuddyPress navigation.</li><li>Provide a grid layout and a classic flat list.</li><li>Minimal styling for better theme compatibility.</li><li>Consistent and flexible PHP template functions.</li><li>Customizer compatibility.</li><li>Better differentiation of content types.</li><li>A rethought Messages component.</li></ul>\n\n\n\n<p>Summarizing features for BuddyX, you can check a detailed overview at <a href=\"https://buddyxtheme.com/features/\" target=\"_blank\" rel=\"noreferrer noopener\">buddyxtheme.com</a>.</p>\n\n\n\n<ul><li>Multiple Header option</li><li>Polished member and group directory layout</li><li>Three variations for member and group header layout</li><li>Color Scheme and Typo options</li><li>RTL and translation ready</li><li>AMP ready</li><li>Gutenberg ready</li><li>WooCommerce ready with multivendor using WC vendors, Dokan support in the development queue.</li><li>bbPress Forums Support</li><li>Optimized Mobile Menu Panel</li><li>LMS support: Learndash and Learnpress support included; we will add dedicated support for other popular LMS plugins incoming updates.</li></ul>\n\n\n\n<p>We have prepared a couple of demos; you can <a href=\"https://buddyxtheme.com/demos/\" target=\"_blank\" rel=\"noreferrer noopener\">try the BuddyX demo</a> as a member login.BuddyX is available at <a href=\"https://wordpress.org/themes/buddyx/\">WordPress.org</a> for download to create your community; we will appreciate any feedback to improve BuddyX features.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 17 Dec 2020 18:54:06 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Mathieu Viet\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:36;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"WPTavern: Mapbox GL JS Is No Longer Open Source\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=108948\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:139:\"https://wptavern.com/mapbox-gl-js-is-no-longer-open-source?utm_source=rss&utm_medium=rss&utm_campaign=mapbox-gl-js-is-no-longer-open-source\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:9008:\"<p><a href=\"https://github.com/mapbox/mapbox-gl-js\">Mapbox GL JS</a>, formerly an open source JavaScript library for interactive, customizable vector maps, has adopted a proprietary license in its recent <a href=\"https://github.com/mapbox/mapbox-gl-js/blob/main/CHANGELOG.md#200\">version 2</a> update:</p>\n\n\n\n<ul><li>mapbox-gl-js is no longer under the 3-Clause BSD license. By upgrading to this release, you are agreeing to&nbsp;<a href=\"https://www.mapbox.com/legal/tos/\">Mapbox terms of service</a>.&nbsp;Refer to LICENSE.txt for the new licensing terms and details. For questions, contact our team at&nbsp;<a href=\"https://support.mapbox.com/\">https://support.mapbox.com</a>.</li><li>Beginning with v2.0.0, a billable map load occurs whenever a Map object is initialized. Before updating an existing implementation from v1.x.x to v2.x.x, please review the&nbsp;<a href=\"https://docs.mapbox.com/accounts/guides/pricing/#mapbox-gl-js-v100-and-higher\">pricing documentation</a>&nbsp;to estimate expected costs.</li></ul>\n\n\n\n<p>Versions 1.x remain under the&nbsp;3-Clause BSD license, but <a href=\"https://www.mapbox.com/\">Mapbox</a> will only be investing in developing new features for the proprietary licensed version 2.0+. This news came as a surprise to many engineers who have built products on top of this previously open source library.</p>\n\n\n\n<p>&ldquo;This move has produced&nbsp;<a rel=\"noreferrer noopener\" href=\"https://joemorrison.medium.com/death-of-an-open-source-business-model-62bc227a7e9b\" target=\"_blank\">shockwaves</a>&nbsp;<a rel=\"noreferrer noopener\" href=\"http://blog.cleverelephant.ca/2020/12/mapbox-morrison.html\" target=\"_blank\">in</a>&nbsp;the geospatial industry,&rdquo; Javier de la Torre wrote on the <a href=\"https://carto.com/blog/our-thoughts-as-mapboxgl-js-2-goes-proprietary/\">CARTO blog</a>. &ldquo;Many organizations are using Mapbox GL JS directly or fork from it. This library is responsible for the visualization of the so-called basemap, the cartography layer that underpins most maps. Previously Open Source, MapboxGL is a great solution, and could be used with many different data sources, so it became the de facto way to render basemaps.&rdquo; </p>\n\n\n\n<p>Mapbox <a href=\"https://www.mapbox.com/showcase/\">powers all sorts of maps</a> for high profile websites like CNN, The New York Times, Ancestry, Strava, Shopify, Facebook, and more. It is also used by WordPress.com and Jetpack for the <a href=\"https://wordpress.com/support/wordpress-editor/blocks/map-block/\">Map block</a>. The library is used in many <a href=\"https://wordpress.org/plugins/search/mapbox/\">plugins</a> on WordPress.org, some with tens of thousands of users. Developers using versions 1.x will want to be aware of the future of the Mapbox GL JS library. </p>\n\n\n\n<p>&ldquo;Mapbox&rsquo;s decision this week to release a brand new version of Mapbox GL JS and keep it proprietary stunned me,&rdquo; <a href=\"https://www.azavea.com/\">Azavea</a> product specialist Joe Morrison <a href=\"https://joemorrison.medium.com/death-of-an-open-source-business-model-62bc227a7e9b\">wrote</a> on his personal blog. &ldquo;Not only was v1 already a wildly popular open source library, but Mapbox&rsquo;s reputation as a prolific creator of open source software is a cornerstone of their whole identity. Describing what makes Mapbox special without mentioning &lsquo;open source&rsquo; is like trying to describe chocolate milk to an alien without using the word &lsquo;liquid.\'&rdquo;</p>\n\n\n\n<div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Mapbox GL JS v2: <br />We need to deduct a few points for Mapbox\'s ridiculously obfuscated and convoluted way of trying to avoid mentioning the licence change in their announcement email. Can only imagine what series of meetings between comms, marketing and devs led to this. <a href=\"https://t.co/wWK4z51fzo\">pic.twitter.com/wWK4z51fzo</a></p>&mdash; Steve Bennett (@stevage1) <a href=\"https://twitter.com/stevage1/status/1336498655793086464?ref_src=twsrc%5Etfw\">December 9, 2020</a></blockquote>\n</div>\n\n\n\n<p>Mapbox hasn&rsquo;t formally clarified why it went proprietary with the library so speculation abounds. Morrison theorizes that cloud providers are killing the open core business model of software companies. <a href=\"http://crunchydata.com/\">Crunchy Data</a> Geospatial Engineer Paul Ramsey <a href=\"http://blog.cleverelephant.ca/2020/12/mapbox-morrison.html\">responded</a> to Morrison&rsquo;s article, contending that Mapbox is not an &ldquo;open core&rdquo; company and that the business of selling location based services may not be panning out for them:</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>But like Google, the value proposition Mapbox sells isn&rsquo;t in the software, so much as the data and the platform underneath. Mapbox has built a unique, scalable platform for handling the huge problem of turning raw OSM data into usable services, and raw location streams into usable services. They sell access to that platform.</p><p>Mapbox has never been a software company, they&rsquo;ve always been a data and services company.</p></blockquote>\n\n\n\n<p>Mapbox employee Saman Bemel Benrud said the company is finally moving to make its products sustainable:</p>\n\n\n\n<div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Disruption by undercutting costs via VC subsidies is still a thriving business model, and it just creates unsustainable products while destroying the thing that existed before. Mapbox is trying to become sustainable, finally, and I&rsquo;m here for it.</p>&mdash; Saman Bemel Benrud (@samanbb) <a href=\"https://twitter.com/samanbb/status/1336380594410770434?ref_src=twsrc%5Etfw\">December 8, 2020</a></blockquote>\n</div>\n\n\n\n<p>This change has the potential to negatively impact the developers and companies that built products on top of Mapbox GL JS, thinking its open source licensing was set in stone.</p>\n\n\n\n<p>&ldquo;The change says nothing about &lsquo;open source&rsquo; in the large as a model, and everything about &lsquo;single vendor projects&rsquo; and whether you should, strategically, believe their licensing,&rdquo; Ramsey said.</p>\n\n\n\n<p>&ldquo;I (and others) took the licensing (incorrectly) of Mapbox GL JS to be a promise, not only for now but the future, and made decisions based on that (incorrect) interpretation. I integrated GL JS into&nbsp;<a href=\"https://github.com/CrunchyData/pg_tileserv/blob/master/assets/preview-table.html\">an open source project</a>&nbsp;and now I have to revisit that decision.&rdquo;</p>\n\n\n\n<p>Some community members have already <a href=\"https://github.com/maplibre/maplibre-gl-js\">forked Mapbox GL JS</a> to maintain the 1.x version, but the vast majority of contributors to the original library were sponsored by Mapbox. The immediate future of the MapLibre GL fork may not include many new features, as the initial roadmap&rsquo;s stated goal is &ldquo;consistency and backwards-compatibility with previous releases and continued bug-fixes and maintenance going forward.&rdquo; </p>\n\n\n\n<div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">Our first pre-release version of BSD-licensed maplibre-gl is out, a drop-in replacement for mapbox-gl. Big thanks to Seth Nickell! <a href=\"https://t.co/f9XqzpwDrT\">https://t.co/f9XqzpwDrT</a></p>&mdash; MapLibre (@maplibre) <a href=\"https://twitter.com/maplibre/status/1336875209559855104?ref_src=twsrc%5Etfw\">December 10, 2020</a></blockquote>\n</div>\n\n\n\n<p>A lengthy <a href=\"https://news.ycombinator.com/item?id=25347310\">discussion</a> on Hacker News drew a <a href=\"https://news.ycombinator.com/item?id=25350808\">response</a> from former Mapbox engineer Tom MacWright, who wrote the company&rsquo;s open source policy as a founding member of the team. </p>\n\n\n\n<p>&ldquo;I won&rsquo;t get into all the context, but I think we should consider whether a community without contributors is a community,&rdquo; MacWright said. &ldquo;GL JS never had major active contributors outside of the company, and there are no self-funded webgl experts with lots of time who are ready to maintain a fork.</p>\n\n\n\n<p>&ldquo;OSS, we hoped, was about enabling people and unlocking people&rsquo;s ability to collaborate. It turns out that in 2020, it&rsquo;s mostly helping companies and getting nothing in return. That&rsquo;s not a dynamic you can build a sustainable business on.&rdquo;</p>\n\n\n\n<p>The MapLibre GL fork may gain some momentum and emerge as a viable alternative to Mapbox&rsquo;s closed source library, but it will take time to see how well it is maintained. In the meantime, the existing version 1.x can meet most users&rsquo; needs. Mapbox has burned through a lot of good will with this controversial licensing update, which some perceive as a &ldquo;bait and switch&rdquo; offense. Rebuilding community trust, after removing the freedoms granted by the previous license, will be an uphill battle.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 17 Dec 2020 04:45:01 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:37;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"WPTavern: Jump Start Block-Based Theme Development With the FSE Theme Generator\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=108900\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:203:\"https://wptavern.com/jump-start-block-based-theme-development-with-the-fse-theme-generator?utm_source=rss&utm_medium=rss&utm_campaign=jump-start-block-based-theme-development-with-the-fse-theme-generator\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4913:\"<p class=\"has-drop-cap\">Block-based themes are not complicated. Their structure is almost simple enough that developers are unlikely to need a tool to generate a blank theme. However, for those unfamiliar with how themes are built for the upcoming full-site editing (FSE) feature, a boilerplate is a good place to start.</p>\n\n\n\n<p>The <a href=\"https://github.com/WordPress/theme-experiments\">Theme Experiments</a> repository now has a new <a href=\"https://github.com/WordPress/theme-experiments/tree/master/emptytheme\">Empty Theme</a>. Alongside it is a command-line tool to generate a copy of that theme with a custom name, author, and URI.</p>\n\n\n\n<p>The idea is not new. There are tons of such tools for generating a theme in the wild. However, it is time for new tools that focus on block-based theming.</p>\n\n\n\n<p>For theme authors who want to generate a new block-based theme, they must clone a copy of the Theme Experiments repository. Then navigate to that folder via their command-line tool and type the following command:</p>\n\n\n\n<pre class=\"wp-block-code\"><code>php new-empty-theme.php</code></pre>\n\n\n\n<p>From that point, it is a simple matter of answering a few questions and letting the tool do the work of creating a new theme folder.</p>\n\n\n\n<h2>Digging Into the Generated Theme</h2>\n\n\n\n<p class=\"has-drop-cap\">The generated theme is not much to look at. However, it is a theme that works within the new full-site editing system. After activation, theme authors can begin tinkering with the theme via the Site Editor screen (requires the Gutenberg plugin).</p>\n\n\n\n<img />Generated theme in the Site Editor.\n\n\n\n<p>There is one exception to it being a <em>working</em> theme. Loading the header template part is currently broken. Of course, I <a href=\"https://github.com/WordPress/theme-experiments/issues/146\">opened a ticket</a> for that issue, which should be easy for the development team to resolve.</p>\n\n\n\n<p>The file and folder structure is slim in comparison to traditional themes. It contains the bare-bones to get a theme up and running in the Site Editor. The following files and folders are included:</p>\n\n\n\n<ul><li><code>/assets</code><br />&ndash; <code>alignments-front.css</code></li><li><code>/block-template-parts</code><br />&ndash; <code>header.html</code></li><li><code>/block-templates</code><br />&ndash; <code>index.html</code><br />&ndash; <code>singular.html</code></li><li><code>experimental-theme.json</code></li><li><code>functions.php</code></li><li><code>index.php</code></li><li><code>readme.md</code></li><li><code>style.css</code></li></ul>\n\n\n\n<p>Even those are likely to be trimmed down in the future. The <code>experimental-theme.json</code> file will eventually be renamed to <code>theme.json</code>.</p>\n\n\n\n<p>The current <code>alignments-front.css</code> is nearly 80 lines of boilerplate code for handling the various block alignments. There is no need for every theme author to recreate all of this code, which should not change much between themes. That is why there is an open ticket for Gutenberg to <a href=\"https://github.com/WordPress/gutenberg/issues/26633\">provide alignment styles</a> on the front end. Theme authors will be able to overwrite this. However, the fewer files and lines of code theme authors need to contend with, the better.</p>\n\n\n\n<p>The standard <code>index.php</code> template is empty. It will no longer be useful for building themes now that block-based templates are stored in the <code>/block-templates</code> and <code>/block-template-parts</code> folders. <code>style.css</code> just houses the theme information. FSE themes will mostly use <code>theme.json</code> to configure default styles.</p>\n\n\n\n<p>In the coming months and years, theme authors will be working primarily in the <code>theme.json</code> file and block template folders. The jury is still out on whether the theming ecosystem will readily accept this change. At the same time, it feels refreshing to see the untangling of theme development. Traditional theming today has created behemoth codebases in an attempt to keep up with features that users want. A shift in how developers build themes was inevitable and necessary.</p>\n\n\n\n<p>My one nit-pick with the generated theme is the inclusion of the pluggable theme setup function in the <code>functions.php</code> file, which has somehow become a mainstay of core-developed themes over the years. There are APIs for enabling or disabling everything in such setup functions, and there is no reason for child themes to overwrite them wholesale.</p>\n\n\n\n<p>If things go according to plan, even the standard theme setup function may be on the chopping block. These functions are generally a list of calls to <code>add_theme_support()</code>. The long-term plan is for the current theme-supported features to either be enabled by default for block-based themes or configurable via the <code>theme.json</code> file.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 16 Dec 2020 21:54:30 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:38;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:23:\"HeroPress: Marginalized\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://heropress.com/?post_type=heropress-essays&p=3437\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:98:\"https://heropress.com/essays/marginalized/#utm_source=rss&utm_medium=rss&utm_campaign=marginalized\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:13958:\"<img width=\"960\" height=\"480\" src=\"https://s20094.pcdn.co/wp-content/uploads/2020/12/121520-min.jpg\" class=\"attachment-large size-large wp-post-image\" alt=\"Pull quote: Being underestimated is a gift.\" /><p>When I was asked to write an essay for HeroPress, I humbly accepted due to my desire to help others. HeroPress needs a post and perhaps something I say could have a positive impact on another person. Little did I realize that having to write as a â€œmarginalizedâ€ individual would cause me to want to retreat.</p>\n<p>The word â€œmarginalizedâ€ stirs up a lot of emotion in me and thoughts such as â€œam I marginalized enoughâ€, â€œwhat if I offend someoneâ€, and â€œwill I be attackedâ€ tend to come to mind. Interestingly, I worry that Iâ€™ll be attacked by more women than men. I could easily write the story of my woes because Iâ€™ve had plenty but I like solutions, perseverance and resilience better. Some of these solutions may help you realize why I could be seen as â€œmarginalizedâ€ but perhaps weâ€™ll find a new label such as human and worthy of kindness, trust, inclusion, and a seat at the decision table.</p>\n<h3>The Beginning</h3>\n<p>I have been in the WordPress space since 2005 and tech since 2003. My team realized early on that WordPress was actually a CMS. We ranked #2 in google for web design back when SEO was easy. I was answering phones, marketing, and doing billing at that time. I would ask about budgets when potential clients would call and I had to turn away a lot of business because they couldnâ€™t afford us. The worst part was that I didnâ€™t have a trusted company that I could refer them to at the time. While focusing on web design I couldnâ€™t understand why it took so long to create a website and why we couldnâ€™t create our own less expensive solution to offer them.</p>\n<p>Long story short, a prototype was made, then refined and rebranded as Pagely, and the term â€œManaged WordPress Hostingâ€ was created. It was about 2 years later that our next competitor arrived and another 2 years for the behemoths to create their own managed WordPress solutions. Sounds grand right? Being the first and the originator of a multi-billion dollar industry had its challenges and these are problems that our competitors didnâ€™t have to face. Now, letâ€™s add being a female.</p>\n<p>I feel that I need to preface these next parts of my life story mainly because Iâ€™m a female and itâ€™s what Iâ€™ve been trained to do even subconsciously. Iâ€™m joking, sort of.</p>\n<p>Usually if I use a word that doesnâ€™t resonate with certain males, Iâ€™ll get mansplained to instead of searching for clarity. Their initial jump to assume that â€œI donâ€™t knowâ€ instead of â€œthey donâ€™t understandâ€ astounds me. Thatâ€™s not to say I am infallible, didnâ€™t say something ridiculous, or am unwilling to learn/self-reflect. Itâ€™s unnerving when Captain Obvious brings forth the basics.</p>\n<p>That being said, first, I understand that my labels include female, white, American, founder, wife, mother, wealthy, privileged and more depending on who Iâ€™m talking with. It took years of therapy to take my own traumas seriously because I didnâ€™t have it as bad as others. It caused me to repress my own experiences and put others before myself even when they didnâ€™t deserve space in my kind mind. Now, Iâ€™m more resilient and realize that I canâ€™t be everything to everybody but I can include everyone with exception of the unhinged.</p>\n<p>Second, this is my story. It may not be similar to your own, and I donâ€™t have all the answers. Iâ€™m not competing with anyoneâ€™s troubles. We can both exist.</p>\n<p>Third, Iâ€™m very grateful because I have been surrounded mostly by successful women and men willing to help Josh and I accomplish our shared goals. Josh is my husband and co-founder of Pagely.</p>\n<h3>First Impressions</h3>\n<p>When Pagely first started, hate mail ensued along with many people signing up. I went to a WordCamp and a prominent figure in the WordPress community asked me where the person was that came up with Pagely because they really liked it. They were alluding to my husband Josh. This happened even when Josh said repeatedly that I had come up with the idea. It was at that moment that I realized that most people would not associate me with the idea or company I co-founded.</p>\n<p>I had to make the conscious choice to decide if I wanted to be right or be successful. I chose to focus on success and also I didnâ€™t get here alone. Many wonderful men and women helped. I had to laser focus on my goal which was to provide the best hosting experience regardless of minor annoyances along the way.</p>\n<p>Many times I was not invited to join various non-Pagely meetings. Josh tried to include me even when men told him to uninvite me. Luckily, when I wasnâ€™t allowed in the room, Josh shared the agenda with me and many times was my voice to get things done. Now, if Iâ€™m not included, I find a table that will have me, find allies, or I create my own group. I shouldnâ€™t have made getting in that room a big priority. My solution was to remove obstacles, find the win/win to achieve my goal, and not take or make it personal.</p>\n<p>This type of scenario happened often and whatâ€™s interesting is that the people that were saying these â€œsexistâ€ remarks were good people. The problem was so prevalent and complex that I had a hard time communicating what I was experiencing.</p>\n<h3>Reaching Out</h3>\n<p>I asked other women how they handled sexism. I asked a brilliant and well respected female entrepreneur in Phoenix how she handled what I was experiencing. She told me that she saw it all the time and just treated men like her children and gave accolades. She was included because she could stroke their egos. Another friend said that she would wear short skirts so she wouldnâ€™t have to explain and defend why her ideas deserved merit. Another friend would wear business attire daily while her male cohorts wore hoodies. Her brain didnâ€™t change but their outlook did. There were also some that claimed that they didnâ€™t experience it but when the #metoo movement arrived, they were the most vocal. Of course, this is an extremely small subset of people I asked but this was the reality of the time.</p>\n<p>Whatâ€™s striking is that my experience in other fields was worse. At least in tech weâ€™re open to talk about and acknowledge the issue. Itâ€™s a start, itâ€™s getting better, and tech attracts early adopters. When I was in healthcare, I graduated college with summa cum laude honors. I had the highest board scores in the state for my field, yet one employer told me I was only hired because I was pretty, another place said that they prefer to hire Mexicans because they work harder, and another place claimed that they like to hire females that didnâ€™t plan on having children.</p>\n<p>So many check marks to obtain which can cause females to compete with each other because of a feeling of lack of abundance and no defined rules.</p>\n<p>These learnings from the places I worked happened over a period of time and some of my friends experienced sexism and abuse weekly. They were used to being treated poorly and considered less than. They accepted the situation and were grateful for the opportunity to work. Some were afraid to have or share their brilliant ideas because their paycheck was more important than their voice. Also, some were content and had other areas of their life that fulfilled them or they were ultra-resistant. The vast differences we have with one another are amazing, beautiful, and inspiring.</p>\n<h3>Representation or Tokenization?</h3>\n<p>I still have mixed feelings about being the token female. I was asked to speak on a SXSW panel a couple of times because I was the only tech female the person knew. Iâ€™m trying to get comfortable using my gender to get through the guarded gates but I canâ€™t tell if Iâ€™m fostering inspiration, adding to the separation, or devaluing my accomplishments. Therefore I tend to stay private and stay focused on creating my ideal work environment that waterfalls over into giving the best hosting experience for our clients. Also, when I ask other women to speak at Pressnomics or work with me at Pagely, I donâ€™t want it to be because Iâ€™m trying to hit a quota.</p>\n<p>I choose to work with women because they are qualified. Our engineering team is 50% female and our largest teams are run by women because they were the most qualified candidates. Period. (pun intended). What makes this even more gratifying for me is that the entire team participates in the hiring process and it feels like we have an environment for equality that is natural due to the character of the people we hire.</p>\n<p>However, we have hired men and learned that they are triggered by assertive females. My solutions in these instances include making sure they realize the issue, whatâ€™s at stake if they donâ€™t change, and I leave my door open to conversation. They are still good people. They chose to have a female employer. My general causation theory is the stigma around therapy especially for men, lack of resources to provide a public mental health safety net, repressed feeling of childhood powerlessness from a female, and myriad other possibilities.</p>\n<p>The flip side to this is aggressive females which also afflicts me at certain times. My progression to aggression looks something like the following. I start with casual understanding, then I ask questions for full understanding. Then I assert, re-evaluate, assert or accept. If I don&#8217;t accept, I assert again. If my assertions don&#8217;t work, aggression can happen followed by reflection. This may lead to a desire to remove the obstacle and find another solution or evaluate the origin of my aggression. This doesn&#8217;t happen often. I&#8217;ve learned that I&#8217;m triggered by feeling unseen or unreciprocated respect when I have a strong desire for an outcome that seems heavily challenged.Â  I accept these feelings and understand that I&#8217;m not always right. The awareness allows me to seek clarity, speak up with vulnerability, heal, and choose a healthier approach that humanizes the relationship.</p>\n<p>My ideal solution is to remind myself that everyone has a story, listen to their story, find clarity, and let them know they are safe and donâ€™t need to carry the trauma anymore. Open communication with mutual respect is key. You get what you give. Also, burning bridges serves no one and neither does passively laying on train tracks.</p>\n<h3>Observation</h3>\n<p>Another one of my theories is that women are considered safe. During our Pressnomics conference, Josh will receive more praise and while I do get praise, I tend to get more (or all) of the criticism. This is not about getting praise; although appreciated, itâ€™s not the point. Itâ€™s about why people feel more comfortable expressing negative emotions to females. I believe the reason why is because women seem safer and they are more likely to ask about experiences.</p>\n<p>Unfortunately, this can open a floodgate from people with varying levels of passion which can cause female entrepreneurs to retreat from taking more active roles. I crave feedback for Pagely because itâ€™s something we want to give to the world. However, Pressnomics is an invitation into my proverbial house and if they donâ€™t like it, thereâ€™s a lot of other conferences they can attend or make their own. Iâ€™ll gladly attend their conference, especially if itâ€™s run by another â€œmarginalizedâ€ human and aligns with my goal. I will listen to people who â€œget&#8221; what Pressnomics is (itâ€™s more of a feeling) but nitpicking my font and color choice for the website is where I draw the line.</p>\n<p>I had to get to this place because people were not going to decide my worth or determine if my creations were good enough. When I create, I come from love and a deep desire to help with the golden rule in mind. Iâ€™ve been to other conferences, where Josh leaves my side and men have said â€œIâ€™m creating a Pagely killerâ€, â€œWeâ€™re going to destroy youâ€, and competitors that are actively trying to debate with me while my only intention was to be kind.</p>\n<p>My goal with Pressnomics is to inspire great minds to work together, share information, and energize the WordPress ecosystem in a safe and caring atmosphere for all who attend.</p>\n<p>My ideal solution when dealing with negative people is to not take it personally. Their truth does not need to be my truth and words from jerks no longer have an affect on me. Sadly, most jerks delve out disdain regardless of the recipient which means they might be miserable and lack empathy.</p>\n<h3>Wrapping It All Up</h3>\n<p>What does WordPress mean to me? Itâ€™s a business foundation that allows ALL people the initial building blocks for success. The barrier to entry is low and inclusion is high. Also, the majority of people in the community look past stereotypes and generalizations and want to share and lift all tides. I am very grateful to the community, our supporters, the dreamers, and to the outstanding core contributors.</p>\n<p>What do all of us â€œmarginalizedâ€ people have in common? We showed up and worked around obstacles. If thereâ€™s not room for you at a table, figure out something else. Perhaps, kindly discuss the observation, or create your own table. Lifeâ€™s too short to be unhappy in someone elseâ€™s world. Create your own and invite others. WordPress is a great place to do that.</p>\n<p>Last, being underestimated is a gift. Theyâ€™ll never see you coming until they canâ€™t help but notice. If youâ€™re with the right people while thatâ€™s happening, thereâ€™s no better feeling.</p>\n<p>The post <a rel=\"nofollow\" href=\"https://heropress.com/essays/marginalized/\">Marginalized</a> appeared first on <a rel=\"nofollow\" href=\"https://heropress.com\">HeroPress</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 16 Dec 2020 10:02:40 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sally Strebel\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:39;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"WPTavern: Learn WordPress Platform Launches with Free Courses, Workshops, and Lesson Plans\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=108957\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:221:\"https://wptavern.com/learn-wordpress-platform-launches-with-free-courses-workshops-and-lesson-plans?utm_source=rss&utm_medium=rss&utm_campaign=learn-wordpress-platform-launches-with-free-courses-workshops-and-lesson-plans\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3567:\"<p>WordPress.org has officially launched its new &ldquo;<a href=\"https://learn.wordpress.org/\">Learn WordPress</a>&rdquo; platform, a free educational resource that includes courses, workshops, quizzes, lesson plans, and discussion groups. The material spans the spectrum of WordPress experience from beginners to advanced, and and allows users to learn asynchronously at their own pace. After a successful beta launch in August, the platform is now ready for the public.</p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>Traditionally, most WordPress learning opportunities have been in-person at WordCamps and local meetups. Since large gatherings have been put on pause this year due to the pandemic, the Learn WordPress platform offers a new way for users to stay connected. The discussion groups are a new event format similar to a virtual event that brings learners together at the same time to discuss a topic. Discussion groups are scheduled through Meetup.com and most of them center around workshop material.</p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>&ldquo;In addition to the wealth of valuable content available on Learn WordPress, the platform provides an opportunity for individuals to learn alongside other community members and become connected with a global network of WordPress users, developers, and contributors,&rdquo; WordPress community manager Hugh Lashbrooke said. </p>\n\n\n\n<h3>A New Way to Contribute to WordPress: Create Learning Resources and Facilitate Discussions</h3>\n\n\n\n<p>Learn WordPress is launching with two courses: &ldquo;<a href=\"https://learn.wordpress.org/course/publishing-with-wordpress/\">Publishing with WordPress</a>&rdquo; and &ldquo;<a href=\"https://learn.wordpress.org/course/unleashing-the-power-of-wordpress/\">Unleashing the Power of WordPress</a>,&rdquo; which covers basic customization topics. The project is open to contributions and anyone can <a href=\"https://learn.wordpress.org/workshop-presenter-application/\">submit an idea for a workshop</a>.</p>\n\n\n\n<p>The platform also includes more than 85 <a href=\"https://learn.wordpress.org/lesson-plans/\">lesson plans</a> that the Training team has been working on for the past few years. They are available as resources for people who want to run their own workshops. </p>\n\n\n\n<p>Learn WordPress has several lesson plans and workshops on the topic of creating new blocks, such as <a href=\"https://learn.wordpress.org/workshop/intro-to-gutenberg-block-development/\">Intro to Gutenberg Block Development</a>. Many WordPress developers have yet to get on board with creating for the block editor and topics like this seems ripe for launching a discussion group with a series facilitated by an experienced block developer.</p>\n\n\n\n<p>&ldquo;The work on Learn WordPress has been a strong cross-team collaboration between the Community and Training teams, with the Marketing and TV teams also being really involved in making things happen,&rdquo; WordPress community manager Hugh Lashbrooke said. &ldquo;It&rsquo;s been super encouraging to see such excellent work across so many teams to make this ambitious project a reality.&rdquo;</p>\n\n\n\n<p>Anyone can <a href=\"https://learn.wordpress.org/contribute/\">contribute</a> to lesson plans and workshops, as well as facilitate discussions. If you want to get more involved in expanding and promoting the platform, you can join <a href=\"https://make.wordpress.org/training/\">WordPress&rsquo; Training team</a> for meetings on Fridays at 11:00 UTC and Tuesdays at 17:00 UTC in the #training channel on Slack.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 15 Dec 2020 23:30:18 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:40;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:73:\"WPTavern: Record and Track Past Events With the LifePress Calendar Plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=108962\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:191:\"https://wptavern.com/record-and-track-past-events-with-the-lifepress-calendar-plugin?utm_source=rss&utm_medium=rss&utm_campaign=record-and-track-past-events-with-the-lifepress-calendar-plugin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:4784:\"<p class=\"has-drop-cap\">Two weeks ago, Ashan Jay released <a href=\"https://wordpress.org/plugins/lifepress/\">LifePress</a> to the WordPress plugin directory. It is an interactive, front-end calendar for tracking past events &mdash; a journal of sorts. For a version 1.0 launch, it has enough features with just the right touch of simplicity to show promise.</p>\n\n\n\n<p>This is not Jay&rsquo;s first rodeo when it comes to calendar-based plugins. He is also the creator of <a href=\"https://www.myeventon.com/\">EventON</a>, a virtual event calendar for WordPress.</p>\n\n\n\n<p>The goal of the plugin is simple. As its description reads, &ldquo;LifePress is a calendar based journal recorder that will allow you to track back progress and review past events to learn from the past and make positive progress in the future.&rdquo;</p>\n\n\n\n<p>Watch an introduction video to the plugin:</p>\n\n\n\n<div class=\"wp-block-embed__wrapper\">\n\n</div>\n\n\n\n<h2>Digging Into the Plugin</h2>\n\n\n\n<p class=\"has-drop-cap\">Call me a fan. The ease of use of this plugin is spot-on. LifePress creates a page called &ldquo;LifePress Dashboard&rdquo; upon activation, which allows individual users of the site to see and manage life events on the front end on a per-user basis. It feels much like Google Calendar, except in WordPress.</p>\n\n\n\n<p>And that is the plugin&rsquo;s main selling point &mdash; it allows end-users to store all of their data in their own database instead of on a third-party server.</p>\n\n\n\n<p>On the front end, users are presented with a weekly calendar view by default. However, there is a button for switching between weekly and monthly views.</p>\n\n\n\n<img />Monthly calendar view.\n\n\n\n<p>A simple &ldquo;+&rdquo; button lets users create new calendar entries. After clicking it, an overlay appears for adding a date, title, optional description, and tag. Most users should pick up the system quickly and without documentation.</p>\n\n\n\n<img />Creating a new calendar entry.\n\n\n\n<p>The tag system allows users to group different types of entries with custom colored backgrounds. Colored dots for each tag adorn the left sidebar, allowing users to toggle specific entry types on and off, which is one of my favorite features of the plugin. It is a simple thing, but it adds to the overall user experience.</p>\n\n\n\n<p>The design is, for the most part, great. The interface is uncluttered and simple to use. However, the plugin is not without some flaws, which is to be expected with a version 1.0. The plugin&rsquo;s various overlays, such as from the new-entry popup, butt against the top of the page. Some spacing at the top would help with the layout.</p>\n\n\n\n<p>Backend management could use a little work. There is no way to edit a tag&rsquo;s color after it has been created. This feature also does not appear to be available on the front end.</p>\n\n\n\n<p>The monthly-calendar view was consistently off by one day of the week when I first installed LifePress in my testing environment. For example, today is Tuesday, December 15, 2020. However, the plugin had the 15th listed under Monday. I managed to track this issue down to the &ldquo;week starts on&rdquo; setting in WordPress. The plugin will only work if this option is set to Sunday (the WordPress default sets this to Monday). Every other day of the week pushes the calendar back another day.</p>\n\n\n\n<p>This is a non-issue with the default, weekly calendar view. However, it should be addressed by the plugin author for the monthly layout.</p>\n\n\n\n<h2>Features Requests</h2>\n\n\n\n<p class=\"has-drop-cap\">While LifePress is geared toward being a journal and tracking calendar, it would be nice if it could pull double-duty and behave like a simple event calendar too. The plugin already allows end-users to add items to future dates, so the core of scheduling events is already in place. To extend this already-existing feature, the plugin could have a notification system. Users should be able to at least get custom emails as a reminder for upcoming events on the schedule. This could make it worthwhile enough for some users to ditch Google Calendar, depending on their use case.</p>\n\n\n\n<p>If the plugin wants to continue focusing on being a great journal and tracking calendar, it should have a progress-tracking mechanism built in. It is great to see that I put in my daily 30-minute jog on the calendar, for example. However, it would be even better if I could see that I am hitting my exercise goals on a weekly, monthly, or yearly basis.</p>\n\n\n\n<p>That sort of application is not just relevant to personal exercise regimens. It can be applied to other facets of life or used in business environments.</p>\n\n\n\n<p>Overall, it is a good first outing for the plugin. However, there is a lot of potential for more features in the future.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 15 Dec 2020 21:48:53 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:41;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"WordPress.org blog: Introducing Learn WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:34:\"https://wordpress.org/news/?p=9444\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"https://wordpress.org/news/2020/12/introducing-learn-wordpress/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:9012:\"<p><strong><a href=\"https://learn.wordpress.org/\">Learn WordPress</a> is a learning resource providing workshops, quizzes, courses, lesson plans, and discussion groups so that anyone, from beginners to advanced users, can learn to do more with WordPress. Learning how to use, build for, and contribute to WordPress is essential for anyone wanting to dive deeper into the software and its community.&nbsp;</strong></p>\n\n\n\n<div class=\"wp-block-buttons aligncenter\">\n<div class=\"wp-block-button is-style-outline\"><a class=\"wp-block-button__link\" href=\"https://learn.wordpress.org/\">Learn WordPress</a></div>\n</div>\n\n\n\n<p>This cross-team initiative is part of the WordPress.org network and features content from contributors from the global community. It will be updated weekly and will help connect new and existing WordPress users with the broader community while they learn.</p>\n\n\n\n<img width=\"632\" height=\"331\" src=\"https://i1.wp.com/wordpress.org/news/files/2020/12/learn-link-preview.png?resize=632%2C331&ssl=1\" alt=\"\" class=\"wp-image-9457\" />\n\n\n\n<h2>What can you learn about WordPress?</h2>\n\n\n\n<p>On Learn WordPress you can find a range of material and opportunities to use at the time which works for you.</p>\n\n\n\n<p><a href=\"https://learn.wordpress.org/workshops/\"><strong>Workshops</strong></a> are practical, skills-based videos that show viewers how to do new things with WordPress, whether you publish, manage, develop with, or contribute to WordPress. Most workshops include quizzes for you to test your newly gained knowledge.</p>\n\n\n\n<p><a href=\"https://learn.wordpress.org/discussion-groups/\"><strong>Discussion groups</strong></a> provide an opportunity for further collaborative learning with participants meeting together to discuss the workshop content &#8211; they take place online, either in video calls or Slack and accommodate all time zones.</p>\n\n\n\n<p><a href=\"https://learn.wordpress.org/lesson-plans/\"><strong>Lesson plans</strong></a> are guides for facilitators to use while presenting at events or within educational environments. Facilitators will find learning objectives (telling people what they are going to learn), any prerequisite skills, assets such as screenshots and slide decks, and learning assessments.&nbsp;</p>\n\n\n\n<p><a href=\"https://learn.wordpress.org/courses/\"><strong>Courses</strong></a> are a series of interconnected lesson plans to be presented by a facilitator that will strategically focus on defined learning outcomes. Participants can go through these courses individually or as part of a group. After completing the learning, attendees should be able to apply their skills in the real world.</p>\n\n\n\n<p>In addition to the wealth of valuable content available on Learn WordPress, the platform provides an opportunity for individuals to learn alongside other community members and become connected with a global network of WordPress users, developers, and contributors.</p>\n\n\n\n<div class=\"wp-block-embed__wrapper\">\n\n</div>\n\n\n\n<p><a href=\"https://www.youtube.com/playlist?list=PLCVEqsAbLffeEXhn9T1yBVTMaHIMtlzFj\">Why you should use Learn WordPress</a> &#8211; videos from our community.</p>\n\n\n\n<h2>How can you get involved?</h2>\n\n\n\n<div class=\"wp-block-buttons aligncenter\">\n<div class=\"wp-block-button is-style-outline\"><a class=\"wp-block-button__link\" href=\"https://learn.wordpress.org/\">Start learning today!</a></div>\n</div>\n\n\n\n<p>Learn WordPress is an open-source platform available for anyone to contribute content in any areas mentioned above. <a href=\"https://learn.wordpress.org/contribute/\">Find out more about how you can get involved</a> with this initiative.</p>\n\n\n\n<p><a href=\"https://make.wordpress.org/marketing/2020/12/09/help-us-promote-learn-wordpress/\">Take part in our fun promotion campaigns</a> on social and with your local community.</p>\n\n\n\n<p><em>Hundreds of people spanning a number of years have contributed to the development of learning materials. Thanks to everyone who worked so hard to make Learn WordPress a reality.&nbsp;</em></p>\n\n\n\n<p><strong><em>Particular thanks to</em></strong>:</p>\n\n\n\n<p><strong><em>Training:</em></strong><em> <a href=\"https://profiles.wordpress.org/courane01/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>courane01</a>, <a href=\"https://profiles.wordpress.org/azhiyadev/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>azhiyadev</a>, <a href=\"https://profiles.wordpress.org/geheren/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>geheren</a>, <a href=\"https://profiles.wordpress.org/webtechpooja/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>webtechpooja</a>, <a href=\"https://profiles.wordpress.org/jessecowens/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>jessecowens</a>, <a href=\"https://profiles.wordpress.org/onealtr/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>onealtr</a>, <a href=\"https://profiles.wordpress.org/rastaban/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>rastaban</a>, <a href=\"https://profiles.wordpress.org/evarlese/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>evarlese</a>, <a href=\"https://profiles.wordpress.org/manzwebdesigns/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>manzwebdesigns</a></em><br /><strong><em>Meta: </em></strong><em><a href=\"https://profiles.wordpress.org/coreymckrill/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>coreymckrill</a>, <a href=\"https://profiles.wordpress.org/dufresnesteven/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>dufresnesteven</a>, <em><a href=\"https://profiles.wordpress.org/jonoaldersonwp/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>jonoaldersonwp</a></em></em><br /><strong><em>Community:</em></strong><em> <a href=\"https://profiles.wordpress.org/hlashbrooke/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>hlashbrooke</a>, <a href=\"https://profiles.wordpress.org/camikaos/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>camikaos</a>, <a href=\"https://profiles.wordpress.org/harishanker/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>harishanker</a>, <a href=\"https://profiles.wordpress.org/angelasjin/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>angelasjin</a>, <a href=\"https://profiles.wordpress.org/nao/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>nao</a>, <a href=\"https://profiles.wordpress.org/courtneypk/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>courtneypk</a>, <a href=\"https://profiles.wordpress.org/andreamiddleton/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>andreamiddleton</a>, <a href=\"https://profiles.wordpress.org/rmarks/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>rmarks</a>, <a href=\"https://profiles.wordpress.org/sippis/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>sippis</a></em><br /><strong><em>Marketing: </em></strong><em><a href=\"https://profiles.wordpress.org/webcommsat/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>webcommsat</a>,Â  <a href=\"https://profiles.wordpress.org/oglekler/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>oglekler</a>, <a href=\"https://profiles.wordpress.org/lmurillom/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>lmurillom</a>, <a href=\"https://profiles.wordpress.org/yvettesonneveld/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>yvettesonneveld</a>, <a href=\"https://profiles.wordpress.org/meher/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>meher</a>, <a href=\"https://profiles.wordpress.org/nalininonstopnewsuk/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>nalininonstopnewsuk</a>, <a href=\"https://profiles.wordpress.org/megphillips91/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>megphillips91</a>, <a href=\"https://profiles.wordpress.org/marks99/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>marks99</a>, <em><a href=\"https://profiles.wordpress.org/marybaum/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>marybaum</a></em></em>, <em><a href=\"https://profiles.wordpress.org/antialiasfactory/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>antialiasfactory</a>, <a href=\"https://profiles.wordpress.org/herculespekkas/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>herculespekkas</a>, <a href=\"https://profiles.wordpress.org/chaion07/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>chaion07</a></em><br /><strong><em>Design:</em></strong><em> <a href=\"https://profiles.wordpress.org/melchoyce/\" class=\"mention\"><span class=\"mentions-prefix\">@</span>melchoyce</a>Â </em></p>\n\n\n\n<p><em>For a fuller list of the contributors who have been involved in training and Learn WordPress, visit <a href=\"https://make.wordpress.org/community/2020/08/12/learn-wordpress-is-live/\">the initial beta launch post</a>. Thanks to everyone who has been involved to date and will be in the future.&nbsp;</em></p>\n\n\n\n<p><a href=\"https://learn.wordpress.org/tag/learnwordpress\">#LearnWordPress</a> <a href=\"https://learn.wordpress.org/tag/learnwp\">#LearnWP</a></p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 15 Dec 2020 13:00:00 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:15:\"Hugh Lashbrooke\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:42;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"WPTavern: Fast Brings One-Click Checkout to WooCommerce Stores\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=108895\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:169:\"https://wptavern.com/fast-brings-one-click-checkout-to-woocommerce-stores?utm_source=rss&utm_medium=rss&utm_campaign=fast-brings-one-click-checkout-to-woocommerce-stores\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:7203:\"<p><a href=\"https://www.fast.co/\">Fast</a>, a startup backed by Stripe, has just added <a href=\"https://www.fast.co/woocommerce\">WooCommerce support</a> to its new <a href=\"https://www.fast.co/checkout\">Fast Checkout</a> experience. The company was co-founded in March 2019, by Domm Holland and Allison Barr Allen, with investment from Stripe, Index Ventures, Susa Ventures, and Global Founders Capital. It has received <a href=\"https://www.crunchbase.com/organization/byepass/company_financials\">$22.5M</a> in funding to reduce the friction that remains deeply embedded in login and checkout experiences.</p>\n\n\n\n<p>Online shopping almost always involves a lengthy checkout form where customers have to enter passwords, addresses, and payment information nearly every time. This tedious experience is magnified when gift-giving holidays roll around. Fast&rsquo;s founders have set out to solve this problem with products aimed at modernizing the checkout experience to enable one-click purchasing.</p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>Fast Checkout launched in September 2020, so if you haven&rsquo;t seen it around yet it&rsquo;s because it is relatively new and was previously limited to a handful of platforms. Expanding support to WooCommerce was a strategic move, as WordPress accounts for&nbsp;<a href=\"https://w3techs.com/technologies/details/cm-wordpress\">39.3%</a>&nbsp;of the Alexa top 10 million websites. WooCommerce is running on 18% of the WordPress sites W3techs can detect. Fast CEO Domm Holland said the product&rsquo;s availability to WooCommerce increases the company&rsquo;s addressable market by over 2,500%.</p>\n\n\n\n<div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"twitter-tweet\"><p lang=\"en\" dir=\"ltr\">from today, every single <a href=\"https://twitter.com/WooCommerce?ref_src=twsrc%5Etfw\">@WooCommerce</a> store can now install 1-click checkout in minutes, so their customers can checkout in seconds &#128640;<br /><br />compared to yesterday, that increases <a href=\"https://twitter.com/fast?ref_src=twsrc%5Etfw\">@fast</a>\' addressable market by over 2,500% <a href=\"https://t.co/wrqkUnAQVw\">pic.twitter.com/wrqkUnAQVw</a></p>&mdash; domm (@domm) <a href=\"https://twitter.com/domm/status/1338493885245345793?ref_src=twsrc%5Etfw\">December 14, 2020</a></blockquote>\n</div>\n\n\n\n<p>&ldquo;We&rsquo;ve received inquiries from thousands of sellers asking to add Fast on a variety of e-commerce platforms, including WooCommerce sellers,&rdquo;  Fast CCO Jason Alderman said. &ldquo;We prioritized WooCommerce as it automatically gives millions of new sellers access to Fast.&rdquo; </p>\n\n\n\n<p>The company has seen a strong uptick in Fast Login adoption since launch, and Fast Checkout has had a promising debut. </p>\n\n\n\n<p>&ldquo;For Fast Checkout, the value of merchandise purchased on the platform has more than tripled each month since launching in September,&rdquo; Alderman said. &ldquo;Although not WooCommerce sellers, Fast merchants such as Gerard and Hardwood Lumber are seeing up to 30% (and rising) adoption rates since deploying Fast Checkout and up to a 10% increase in order volume within just 30 days of implementation.&rdquo;</p>\n\n\n\n<p>In order to gain all the benefits of Fast login and checkout, users have to sign up with a new service, which seems like it would be hurdle. Fast has embedded this process within the normal checkout flow so that it doesn&rsquo;t feel like the consumer has to sign up for something new. The first time a shopper makes a purchase on a site using Fast Checkout, they enter their contact information. and payment details as they normally would. </p>\n\n\n\n<div class=\"wp-block-image\"><img />Fast Checkout form on mobile for first time checkout </div>\n\n\n\n<p>After that purchase, their details are stored and every subsequent checkout experience on any website using Fast Checkout will only require one click. It works regardless of the device or browser used and does not require a password, the same as the Fast Login product.</p>\n\n\n\n<div class=\"wp-block-image\"><img />Fast Checkout on mobile purchase complete</div>\n\n\n\n<p>Although Fast Checkout and Login are free to use for buyers, getting store owners on board is going to be the primary challenge for Fast. It charges US sellers <a href=\"https://www.fast.co/pricing\">2.9% +&nbsp;30c per transaction</a>. Fast&rsquo;s fees are not quite as steep as the 5% per shipment that Instagram will be charging for the <a href=\"https://wptavern.com/woocommerce-tests-new-instagram-shopping-checkout-feature-now-in-closed-beta\">new Shopping Checkout feature that WooCommerce is testing</a>.  However, it may still be prohibitive for stores with narrow profit margins. Fast also has competition from the multiple one-click checkout extensions available for WooCommerce that do not charge transaction fees. </p>\n\n\n\n<p>Fast claims that the one-click checkout button &ldquo;increases conversion, boosts sales, and delights customers&rdquo; If the checkout experience can deliver on those claims, then some store owners may be willing to part with the 2.9% fee in order to capture a larger percentage of the potential customers that are already arriving at their stores, instead of risking cart abandonment with a frustratingly long checkout process. Store owners are looking for any edge in an increasingly competitive landscape where the online retail giants continue to dominate.</p>\n\n\n\n<p>The pandemic has caused <a href=\"https://wptavern.com/tectonic-shifts-in-retail-industry-are-creating-unprecedented-opportunities-for-independent-stores\">radical shifts in the retail industry</a>, creating unprecedented opportunities for independent stores. Many WooCommerce developers and store owners have sought help for optimizing their stores after the pandemic caused business to increase exponentially overnight. A product like Fast Checkout is landing at the right time, as consumer spending habits have become forever altered by the rapid acceleration of the essential role of e-commerce for homebound people across the globe.</p>\n\n\n\n<p>&ldquo;E-commerce giants have heightened consumers&rsquo; expectations for online shopping,&rdquo; Alderman said. &ldquo;And with the COVID-19 pandemic this year, more people than ever opted to shop online, but many independent businesses were not prepared to prioritize the online experience. By adding Fast Checkout to their stores, businesses of all sizes can access one-click checkout that offers the seamless experience consumers expect (and eliminates shopping cart abandonment that happens to up to <a rel=\"noreferrer noopener\" href=\"https://www.barilliance.com/cart-abandonment-rate-statistics/\" target=\"_blank\">80% of potential purchases</a>).&rdquo;</p>\n\n\n\n<p>Fast is planning to expand its Checkout support to multiple new platforms in the coming months but did not have any details to share at this time. In addition to providing one-click checkout, Fast centralizes purchases across stores so that users can manage transactions, track shipments, and handle returns through a unified dashboard. Long term, the company is working on launching a universal subscription manager, which Alderman said is currently in development. </p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 15 Dec 2020 06:18:37 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:43;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:75:\"WPTavern: G2 Components, a From-Scratch Reimagining of WordPress Components\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=108342\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:193:\"https://wptavern.com/g2-components-a-from-scratch-reimagining-of-wordpress-components?utm_source=rss&utm_medium=rss&utm_campaign=g2-components-a-from-scratch-reimagining-of-wordpress-components\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:7356:\"<p>Update <em>some</em> of the things.</p>\n\n\n\n<p>That was the goal that Jon Quach, a Principal Designer at Automattic, laid out in the <a href=\"https://g2components.wordpress.com/2020/11/02/the-path-to-integration/\">roadmap for integrating the G2 Components project</a> into Gutenberg and, eventually, core WordPress. The project is a reimagining of the pieces that make the block editor, a &ldquo;from-scratch&rdquo; overhaul of the component system. Updating <em>all of the things</em> or even <em>many of the things</em> at once runs the risk of breaking everything.</p>\n\n\n\n<p>&ldquo;Ideally, what should happen is you should update just some of the things in a very controlled and intentional manner,&rdquo; wrote Quach in the post. He likened it transitioning a city, section by section, to solar power until the traditional power factory could be shut down. You convert one piece, test, find problems, and correct them before moving to the next section.</p>\n\n\n\n<p>That is the plan for integrating <a href=\"https://github.com/itsjonq/g2\">G2 Components</a> into Gutenberg.</p>\n\n\n\n<p>&ldquo;G2 Components is a project that embodies the idea of making user interfaces and user experiences better for others,&rdquo; said Quach. &ldquo;At the moment, it&rsquo;s materialized as a Component System designed to work within the context and environments of Gutenberg and WordPress.&rdquo;</p>\n\n\n\n<p>The goal is to provide the resources to improve the Gutenberg project&rsquo;s UI. Components should make it easier to create newer UIs without hacking together code. Quach said the consistency and experiences of the Component System should scale and have a ripple effect throughout the WordPress platform. This will also extend to third-party block developers.</p>\n\n\n\n<p>&ldquo;The code components are just the starting point,&rdquo; he said. &ldquo;My ultimate goal is for this to transcend code and influence and elevate design as well &mdash; creating a unified Design System that enables and empowers folks to craft cohesive and feature-rich UI experiences within the world of WordPress.&rdquo;</p>\n\n\n\n<p>Quach believes that platforms have benefited from having similar approaches. He mentioned Material Design by Google as having elevated the Android platform and bringing cohesion across the company&rsquo;s products.</p>\n\n\n\n<p>The Gutenberg team has already started integrating the G2 Components into the project. This integration replaces WordPress components (<a href=\"https://developer.wordpress.org/block-editor/packages/packages-components/\">@wordpress/components</a>) in a controlled manner that should not break existing implementations within the core editor or third-party projects. New components will be swapped in as they become ready. &ldquo;Like flipping on a switch,&rdquo; said Quach.</p>\n\n\n\n<p>The following video is an hour-long walkthrough of G2 Components that Quach posted on YouTube:</p>\n\n\n\n<div class=\"wp-block-embed__wrapper\">\n\n</div>\n\n\n\n<p>He routinely posts updates on the <a href=\"https://g2components.wordpress.com/\">G2 Components blog</a>. Alongside those are deeper dives into his design thinking on the project. He also talks about the project on his <a href=\"https://www.twitch.tv/itsjonq\">Twitch stream</a> almost daily.</p>\n\n\n\n<h2>What Are Components?</h2>\n\n\n\n<img />Screenshot of a component in the <a href=\"https://g2-components.xyz/\">G2 Components Storybook</a>.\n\n\n\n<p class=\"has-drop-cap\">Components are everything from buttons to toggles to checkboxes. They are standardized pieces that make up the UI of the block editor. They are available for both core and third-party developers to create what end-users see and interact with. However, there was a problem with how the original component system was built.</p>\n\n\n\n<p>&ldquo;The current components aren&rsquo;t built with a system in mind, but rather, to fulfill an immediate need,&rdquo; said Quach. &ldquo;This particular design detail is crucial. A systems-first approach more easily supports the addition of new features, and more importantly, customization!&rdquo;</p>\n\n\n\n<p>The new approach is about building a native design system for WordPress. Such a system would allow anyone to build on top of it and create native experiences.</p>\n\n\n\n<p>Quach said one of the easiest ways to look at this is from a backend theming perspective &mdash; the Component System also has a theming sub-system. &ldquo;Instead of the traditional method of writing CSS as a &lsquo;skin&rsquo; to layer on top, UI aesthetics can be adjusted through configuration values &mdash; similar to how WordPress can be configured with definitions in the <code>wp-config.php</code> file,&rdquo; he said. &ldquo;This distinction is important as these values tap directly into the Style system, allowing the styles to load correctly at the right place and at the right time. All without affecting the current environment&rsquo;s styles, and more importantly, not being affected by the current environment&rsquo;s styles.&rdquo;</p>\n\n\n\n<p>He was responding to my question on why the component system should be rebuilt from scratch. The idea is to have components that &ldquo;just work&rdquo; in an environment such as the WordPress admin, such as making sure the existence of a WordPress theme&rsquo;s stylesheet does not break components simply by being loaded.</p>\n\n\n\n<p>&ldquo;Why rethink, rebuild, and enhance Inputs, Buttons, Modals, Dropdowns, and others?&rdquo; countered Quach in response. &ldquo;So that you the developer don&rsquo;t have to.&rdquo;</p>\n\n\n\n<h2>What Does This Mean For Developers?</h2>\n\n\n\n<img />\n\n\n\n<p class=\"has-drop-cap\">Respecting backward-compatibility is something Quach said he took incredibly seriously when designing the architecture of the G2 Components project. He also said it was a part of the integration strategy he proposed.</p>\n\n\n\n<p>&ldquo;I had mentioned that this project &rsquo;embodies the idea of making user interfaces and user experiences better for others,\'&rdquo; he said. &ldquo;Accounting for backward compatibility and supporting third-party migration absolutely falls under the category of user experience.&rdquo;</p>\n\n\n\n<p>As the Gutenberg team continues integrating new components, it should not change what developers have already been doing. However, it could open up some new possibilities.</p>\n\n\n\n<p>&ldquo;The new Component System will definitely help in the UI department,&rdquo; said Quach. &ldquo;One area I&rsquo;m particularly excited about is the rapid-development/prototyping space. Because these Components are self-contained units, they can be brought into platforms like <a href=\"https://codesandbox.io/\">CodeSandbox</a> and they&hellip;just&hellip;work. You can hit the ground running and rapidly construct and share prototypes (ranging from tiny-yet-mighty to large and in-charge).&rdquo;</p>\n\n\n\n<p>He said he has had success in testing component designs and demonstrating ideas for quick feedback. He has also worked from the opposite direction, building complex components in CodeSandbox and bringing them back into the Component System.</p>\n\n\n\n<p>&ldquo;As a designer and front-end developer, I cannot stress how efficient, effective, and creatively liberating this &lsquo;micro building&rsquo; workflow is,&rdquo; he said. &ldquo;It&rsquo;s something I&rsquo;m excited for others to experience as well.&rdquo;</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 14 Dec 2020 21:10:46 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:44;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:99:\"WPTavern: BuddyPress 7.0.0 Adds 3 New Blocks and Admin Screens for Member and Group Type Management\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=108753\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:239:\"https://wptavern.com/buddypress-7-0-adds-3-new-blocks-and-admin-screens-for-member-and-group-type-management?utm_source=rss&utm_medium=rss&utm_campaign=buddypress-7-0-adds-3-new-blocks-and-admin-screens-for-member-and-group-type-management\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3149:\"<p>BuddyPress <a href=\"https://buddypress.org/2020/12/buddypress-7-0-0-filippi/\">7.0.0</a> &ldquo;Filippi&rdquo; was released this week, following <a href=\"https://wptavern.com/wordpress-5-6-simone-includes-new-twenty-twenty-one-theme-and-improved-editor\">WordPress 5.6</a> to ensure compatibility. This version was named for&nbsp;<a rel=\"noreferrer noopener\" href=\"https://realcheesepizza.com/\" target=\"_blank\">Filippi&rsquo;s Pizza Grotto</a>&nbsp;in California. It <a href=\"https://bpdevel.wordpress.com/2020/07/05/wordpress-required-version-update-2/\">requires WordPress 4.9+</a>, but sites that are not using the block editor will miss out on many of the new features that make BuddyPress websites easier to customize.</p>\n\n\n\n<p>The first set of community blocks was introduced earlier this year, allowing site owners to insert a specific Member or Group into any post or page. Version 7.0.0 adds three new blocks that make it easy to feature a list of members, a list of groups, or embed a public activity post.</p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>Blocks make customizations easier for non-technical community managers. Years ago, you would have to write a custom query to display members, groups, or activities anywhere on a page or post. The other option was to install a plugin to do it and use a widget or shortcode to place it somewhere in the content.</p>\n\n\n\n<p>The Groups block, for example, lets you select any number of groups using auto-complete, to create a custom list. The block&rsquo;s toolbar has an option for displaying the groups in a list or a grid. In the block settings, users can show or hide group names, select full or thumbnail versions for avatars, and include extra information about the group. </p>\n\n\n\n<img />\n\n\n\n<h3>New Administration Screens for Member and Group Type Management</h3>\n\n\n\n<p>BuddyPress&rsquo; member types and group types&nbsp;are a feature similar to WordPress&rsquo; custom post types. They now have their own management screens in the admin, making them more accessible to community managers who would not be comfortable creating and modifying types without a UI. Member and group types can now be added, edited, and deleted directly in the admin. </p>\n\n\n\n<div class=\"wp-block-embed__wrapper\">\n\n</div>Source: <a href=\"https://buddypress.org/2020/12/buddypress-7-0-0-filippi/\">BuddyPress.org 7.0.0 release announcement</a>\n\n\n\n<h3>New Default Profile Image for Network Sites</h3>\n\n\n\n<p>Version 7.0.0 introduces the capability to add a default profile image for sites in a multisite network as part of the Site Tracking component. This can improve the appearance for the sites directory or the activity stream, when networked sites have not added a custom profile image.</p>\n\n\n\n<p>A few other notable improvements in 7.0.0 include the BP Nouveau template pack updated to be compatible with the new Twenty Twenty-One default theme, improvements to the BP REST API, and&nbsp;BuddyPress CLI commands expanded to cover more aspects of community management. Check out the <a href=\"https://codex.buddypress.org/releases/version-7-0-0/\">release notes</a> for a full list of changes.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sat, 12 Dec 2020 04:09:16 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:45;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:82:\"WPTavern: EditorPlus 2.4 Released, Builds Upon Its â€˜Extend Core Blocksâ€™ System\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=108825\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:195:\"https://wptavern.com/editorplus-2-4-released-builds-upon-its-extend-core-blocks-system?utm_source=rss&utm_medium=rss&utm_campaign=editorplus-2-4-released-builds-upon-its-extend-core-blocks-system\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5285:\"<p class=\"has-drop-cap\">On Tuesday of this week, Munir Kamal released version 2.4 of his <a href=\"https://wordpress.org/plugins/editorplus/\">EditorPlus plugin</a>. Aside from a few bugs and making sure the plugin was compatible with WordPress 5.6, he added an icon selector for the Button block and SVG shape overlays for the Image block. This is on top of a new &ldquo;Extend Core Blocks&rdquo; system he added in the previous version.</p>\n\n\n\n<p>I last <a href=\"https://wptavern.com/editor-plus-2-1-overhauls-block-controls-ui-and-adds-lottie-animations\">dove into the plugin</a> in early November. In Kamal&rsquo;s world, that may as well have been a lifetime ago. At an almost dizzying pace of development, he has since released three major updates to the plugin with several new features. I continue wondering where he not only finds the time to dedicate to the project for free but also where he keeps getting new ideas. Surely, some of them are coming from his growing user base. The plugin is still relatively young, and it has now passed 2,000 active installs.</p>\n\n\n\n<h2>The Extend Core Blocks System</h2>\n\n\n\n<p class=\"has-drop-cap\">When Kamal first built EditorPlus, the idea was to create additional styling options for the WordPress core blocks. Essentially, the plugin allowed end-users to set custom values for CSS properties from an interface in the editor. This can get the average user pretty deep into customization. However, it is still somewhat limiting. There are things that web developers can do with code that go beyond what such a basic interface can do. The question then becomes: <em>how do you provide those advanced methods to users?</em></p>\n\n\n\n<p>At the heart of the Extend Core Blocks system, which can be disabled from the plugin&rsquo;s settings screen, the plugin author wanted to push the limits of what is possible with WordPress&rsquo;s existing blocks.</p>\n\n\n\n<p>&ldquo;There are different extensions in EditorPlus that offer different features that you can toggle on or off,&rdquo; said Kamal. &ldquo;Like the styling, animations, custom CSS, etc., and now this new one. This extension will offer additional functionalities/features for the core Gutenberg blocks. For example, the &lsquo;list block&rsquo; extended with the option to include icons, split into columns, and more. Similarly, the plan is to extend other core blocks with additional missing features as well.&rdquo;</p>\n\n\n\n<img />Creating a two-column team list with icons.\n\n\n\n<p>In version 2.3, he created the first set of options with the new system. Starting with the List block, he added columns, options, icons, and several other options. Users can pick and choose from a range of icons from the Font Awesome and Icon Moon libraries.</p>\n\n\n\n<img />Adding a &ldquo;blob&rdquo; style to the Image block.\n\n\n\n<p>My favorite new feature is the custom &ldquo;blob&rdquo; styles Kamal has added to the Image block. &ldquo;I&rsquo;ve simply added 10 SVG shape masks as block styles for the core Image block,&rdquo; he said while also sharing a <a href=\"https://share.getcloudapp.com/v1u4xR58\">demo video</a>.</p>\n\n\n\n<p>While I am unsure if I have any immediate uses for blob-shaped images, I am excited about the possibility of other SVG shape masks landing in the future. I am sure there are many potential applications in design where they would be useful. If nothing else, they are fun to tinker around with.</p>\n\n\n\n<img />Customizing icons for the Button block.\n\n\n\n<p>Perhaps a bit more practical, Kamal added new icon options for the Button block. Like the List block, users can choose from both the Font Awesome and Icon Moon libraries. They can also select left or right alignment, change the background and foreground colors, round out the background with a border-radius option, and control the spacing.</p>\n\n\n\n<p>There are a couple of other block-related plugins with similar icon options. However, having them baked into EditorPlus was a good decision. Most of the plugin&rsquo;s users will likely find themselves ditching other block plugins with so much available through one.</p>\n\n\n\n<p>Kamal remained tight-lipped about any specific upcoming features in 2.5 and beyond. However, he did say that he would be continuing to build upon the Extend Core Blocks system. If his work thus far is any indication, it will be interesting to see what new options he brings to the other WordPress blocks.</p>\n\n\n\n<h2>Background Options</h2>\n\n\n\n<img />Adding an SVG background image to the Cover block.\n\n\n\n<p class=\"has-drop-cap\">While the new Extend Core Blocks system has been the focus of the last couple of releases, Kamal has added several other features. One of the biggest that he has pushed out is a set of new background options for every core block, which includes the following:</p>\n\n\n\n<ul><li>Insert image via URL.</li><li>Background attachment option.</li><li>Background placement option.</li></ul>\n\n\n\n<p>At this point, with EditorPlus, users can nearly do anything they need to do with backgrounds. The biggest boost of customizability comes with the image URL option, which means that users can even input a data URI for SVG patterns. <a href=\"https://www.heropatterns.com/\">Hero Patterns</a> has a ton of options to choose from for anyone who wants to give it a spin.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 11 Dec 2020 21:35:07 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:46;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:96:\"WPTavern: GitHub Introduces Darkmode, Discussions for Public Repositories, and Dependency Review\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=108775\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:233:\"https://wptavern.com/github-introduces-darkmode-discussions-for-public-repositories-and-dependency-review?utm_source=rss&utm_medium=rss&utm_campaign=github-introduces-darkmode-discussions-for-public-repositories-and-dependency-review\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:3026:\"<p>GitHub Universe, the company&rsquo;s annual marquee product and community event, took place this week, bringing users a flurry of new features. Dark mode is now in public beta and can be activated under the <a href=\"https://github.com/settings/appearance\">Settings</a> menu or set to follow system preferences. </p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>Discussions is a new feature that GitHub unveiled at its Satellite event in May to facilitate questions and open-ended conversations. The company has been testing it with open source communities like <a href=\"https://github.com/gatsbyjs/gatsby/discussions\">Gatsby</a> and <a href=\"https://github.com/laravel/framework/discussions\">Laravel</a> to iron out bugs ahead of the public launch. Discussions currently allows users to customize categories, transfer and pin discussions, and convert issues into discussion threads. Mobile support is coming soon.</p>\n\n\n\n<p>Participants on Discussions can search or sort conversations by newest, top, answered, and unanswered. Threads can be upvoted for better exposure and a sidebar widget displays the &ldquo;most helpful&rdquo; users. Discussions are essentially a modernized forum, with a little bit of gamification sprinkled in. for good measure.  </p>\n\n\n\n<div class=\"wp-block-image\"><img /></div>\n\n\n\n<p>Project maintainers for WordPress plugins, themes, and tools hosted on GitHub may want to explore Discussions to see if it could benefit their communities. The format is more approachable for less technical participants who may not be familiar with GitHub issues. </p>\n\n\n\n<p>Building on the existing&nbsp;<a href=\"https://help.github.com/en/github/visualizing-repository-data-with-graphs/listing-the-packages-that-a-repository-depends-on#about-the-dependency-graph\">dependency graph</a> and <a href=\"https://help.github.com/en/github/managing-security-vulnerabilities/about-security-alerts-for-vulnerable-dependencies\">security alerts</a> features, GitHub is introducing dependency review as a way to help developers catch vulnerable code before it gets added to their projects. Dependency review displays the following information for each pull request:</p>\n\n\n\n<ul><li>which dependencies were added, removed, or updated</li><li>release dates</li><li>how many projects use these components</li><li>vulnerability information for each dependency</li></ul>\n\n\n\n<p>The beta for the dependency review feature is now open to all public repositories and will be gradually rolled out across GitHub in the next few weeks.</p>\n\n\n\n<p>Other notable announcements include the ability to auto-merge pull requests when using protected branches, improvements to continuous delivery support, and GitHub Sponsors for companies, which allows organizations to use their existing billing to donate to open source developers and projects. Check out the full details in the <a href=\"https://github.blog/2020-12-08-new-from-universe-2020-dark-mode-github-sponsors-for-companies-and-more/\">announcement summary</a> from the event.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 11 Dec 2020 04:42:17 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:47;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:42:\"BuddyPress: BuddyPress 7.0.0 â€œFilippiâ€\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://buddypress.org/?p=316067\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"https://buddypress.org/2020/12/buddypress-7-0-0-filippi/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:13194:\"<p class=\"has-text-align-center\">This major release introduces new administration screens to manage your Member &amp; Group Types <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f64c.png\" alt=\"?\" class=\"wp-smiley\" /></p>\n\n\n\n<div class=\"wp-block-button aligncenter\"><a class=\"wp-block-button__link has-background no-border-radius\" href=\"https://downloads.wordpress.org/plugin/buddypress.7.0.0.zip\">Get BuddyPress 7.0.0</a></div>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<p>We are very excited to announce the immediate availability of&nbsp;<strong>BuddyPress 7.0.0</strong>&nbsp;code-named &#8220;<strong>Filippi</strong>&#8220;. You can get it clicking on the above button, downloading it from the&nbsp;<a href=\"https://wordpress.org/plugins/buddypress/\">WordPress.org plugin directory</a>&nbsp;or checking it out from our&nbsp;<a href=\"https://buddypress.trac.wordpress.org/browser/branches/7.0\">Subversion repository</a>.</p>\n\n\n\n<p><img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f449.png\" alt=\"?\" class=\"wp-smiley\" /> <em>If youâ€™re upgrading from a previous version of BuddyPress, itâ€™s always a good idea to back-up your WordPress database and files ahead of time.</em></p>\n\n\n\n<p>You can review all of the changes in this 7.0.0 release in the&nbsp;<a href=\"https://codex.buddypress.org/releases/version-7-0-0/\">release notes</a>. Below are a few of the key features we believe you are going to love!</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 class=\"has-text-align-center\">You can now manage your Member Types and/or Group Types right from your WordPress Dashboard</h2>\n\n\n\n<div class=\"wp-block-image\"><a href=\"https://buddypress.org/wp-content/uploads/1/2020/12/bp-types-illustration.png\"><img width=\"1043\" height=\"492\" src=\"https://buddypress.org/wp-content/uploads/1/2020/12/bp-types-illustration.png\" alt=\"Illustration showing how to access to the BP Types Admin areas.\" class=\"wp-image-316087\" /></a></div>\n\n\n\n<p>Playing with BP Types just became much easier! The Member Types and Group Types were primarily introduced in BuddyPress as features for advanced users, just like the WordPress Custom Post Type feature. Thanks to the two new&nbsp;<a href=\"https://bpdevel.wordpress.com/2020/09/21/bp-types-admin-ui/\">WordPress Administration Screens</a>, adding, editing and deleting Member &amp; Group Types has never been so easy! Now you can set up BP Types using custom code or by simply using the Administration interfaces.</p>\n\n\n\n<p>Let&#8217;s watch a demo about how it looks like for <strong>Member Types</strong>!</p>\n\n\n\n<a href=\"https://cldup.com/YbQ4VLuax3.mp4\" target=\"_blank\" rel=\"noreferrer noopener\">Fullscreen</a>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 class=\"has-text-align-center\">3 new BP Blocks for your WP Posts &amp; Pages</h2>\n\n\n\n<div class=\"wp-block-image is-style-default\"><a href=\"https://buddypress.org/wp-content/uploads/1/2020/12/bp-new-blocks.png\"><img width=\"678\" height=\"380\" src=\"https://buddypress.org/wp-content/uploads/1/2020/12/bp-new-blocks.png\" alt=\"Illustration showing the BuddyPress Blocks category inside the Block Editor Inserter.\" class=\"wp-image-316092\" /></a></div>\n\n\n\n<p>3 new BP Blocks are now available via your WordPress Editor. From the BuddyPress blocks category of the WordPress Block Inserter, you can pick a BP Block to feature a list of members, a list of groups or embed a public BuddyPress Activity into your post or page. Read more about it in this&nbsp;<a href=\"https://bpdevel.wordpress.com/2020/10/14/three-new-blocks-to-expect-in-buddypress-7-0-0/\">development note</a>.</p>\n\n\n\n<p>Here&#8217;s a quick video showing you how to insert a list of Members profile images into your home page.</p>\n\n\n\n<a href=\"https://cldup.com/pVH1gao77N.mp4\" target=\"_blank\" rel=\"noreferrer noopener\">Fullscreen</a>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 class=\"has-text-align-center\">A default profile image for the sites of your network</h2>\n\n\n\n<div class=\"wp-block-image\"><a href=\"https://buddypress.org/wp-content/uploads/1/2020/12/default-blavatar.png\"><img width=\"1099\" height=\"771\" src=\"https://buddypress.org/wp-content/uploads/1/2020/12/default-blavatar.png\" alt=\"Illustration of the BuddyPress Sites directory\" class=\"wp-image-316102\" /></a><em>Follow the white arrow to discover the new default profile image for sites.</em></div>\n\n\n\n<p>The Site Tracking component now has a default profile image it can use to make your Sites loop prettier if some of them have not customized their WordPress Site Icon. Multisite WordPress configurations will be able to find it when displaying the Sites directory. Read more about it in the&nbsp;<a href=\"https://bpdevel.wordpress.com/2020/11/01/meet-the-new-default-avatar-for-sites/\">development note</a>.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 class=\"has-text-align-center\">BP Nouveau is ready for Twenty Twenty-One <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f3a8.png\" alt=\"?\" class=\"wp-smiley\" /></h2>\n\n\n\n<a href=\"https://cldup.com/9C2ImNubyC.mp4\" target=\"_blank\" rel=\"noreferrer noopener\">Fullscreen</a>\n\n\n\n<p>You love the latest default WordPress Theme, so do we! Itâ€™s important for us to make sure the BP Nouveau template pack looks great in the default themes included in the WordPress package. This is the first of the many improvements we are bringing to our default Template Pack.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 class=\"has-text-align-center\">BP REST API improvements</h2>\n\n\n\n<div><span class=\"dashicons dashicons-rest-api\"></span></div>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<p>The&nbsp;<a href=\"https://developer.buddypress.org/bp-rest-api/\">Developer documentation</a>&nbsp;has been updated according to the latest improvements weâ€™ve brought to the BuddyPress REST API.</p>\n\n\n\n<p>To name two: get the groups the logged in user is a member of, and create a blog when BuddyPress is activated on a network of WordPress sites. Read this&nbsp;<a href=\"https://bpdevel.wordpress.com/2020/11/14/buddypress-rest-api-whats-new-in-7-0-0/\">development note</a>&nbsp;to learn about all the others.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 class=\"has-text-align-center\">Improved support for WP CLI</h2>\n\n\n\n<div><span class=\"dashicons dashicons-arrow-right-alt2\"></span></div>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<p>WP-CLI is the command-line interface for WordPress. You can update plugins, configure multisite installs, and much more, all without using a web browser. In 7.0.0, you will be able to use new BuddyPress CLI commands to manage BuddyPress Group Meta, BuddyPress Activity Meta, activate or deactivate the BuddyPress signup feature and create BuddyPress-specific testing code for plugins.</p>\n\n\n\n<p>Discover more about it from this&nbsp;<a href=\"https://bpdevel.wordpress.com/2020/10/09/wp-cli-buddypress-2-0/\">developer note</a>.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 class=\"has-text-align-center\">Under the hood</h2>\n\n\n\n<div><span class=\"dashicons dashicons-admin-generic\"></span></div>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<p>7.0.0 includes more than 70 changes such as image lazy loading support, multiple Member Type assignment, a Docker ready development environment to improve your BuddyPress experience as users, and as contributors to our project.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 class=\"has-text-align-center\">Many thanks to the 55 contributors who helped us build &amp; translate BuddyPress 7.0.0</h2>\n\n\n\n<div><span class=\"dashicons dashicons-buddicons-buddypress-logo\"></span></div>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<p><a href=\"https://profiles.wordpress.org/oztaser/\">Adil Oztaser (oztaser)</a>, <a href=\"https://profiles.wordpress.org/boonebgorges/\">Boone B Gorges (boonebgorges)</a>, <a href=\"https://profiles.wordpress.org/sbrajesh/\">Brajesh Singh (sbrajesh)</a>, <a href=\"https://profiles.wordpress.org/corsky/\">corsky</a>, <a href=\"https://profiles.wordpress.org/dancaragea/\">Dan Caragea (dancaragea)</a>, <a href=\"https://profiles.wordpress.org/dcavins/\">David Cavins (dcavins)</a>, <a href=\"https://profiles.wordpress.org/devnik/\">devnik</a>,<a href=\"https://profiles.wordpress.org/dilipbheda/\">Dilip Bheda</a>, <a href=\"https://profiles.wordpress.org/dd32/\">Dion Hulse (dd32)</a>, <a href=\"https://profiles.wordpress.org/dragoeco/\">dragoeco</a>,<a href=\"https://profiles.wordpress.org/kebbet/\">Erik Betshammar (kebbet)</a>, <a href=\"https://profiles.wordpress.org/etatus/\">etatus</a>, <a href=\"https://github.com/ExoGeek/\">Didier Saintes (ExoGeek)</a>,&nbsp;<a href=\"https://profiles.wordpress.org/f2010525/\">è¯—è¯­ (f2010525)</a>,<a href=\"https://profiles.wordpress.org/mamaduka/\">George Mamadashvili</a>, <a href=\"https://profiles.wordpress.org/mociofiletto/\">Giuseppe (mociofiletto)</a>, <a href=\"https://profiles.wordpress.org/hareesh-pillai/\">Hareesh</a>,<a href=\"https://profiles.wordpress.org/iamthewebb/\">iamthewebb</a>,&nbsp;<a href=\"https://profiles.wordpress.org/nobnob/\">Javier Esteban (nobnob)</a>, <a href=\"https://profiles.wordpress.org/audrasjb/\">Jb Audras (audrasjb)</a>, <a href=\"https://profiles.wordpress.org/johnjamesjacoby/\">John James Jacoby (johnjamesjacoby)</a>, <a href=\"https://profiles.wordpress.org/joost-abrahams/\">Joost Abrahams (joost-abrahams)</a>, <a href=\"https://profiles.wordpress.org/k3690/\">k3690</a>, <a href=\"https://profiles.wordpress.org/knutsp/\">Knut Sparhell (knutsp)</a>, <a href=\"https://profiles.wordpress.org/laxman-prajapati/\">Laxman Prajapati</a>, <a href=\"https://profiles.wordpress.org/lidialab/\">Lidia Pellizzaro (lidialab)</a>, <a href=\"https://profiles.wordpress.org/marbaque/\">marbaque</a>,&nbsp;<a href=\"https://github.com/geckse/\">Marcel Claus (geckse)</a>, <a href=\"https://profiles.wordpress.org/marioshtika/\">marioshtika</a>,<a href=\"https://profiles.wordpress.org/markscottrobson/\">Mark Robson (markscottrobson)</a>, <a href=\"https://profiles.wordpress.org/imath/\">Mathieu Viet (imath)</a>, <a href=\"https://profiles.wordpress.org/mercime/\">mercime</a>,&nbsp; <a href=\"https://profiles.wordpress.org/immeet94/\">Meet Makadia</a>, <a href=\"https://profiles.wordpress.org/tw2113/\">Michael Beckwith</a>, <a href=\"https://profiles.wordpress.org/man4toman/\">Morteza Geransayeh (man4toman)</a>, <a href=\"https://profiles.wordpress.org/morenolq/\">morenolq</a>, <a href=\"https://profiles.wordpress.org/n33d/\">N33D</a>, <a href=\"https://profiles.wordpress.org/oddev56/\">oddev56</a>, <a href=\"https://profiles.wordpress.org/DJPaul/\">Paul Gibbs (DJPaul)</a>, <a href=\"https://profiles.wordpress.org/walbo/\">Petter WalbÃ¸ JohnsgÃ¥rd (walbo)</a>, <a href=\"https://profiles.wordpress.org/psmits1567/\">Peter Smits (psmits1567)</a>, <a href=\"https://profiles.wordpress.org/pooja1210/\">Pooja N Muchandikar (pooja1210)</a>, <a href=\"https://profiles.wordpress.org/raruto/\">Raruto</a>, <a href=\"https://profiles.wordpress.org/r-a-y/\">r-a-y</a>, <a href=\"https://profiles.wordpress.org/espellcaste/\">Renato Alves (espellcaste)</a>, <a href=\"https://profiles.wordpress.org/scipi/\">scipi</a>, <a href=\"https://profiles.wordpress.org/scottopolis/\">Scott Bolinger (scottopolis)</a>, <a href=\"https://profiles.wordpress.org/shanebp/\">shanebp</a>, <a href=\"https://profiles.wordpress.org/shawfactor/\">shawfactor</a>, <a href=\"https://profiles.wordpress.org/sjregan/\">sjregan</a>, <a href=\"https://profiles.wordpress.org/netweb/\">Stephen Edgar (netweb)</a>, <a href=\"https://profiles.wordpress.org/tharsheblows/\">tharsheblows</a>, <a href=\"https://profiles.wordpress.org/tobifjellner/\">Tor-Bjorn Fjellner (tobifjellner)</a>, <a href=\"https://profiles.wordpress.org/vapvarun/\">Varun Dubey (vapvarun)</a> &amp; <a href=\"https://profiles.wordpress.org/podporawebu/\">wp24.cz (podporawebu)</a>.</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 class=\"has-text-align-center\">BuddyPress <strong>Filippi</strong></h2>\n\n\n\n<div class=\"wp-block-image\"><img width=\"150\" height=\"150\" src=\"https://buddypress.org/wp-content/uploads/1/2019/09/pizza.png\" alt=\"\" class=\"wp-image-308073\" /></div>\n\n\n\n<p>7.0.0 is code-named <strong>&#8220;Filippi&#8221;</strong> after <a rel=\"noreferrer noopener\" href=\"https://realcheesepizza.com/\" target=\"_blank\">Filippi&#8217;s Pizza Grotto</a> in lovely San Diego, California, USA. The &#8220;Grotto&#8221; is in the back room of an Italian grocery and butcher shop in Little Italy. Tall pizza lovers will have to watch out for the Chianti bottles hanging from the ceiling, but the red-and-white-checked-tablecloth atmosphere and piled-high pizza is worth it!</p>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<h2 class=\"has-text-align-center\">Feedback is always welcome <img src=\"https://s.w.org/images/core/emoji/13.0.1/72x72/1f60d.png\" alt=\"?\" class=\"wp-smiley\" /></h2>\n\n\n\n<div><span class=\"dashicons dashicons-megaphone\"></span></div>\n\n\n\n<div class=\"wp-block-spacer\"></div>\n\n\n\n<p>Receiving your feedback &amp; suggestions for future versions of BuddyPress genuinely motivates and encourages our contributors. Please share your feedback about this version of BuddyPress in the comments area of this post. And of course, if you&#8217;ve found a bug: please tell us about it into our <a href=\"https://buddypress.org/support/\">Support forums</a>.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 10 Dec 2020 22:00:07 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Mathieu Viet\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:48;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"WPTavern: State of the Word 2020 Scheduled for December 17, with Virtual Q&amp;A\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=108628\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:193:\"https://wptavern.com/state-of-the-word-2020-scheduled-for-december-17-with-virtual-qa?utm_source=rss&utm_medium=rss&utm_campaign=state-of-the-word-2020-scheduled-for-december-17-with-virtual-qa\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:5941:\"<p>WordCamp US 2020, previously scheduled for October, was cancelled due to <a href=\"https://wptavern.com/wordcamp-us-2020-canceled-due-to-pandemic-stress-and-online-event-fatigue\">pandemic stress and online event fatigue</a>. Organizers did not opt for running it as an online event, but Matt Mullenweg&rsquo;s annual State of the Word address will be delivered virtually this year. It will be streamed on <a href=\"https://www.facebook.com/WordPress/\">Facebook</a>, <a href=\"https://www.youtube.com/wordpress\">YouTube</a>, and&nbsp;<a href=\"https://twitter.com/wordpress\">Twitter</a>&nbsp;on&nbsp;<a href=\"https://www.timeanddate.com/countdown/generic?iso=20201217T08&p0=224&msg=State+of+the+Word+2020&font=slab&csz=1\">Thursday, Dec 17th, 2020&nbsp; at 1600 UTC</a>.</p>\n\n\n\n<p>In previous years, the State of the Word has been one the most highly anticipated keynotes at WordCamp US. Attendees pack into the venue&rsquo;s auditorium in anticipation of hearing about all of the highlights and milestones the WordPress community has achieved over the past year. Mullenweg often uses the time to recast his vision for the project and deliver important announcements. </p>\n\n\n\n<p>This year has been unlike anything we have experienced before, but one thing has remained constant &ndash; WordPress&rsquo; phenomenal growth continues, as other major open source CMS&rsquo;s are slowly declining. It is currently sitting at <a href=\"https://w3techs.com/technologies/details/cm-wordpress\">39.3%</a> of the Alexa top 10 million,&nbsp;4.2% higher than November 2019, according to Joost de Valk&rsquo;s biannual <a href=\"https://joost.blog/cms-market-share-november-2020-analysis/\">analysis</a> of the CMS market share. de Valk attributes much of that growth to WooCommerce, which accounts for more than 18% of all the WordPress sites W3techs can detect. </p>\n\n\n\n<p>Despite the global upheaval caused by the coronavirus, WordPress&rsquo; development has remained steady. More than 605 people contributed to the last major release (5.6) and there were 805 for the previous release (with 38% of them being new contributors.) In addition to reinventing WordCamps for the new virtual event frontier, the community team has also <a href=\"https://make.wordpress.org/community/2020/08/12/learn-wordpress-is-live/\">launched</a> the <a href=\"https://learn.wordpress.org/\">Learn WordPress</a> platform to make educational resources more globally available, placing a new emphasis on training. The platform is cracking open a world of WordPress knowledge that was previously relegated to more limited in-person audiences.</p>\n\n\n\n<p>&ldquo;Since we&rsquo;ve collectively come to the realization that talks and training content can be delivered and consumed asynchronously, there will be less need to use the high-bandwidth time of physical events to passively watch a talk where we aren&rsquo;t actively engaging with others,&rdquo; WordPress community manager Hugh Lashbrooke said in a <a href=\"https://hugh.blog/2020/12/03/building-community-in-a-post-covid-world/\">post</a> with predictions on post-COVID community building. &ldquo;The focus of these valuable meetings will rather be on interpersonal connection and mutual learning through active participation.&rdquo;</p>\n\n\n\n<p>Lashbrooke&rsquo;s predictions recognize a friction that has always existed at WordCamps: the &ldquo;hallway track&rdquo; is more engaging and more popular than most of the talks given at events. It&rsquo;s the interpersonal connection that people crave more than turning up for sessions that are usually being recorded anyway.</p>\n\n\n\n<p>To those who have been homebound for the better part of this year, it may feel as though the world is standing still. But the WordPress community has put many meaningful changes in motion in response to the pandemic&rsquo;s unique challenges. Despite all the uncertainty, WordPress is moving forward like a steady ship, with reliable improvements to the software and the community, thanks to the goodwill and cooperation of its unwavering base of contributors. This stability is worthy of commendation among this year&rsquo;s milestones and is a testament to the maturity of the project.</p>\n\n\n\n<h3>Join the Virtual Q&amp;A by Submitting a Pre-Recorded Video</h3>\n\n\n\n<p>Matt Mullenweg will be running the Q&amp;A portion of his address virtually this year, with pre-recorded videos of questions from the audience. WordPress Executive Director Josepha Haden Chomphosy <a href=\"https://wordpress.org/news/2020/12/state-of-the-word-2020/\">outlined</a> the instructions for participating:</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>To take part, record a video of you asking your question to Matt on your computer or phone (landscape format, please). Don&rsquo;t forget to include your name and how you use WordPress! Try to keep your video to under a minute so Matt can answer as many questions as possible. </p></blockquote>\n\n\n\n<p>There are some positive aspects of this method but also a few drawbacks. It can create a more polished and efficient experience of Q&amp;A where the audience is less likely to have to sit through long, rambling questions. It also allows equal opportunity for people living in all time zones to submit a question.</p>\n\n\n\n<p>On the other hand, the questions will be screened and pre-selected, allowing more preparation time for the answers. A live Q&amp;A offers the opportunity to catch the person off guard and get answers that might not be delivered the same way in a different format. Pre-recorded videos have a few trade-offs but they may be the best option we have for this event.</p>\n\n\n\n<p>The deadline to submit video questions is Friday, December 11, 2020. Haden recommends participants upload their videos to YouTube as &ldquo;<a href=\"https://support.google.com/youtube/answer/157177\">unlisted</a>&rdquo; and send a link to&nbsp;<a href=\"mailto:ask-matt@wordcamp.org\">ask-matt@wordcamp.org</a>.&nbsp;</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 10 Dec 2020 05:57:20 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:13:\"Sarah Gooding\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:49;a:6:{s:4:\"data\";s:13:\"\n	\n	\n	\n	\n	\n	\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:2:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:93:\"WPTavern: WordPress 5.6 â€œSimoneâ€ Includes New Twenty Twenty-One Theme and Improved Editor\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"https://wptavern.com/?p=108446\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:219:\"https://wptavern.com/wordpress-5-6-simone-includes-new-twenty-twenty-one-theme-and-improved-editor?utm_source=rss&utm_medium=rss&utm_campaign=wordpress-5-6-simone-includes-new-twenty-twenty-one-theme-and-improved-editor\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:9657:\"<img />Nina Simone<br />License: CC0 | Credit: <a href=\"https://commons.wikimedia.org/wiki/File:Nina_Simone_geeft_een_interview_in_het_Hilton_in_Amsterdam_in_het_kader_van_haar_nieuwe_album_%27Pastel_Blues%27,_NL-HlmNHA_1478_03720_K.JPG\">Noord-Hollands Archief / Fotoburo de Boer</a>\n\n\n\n<p class=\"has-drop-cap\">WordPress 5.6 &ldquo;Simone,&rdquo; named in honor of American performer and civil rights activist Nina Simone, was <a href=\"https://wordpress.org/news/2020/12/simone/\">released today</a> and is now available for download. The release was led by an <a href=\"https://wptavern.com/wordpress-5-6-development-kicks-off-with-all-women-release-squad\">all-women release squad</a>, a first in WordPress history. The new version includes many enhancements for the block editor, accessibility improvements, application password support for the REST API, and a new default theme.</p>\n\n\n\n<p>This release saw contributions from 605 volunteers who were involved with almost 350 Trac tickets and over 1,000 pull requests on GitHub.</p>\n\n\n\n<p>The following women formed the release squad for the 5.6 release:</p>\n\n\n\n<ul><li><strong>Release Lead:</strong> Josepha Haden. Cohort: Chlo&eacute; Bringmann and Angela Jin.</li><li><strong>Release Coordinator:</strong> Dee Teal. Cohort: Thelma Mutete and Laura Nelson.</li><li><strong>Triage Lead:</strong> Tonya Mork.</li><li><strong>Core Tech Lead:</strong> Helen Hou-Sand&igrave;. Cohort: Amy Kamala and Ebonie Butler.</li><li><strong>Editor Tech Lead: </strong>Isabel Brison. Cohort: Chandrika Guntur, Anchen le Roux, and Rebecca Hum.</li><li><strong>Design Leads:</strong> Ellen Bauer and Tammie Lister. Cohort: Anyssa Ferreira, Estela Rueda, Tracy Apps, and Sophia DeRosia.</li><li><strong>Design Tech Lead:</strong> Shital Marakana.</li><li><strong>Accessibility Lead:</strong> Sarah Ricker. Cohort: Hauwa Abashiya.</li><li><strong>Marketing and Communications Leads:</strong> Abha Thakor and Yvette Sonneveld. Cohort: Nalini Thakor, Meher Bala, Olga Gleckler, Larissa Murrillo, Michelle Frechette, Breann McDede, and Afshana Diya.</li><li><strong>Documentation Lead:</strong> Shawntelle Coker. Cohort: Daisy Olsen, Meher Bala, and Winstina Hughes.</li><li><strong>Documentation Review Lead:</strong> Michele Butcher-Jones. Cohort: Nidhi Jain and Laura Byrne Cristiano.</li><li><strong>Default Theme Design Lead:</strong> Mel Choyce-Dwan. Cohort: Ellen Bauer.</li><li><strong>Default Theme Development Lead:</strong> Carolina Nymark. Cohort: Kelly Choyce-Dwan&nbsp;and Jessica Lyschik.</li><li><strong>Default Theme Wrangler:</strong> Jessica Lyschik.</li><li><strong>Test Lead: </strong>Monika Rao. Cohort: Allie Nimmons.</li><li><strong>Support Lead:</strong> Bet Hannon.</li></ul>\n\n\n\n<p>At times, the 5.6 development cycle felt a bit rocky. Block-based <a href=\"https://wptavern.com/wordpress-5-6-release-team-pulls-the-plug-on-block-based-widgets\">widgets</a> and <a href=\"https://wptavern.com/navigation-screen-sidelined-for-wordpress-5-6-full-site-editing-edges-closer-to-public-beta\">nav menus</a>, features expected to ship, were punted for a second time to a future release. These were hard decisions, but good leadership means making tough calls to hold off on features that are not ready for production.</p>\n\n\n\n<p>&ldquo;You know, I was really hopeful for it too, and that last-minute call was one I labored over,&rdquo; said Josepha Haden after pushing block-based widgets back. &ldquo;When I last looked, it did seem close to ready, but then more focused testing was done and there were some interactions that are a little rough for users. I&rsquo;m grateful for that because the time to discover painful user experiences is before launch rather than after!&rdquo;</p>\n\n\n\n<p>Despite dropping what would have been major transitional features from the classic WordPress theming paradigm in preparation for WordPress 5.7&rsquo;s expected site editor, the release still has a lot to offer.</p>\n\n\n\n<h2>Block Editor Enhancements</h2>\n\n\n\n<img />New dropdown for selecting block pattern category.\n\n\n\n<p class=\"has-drop-cap\">The Gutenberg plugin development team continues to make small but vital improvements to the block editor. They have also tacked on many new features in the past few months. Features from Gutenberg versions 8.6 &ndash; 9.2 are included in the update, along with bug fixes and performance improvements from 9.3 and 9.4.</p>\n\n\n\n<p>Much of the work this development cycle has been focused on the upcoming site editor. There was some initial hope that a beta version of it would land in the 5.6 release. It was a part of the proposed scope. However, the feature is still months away from being ready. This is not a bad thing. It needs more time to mature, and there should be no rush in integrating a feature that affects so many pieces of the platform.</p>\n\n\n\n<p>What end-users will see with this update is a more polished editor. Whether it is extra options for blocks or a dropdown select for block pattern categories, hundreds of minor changes have all led to a better overall experience.</p>\n\n\n\n<p>WP Tavern has covered nearly every major Gutenberg plugin release this cycle &mdash; <em>looks like we missed 8.8, sorry</em>. Catch up with anything you missed about editor changes from the following posts:</p>\n\n\n\n<ul><li><a href=\"https://wptavern.com/gutenberg-8-6-adds-cover-block-video-positioning-and-updates-block-patterns\">Gutenberg 8.6 Adds Cover Block Video Positioning and Updates Block Patterns</a></li><li><a href=\"https://wptavern.com/gutenberg-8-7-adds-minor-changes-updates-block-pattern-designs-and-continues-full-site-editing-work\">Gutenberg 8.7 Adds Minor Changes, Updates Block Pattern Designs, and Continues Full-Site Editing Work</a></li><li><a href=\"https://wptavern.com/gutenberg-8-9-brings-block-based-widgets-out-of-the-experimental-stage\">Gutenberg 8.9 Brings Block-Based Widgets Out of the Experimental Stage</a></li><li><a href=\"https://wptavern.com/gutenberg-9-0-brings-major-improvements-to-navigation-screen-and-query-block\">Gutenberg 9.0 Brings Major Improvements to Navigation Screen and Query Block</a></li><li><a href=\"https://wptavern.com/gutenberg-9-1-adds-patterns-category-dropdown-and-reverts-block-based-widgets-in-the-customizer\">Gutenberg 9.1 Adds Patterns Category Dropdown and Reverts Block-Based Widgets in the Customizer</a></li><li><a href=\"https://wptavern.com/gutenberg-9-2-adds-video-tracks-improvements-to-columns-and-cover-blocks\">Gutenberg 9.2 Adds Video Tracks, Improvements to Columns and Cover Blocks</a></li><li><a href=\"https://wptavern.com/gutenberg-9-3-provides-indicator-of-where-full-site-editing-is-going-a-future-without-widgets-and-customizer-screens\">Gutenberg 9.3 Provides Indicator of Where Full-Site Editing Is Going, a Future Without Widgets and Customizer Screens</a></li><li><a href=\"https://wptavern.com/gutenberg-9-4-introduces-button-width-selector-and-typography-controls-for-list-block\">Gutenberg 9.4 Introduces Button Width Selector and Typography Controls for List Block</a></li></ul>\n\n\n\n<h2>Twenty Twenty-One Theme</h2>\n\n\n\n<img />Inserting a Twenty Twenty-One block pattern into a post.\n\n\n\n<p class=\"has-drop-cap\">Twenty Twenty-One, <a href=\"https://wptavern.com/first-look-at-twenty-twenty-one-wordpresss-upcoming-default-theme\">the new default theme</a> for the upcoming year, takes full advantage of all the latest and greatest features of the block editor. While last year&rsquo;s Twenty Twenty theme had a successful launch, the development team behind the new default has had more time to explore building themes in the block era.</p>\n\n\n\n<p>The theme makes use of more visual artistry. It will not be for everyone. It offers a wide range of color schemes for end-users, but it lends itself best to bloggers and other creators who prefer a bit of flair with their website&rsquo;s design.</p>\n\n\n\n<p>The best thing is that it pushes the envelope with the block patterns feature, which was not available when Twenty Twenty landed a year ago. Older default themes will be <a href=\"https://wptavern.com/past-twenty-wordpress-themes-to-get-new-block-patterns\">getting the block-pattern treatment</a>. However, Twenty Twenty-One will be the first default built with custom patterns in mind from the get-go.</p>\n\n\n\n<p>For users who cannot wait for the site editor to land in WordPress, expected in some form in the 5.7 release, there is an alternate <a href=\"https://wptavern.com/twenty-twenty-one-blocks-theme-launching-as-a-separate-project\">Twenty Twenty-One Blocks</a> theme to tinker with.</p>\n\n\n\n<h2>Application Passwords for the REST API</h2>\n\n\n\n<p class=\"has-drop-cap\">Despite being a part of the core platform since 2015, the REST API has lacked support for application passwords. Such a feature is vital for third-party applications to communicate with WordPress. Previously, requests had to be run through cookie and nonce-based authentication. Else, they would need to use the legacy XML-RPC API. This limitation has also affected the mobile WordPress development teams, making it tough to support the block editor, which relies on the REST API.</p>\n\n\n\n<p>The <a href=\"https://wptavern.com/wordpress-5-6-to-introduce-application-passwords-for-rest-api-authentication\">application passwords feature</a> will make it easier for applications to make API requests as well as request and revoke credentials.</p>\n\n\n\n<p>The REST API promised a future for all types of applications built upon and around WordPress. However, this vision has not panned out over the years on a broad scale. With a major limiting factor removed, perhaps there is still hope for robust applications in the coming years.</p>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 09 Dec 2020 00:07:16 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:14:\"Justin Tadlock\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";O:42:\"Requests_Utility_CaseInsensitiveDictionary\":1:{s:7:\"\0*\0data\";a:8:{s:6:\"server\";s:5:\"nginx\";s:4:\"date\";s:29:\"Mon, 11 Jan 2021 10:40:09 GMT\";s:12:\"content-type\";s:8:\"text/xml\";s:4:\"vary\";s:15:\"Accept-Encoding\";s:13:\"last-modified\";s:29:\"Mon, 11 Jan 2021 10:30:07 GMT\";s:15:\"x-frame-options\";s:10:\"SAMEORIGIN\";s:4:\"x-nc\";s:9:\"HIT ord 2\";s:16:\"content-encoding\";s:4:\"gzip\";}}s:5:\"build\";s:14:\"20200501142608\";}','no');
