	(811,'_transient_dash_v2_5f25301ca0145abac6dfc3a0899dc43b','<div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'https://en-gb.wordpress.org/2020/12/09/wordpress-5-6-simone/\'>WordPress 5.6 â€œSimoneâ€</a></li></ul></div><div class=\"rss-widget\"><ul><li><a class=\'rsswidget\' href=\'https://wptavern.com/wordpress-community-team-proposes-using-a-decision-checklist-to-restart-local-events?utm_source=rss&#038;utm_medium=rss&#038;utm_campaign=wordpress-community-team-proposes-using-a-decision-checklist-to-restart-local-events\'>WPTavern: WordPress Community Team Proposes Using a Decision Checklist to Restart Local Events</a></li><li><a class=\'rsswidget\' href=\'https://ma.tt/2021/01/autonomous-and-beautiful-home-devices/\'>Matt: Autonomous and Beautiful Home Devices</a></li><li><a class=\'rsswidget\' href=\'https://wptavern.com/blocked-based-version-of-twenty-twenty-one-nearing-readiness-for-the-theme-directory?utm_source=rss&#038;utm_medium=rss&#038;utm_campaign=blocked-based-version-of-twenty-twenty-one-nearing-readiness-for-the-theme-directory\'>WPTavern: Blocked-Based Version of Twenty Twenty-One Nearing Readiness for the Theme Directory</a></li></ul></div>','no'),
