mdash; Please select your email address.<\\/p>\\n<\\/div>\\n\\n<div class=\\\"error submission-error subject-error\\\" style=\\\"display: none;\\\">\\n\\t<p><strong>Error!<\\/strong> &mdash; Please enter a subject.<\\/p>\\n<\\/div>\\n\\n<div class=\\\"error submission-error message-error\\\" style=\\\"display: none;\\\">\\n\\t<p><strong>Error!<\\/strong> &mdash; Please enter a message.<\\/p>\\n<\\/div>\\n\\n<div class=\\\"error submission-error remote-diagnostic-content-error\\\" style=\\\"display: none;\\\">\\n\\t<p><strong>Error!<\\/strong> &mdash; Please paste in the Diagnostic Info &amp; Error Log from your <strong>remote site<\\/strong>.<\\/p>\\n<\\/div>\\n\\n<div class=\\\"error submission-error both-diagnostic-same-error\\\" style=\\\"display: none;\\\">\\n\\t<p><strong>Error!<\\/strong> &mdash; Looks like you pasted the local Diagnostic Info &amp; Error Log into the textbox for the remote info. Please get the info for your <strong>remote site<\\/strong> and paste it in, or just uncheck the second checkbox if you&#8217;d rather not include your remote site info.<\\/p>\\n<\\/div>\\n\\n<form target=\\\"_blank\\\" method=\\\"post\\\" action=\\\"https:\\/\\/api.deliciousbrains.com\\/?wc-api=delicious-brains&request=submit_support_request&licence_key=629e05b9-1449-48a9-be8d-83bbc1128332&product=wp-migrate-db-pro\\\">\\n\\n\\t<div class=\\\"field from\\\">\\n\\t\\t<label>From:<\\/label>\\n\\t\\t<select name=\\\"email\\\">\\n\\t\\t<option value=\\\"\\\">&mdash; Select your email address &mdash;<\\/option>\\n\\t\\t<option value=\\\"m.oliver.smith@gmail.com\\\">m.oliver.smith@gmail.com<\\/option>\\t\\t<\\/select>\\n\\n\\t\\t<p class=\\\"note\\\">\\n\\t\\t\\tReplies will be sent to this email address. Update your name &amp; email in <a href=\\\"https:\\/\\/deliciousbrains.com\\/my-account\\/\\\">My Account<\\/a>.\\t\\t<\\/p>\\n\\t<\\/div>\\n\\n\\t<div class=\\\"field subject\\\">\\n\\t\\t<input type=\\\"text\\\" name=\\\"subject\\\" placeholder=\\\"Subject\\\">\\n\\t<\