INSERT INTO `mc33_wfissues` (`id`, `time`, `lastUpdated`, `status`, `type`, `severity`, `ignoreP`, `ignoreC`, `shortMsg`, `longMsg`, `data`)
VALUES
	(31,1610361612,1610361612,'new','skippedPaths',25,'6fd0d290b978eab8027e6b79501ac149','6fd0d290b978eab8027e6b79501ac149','3 paths were skipped for the malware scan due to scan settings','The option \"Scan files outside your WordPress installation\" is off by default, which means 3 paths and their file(s) will not be scanned for malware or unauthorized changes. To continue skipping these paths, you may ignore this issue. Or to start scanning them, enable the option and subsequent scans will include them. Some paths may not be necessary to scan, so this is optional. <a href=\"https://www.wordfence.com/help/?query=scan-result-skipped-paths\" target=\"_blank\" rel=\"noopener noreferrer\">Learn More</a><br><br>The paths skipped are ~/.git, ~/docs, and ~/exports_drupal','a:0:{}'),
	(32,1610361782,1610361782,'new','wfUpgrade',75,'675f57bd75ab1c0f524e53b5f7f714dc','675f57bd75ab1c0f524e53b5f7f714dc','Your WordPress version is out of date','WordPress version 5.6 is now available. Please upgrade immediately to get the latest security updates from WordPress.','a:2:{s:14:\"currentVersion\";s:5:\"5.5.3\";s:10:\"newVersion\";s:3:\"5.6\";}'),
	(33,1610361782,1610361782,'new','wfPluginUpgrade',50,'4138a05168fe23a07dbcbe8c77468b57','4138a05168fe23a07dbcbe8c77468b57','The Plugin \"Print, PDF &amp; Email by PrintFriendly\" needs an upgrade (3.15.0 -> 3.16.0).','You need to upgrade \"Print, PDF &amp; Email by PrintFriendly\" to the newest version to ensure you have any security fixes the developer has released.','a:18:{s:4:\"Name\";s:39:\"Print, PDF &amp; Email by PrintFriendly\";s:9:\"PluginURI\";s:28:\"http://www.printfriendly.com\";s:7:\"Version\";s:6:\"3.15.0\";s:11:\"Description\";s:207:\"PrintFriendly &amp; PDF button for your website. Optimizes your pages and brand for print, pdf, and email. <cite>By <a href=\"http://www.PrintFriendly.com\">Print, PDF, &amp; Email by PrintFriendly</a>.</cite>\";s:6:\"Author\";s:83:\"<a href=\"http://www.PrintFriendly.com\">Print, PDF, &amp; Email by PrintFriendly</a>\";s:9:\"AuthorURI\";s:28:\"http://www.PrintFriendly.com\";s:10:\"TextDomain\";s:13:\"printfriendly\";s:10:\"DomainPath\";s:0:\"\";s:7:\"Network\";b:0;s:10:\"RequiresWP\";s:0:\"\";s:11:\"RequiresPHP\";s:0:\"\";s:5:\"Title\";s:82:\"<a href=\"http://www.printfriendly.com\">Print, PDF &amp; Email by PrintFriendly</a>\";s:10:\"AuthorName\";s:40:\"Print, PDF, &amp; Email by PrintFriendly\";s:10:\"pluginFile\";s:82:\"/Applications/MAMP/htdocs/miguel-inventory/wp-content/plugins/printfriendly/pf.php\";s:10:\"newVersion\";s:6:\"3.16.0\";s:4:\"slug\";s:13:\"printfriendly\";s:5:\"wpURL\";s:43:\"https://wordpress.org/plugins/printfriendly\";s:10:\"vulnerable\";b:0;}'),
	(34,1610361782,1610361782,'new','wfPluginUpgrade',50,'d1067d4221e2514beb849d8891eaf3d3','d1067d4221e2514beb849d8891eaf3d3','The Plugin \"Wordfence Security\" needs an upgrade (7.4.12 -> 7.4.14).','You need to upgrade \"Wordfence Security\" to the newest version to ensure you have any security fixes the developer has released.','a:18:{s:4:\"Name\";s:18:\"Wordfence Security\";s:9:\"PluginURI\";s:25:\"http://www.wordfence.com/\";s:7:\"Version\";s:6:\"7.4.12\";s:11:\"Description\";s:131:\"Wordfence Security &#8211; Anti-virus, Firewall and Malware Scan <cite>By <a href=\"http://www.wordfence.com/\">Wordfence</a>.</cite>\";s:6:\"Author\";s:49:\"<a href=\"http://www.wordfence.com/\">Wordfence</a>\";s:9:\"AuthorURI\";s:25:\"http://www.wordfence.com/\";s:10:\"TextDomain\";s:9:\"wordfence\";s:10:\"DomainPath\";s:10:\"/languages\";s:7:\"Network\";b:1;s:10:\"RequiresWP\";s:0:\"\";s:11:\"RequiresPHP\";s:0:\"\";s:5:\"Title\";s:58:\"<a href=\"http://www.wordfence.com/\">Wordfence Security</a>\";s:10:\"AuthorName\";s:9:\"Wordfence\";s:10:\"pluginFile\";s:85:\"/Applications/MAMP/htdocs/miguel-inventory/wp-content/plugins/wordfence/wordfence.php\";s:10:\"newVersion\";s:6:\"7.4.14\";s:4:\"slug\";s:9:\"wordfence\";s:5:\"wpURL\";s:39:\"https://wordpress.org/plugins/wordfence\";s:10:\"vulnerable\";b:0;}'),
	(35,1610361782,1610361782,'new','wfPluginUpgrade',50,'4fda20791d87f652bfb4a9c296c36546','4fda20791d87f652bfb4a9c296c36546','The Plugin \"WP Offload Media Lite\" needs an upgrade (2.5 -> 2.5.2).','You need to upgrade \"WP Offload Media Lite\" to the newest version to ensure you have any security fixes the developer has released.','a:18:{s:4:\"Name\";s:21:\"WP Offload Media Lite\";s:9:\"PluginURI\";s:61:\"http://wordpress.org/extend/plugins/amazon-s3-and-cloudfront/\";s:7:\"Version\";s:3:\"2.5\";s:11:\"Description\";s:275:\"Automatically copies media uploads to Amazon S3, DigitalOcean Spaces or Google Cloud Storage for storage and delivery. Optionally configure Amazon CloudFront or another CDN for even faster delivery. <cite>By <a href=\"https://deliciousbrains.com/\">Delicious Brains</a>.</cite>\";s:6:\"Author\";s:59:\"<a href=\"https://deliciousbrains.com/\">Delicious Brains</a>\";s:9:\"AuthorURI\";s:28:\"https://deliciousbrains.com/\";s:10:\"TextDomain\";s:24:\"amazon-s3-and-cloudfront\";s:10:\"DomainPath\";s:11:\"/languages/\";s:7:\"Network\";b:1;s:10:\"RequiresWP\";s:0:\"\";s:11:\"RequiresPHP\";s:0:\"\";s:5:\"Title\";s:97:\"<a href=\"http://wordpress.org/extend/plugins/amazon-s3-and-cloudfront/\">WP Offload Media Lite</a>\";s:10:\"AuthorName\";s:16:\"Delicious Brains\";s:10:\"pluginFile\";s:103:\"/Applications/MAMP/htdocs/miguel-inventory/wp-content/plugins/amazon-s3-and-cloudfront/wordpress-s3.php\";s:10:\"newVersion\";s:5:\"2.5.2\";s:4:\"slug\";s:24:\"amazon-s3-and-cloudfront\";s:5:\"wpURL\";s:54:\"https://wordpress.org/plugins/amazon-s3-and-cloudfront\";s:10:\"vulnerable\";b:0;}');
